padding: 5px 0px;"> </p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan="2" style="height: 36px; width: 984px;">\r\n			<p style="margin:0px; padding:5px 0px; text-align:center"><img alt="300-mau-cua-nhom-cao-cap-cua-nhua-loi-thep-sang-trong-thong-dung-nhat" src="http://www.kanvietnam.com/vnt_upload/File/Image/300-mau-cua-nhom-cao-cap-cua-nhua-loi-thep-sang-trong-thong-dung-nhat/KDQ_101.jpg" style="border: 0px; height: 520px; width: 750px;" /></p>\r\n\r\n			<p style="margin: 0px; padding: 5px 0px; text-align: center;"><span style="font-size: 14px;"><strong><u>Mẫu KDQ-101:</u></strong> Mẫu cửa nhôm, cửa nhựa lõi thép loại này sử dụng phù hợp cho cửa ra vào của các phòng,</span></p>\r\n\r\n			<p style="margin: 0px; padding: 5px 0px; text-align: center;"><span style="font-size: 14px;">sử dụng kính suốt kết hợp với rèm hoặc decal hoa văn</span></p>\r\n\r\n			<p style="margin:0px; padding:5px 0px; text-align:center"><img alt="300-mau-cua-nhom-cao-cap-cua-nhua-loi-thep-sang-trong-thong-dung-nhat" src="http://www.kanvietnam.com/vnt_upload/File/Image/300-mau-cua-nhom-cao-cap-cua-nhua-loi-thep-sang-trong-thong-dung-nhat/KDQ_102.jpg" style="border: 0px; height: 520px; width: 750px;" /></p>\r\n\r\n			<p style="margin: 0px; padding: 5px 0px; text-align: center;"><span style="font-size: 14px;"><strong><u>Mẫu KDQ-102:</u></strong> Mẫu cửa nhôm, cửa nhựa lõi thép loại này sử dụng phù hợp cho cửa ra vào của các phòng</span></p>\r\n\r\n			<p style="margin: 0px; padding: 5px 0px; text-align: center;"><span style="font-size: 14px;">hoặc cửa ban công, </span><span style="font-size: 14px;">sử dụng kính suốt kết hợp với rèm hoặc decal hoa văn</span></p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', '', '', '', '', '', 1, 1, 1450150066, 0, 0),
