(20, 0, 14, 0, 0, 'dichvu', 1, 0, 'phicongluan11449974222490x294-664.jpg', 'phicongluan11449974222490x294-664_200x160.jpg', 'Dịch vụ chuyên tuyến quốc tế', '', 'dich-vu-chuyen-tuyen-quoc-te', '', '', '', '', '', '', '', '', '', 0, 0, 0, 0, 'Bưu chính Viettel cam kết cung cấp đến Quý khách hàng dịch vụ chuyên tuyến quốc tế với chất lượng tốt nhất và giá cả cạnh tranh nhất', '<p style="text-indent: 0.25in; text-align: justify;"><span style="font-size: 14px; font-family: times new roman;">Với mạng lưới kết nối trực tiếp đến các quốc gia: CAMPUCHIA, TRUNG QUỐC, SINGAPORE, MALAYSIA, INDONESIA, THÁI LAN, PHILIPPIN, BRUNEY, NHẬT BẢN, HÀN QUỐC, ĐÀI LOAN, HONGKONG, LÀO và MACAU.</span></p>\r\n\r\n<p style="text-indent: 0.25in; text-align: justify;"><span style="font-size: 14px; font-family: times new roman;">Bưu chính Viettel cam kết cung cấp đến Quý khách hàng dịch vụ chuyên tuyến quốc tế với chất lượng tốt nhất và giá cả cạnh tranh nhất. Sử dụng dịch vụ của chúng tôi, Quý khách hàng có thể yên tâm về việc bưu gửi, hàng hóa của Quý khách sẽ được chúng tôi vận chuyển từ Việt Nam đến tận tay người nhận tại tất cả các tỉnh/thành phố của 12 quốc gia và vùng lãnh thổ nêu trên trong thời gian sớm nhất với độ an toàn cao nhất và mức chi phí phù hợp nhất.</span></p>\r\n\r\n<p style="text-indent: 0.25in; text-align: justify;"><span style="font-size: 14px; font-family: times new roman;">Mọi thông tin xin vui lòng liên hệ trực tiếp 63 chi nhánh bưu chính Viettel trên toàn quốc hoặc liên hệ số điện thoại: <strong>+84.4.6277.6811</strong>, hotline: <strong>19008095</strong>  Email: <a href="mailto:HTQT@viettelpost.com.vn">HTQT@viettelpost.com.vn</a></span></p>\r\n', '', '', '', '', '', 1, 1, 1450063974, 1450065212, 0),
(21, 0, 14, 0, 0, 'dichvu', 1, 0, 'suarez257731449946303-1191.jpg', 'suarez257731449946303-1191_200x160.jpg', 'Dịch vụ chuyển phát nhanh ', '', 'dich-vu-chuyen-phat-nhanh', '', '', '', '', '', '', '', '', '', 0, 0, 0, 0, 'Sau hơn 17 năm trong lĩnh vực chuyển phát nhanh Viettel post được đánh giá là một doanh nghiệp ngày càng lớn mạnh và chuyên nghiệp, dịch vụ chuyển phát nhanh của Viettel post', '<p style="text-align: justify;"><span class="NewsDetail_content" id="dnn_ctr2040_news_DichVu_Main_ctl00_lbContent"><span style="font-size: 14px; font-family: times new roman;">Hãy nhấc điện thoại và gọi cho Bưu chính Viettel khi bạn có nhu cầu gửi thư, quà, vận chuyển hóa đơn, hàng hóa. Dịch vụ của Viettel post đáng tin cậy như chính bạn tự tay chuyển phát. Chúng tôi sẽ giúp các bạn chiếm được cảm tình của bạn bè, người thân và các đối tác làm ăn.</span></span></p>\r\n\r\n<p style="text-align: justify;"><span class="NewsDetail_content" id="dnn_ctr2040_news_DichVu_Main_ctl00_lbContent"><span style="font-size: 14px; font-family: times new roman;">Sau hơn 17 năm trong lĩnh vực chuyển phát nhanh Viettel post được đánh giá là một doanh nghiệp ngày càng lớn mạnh và chuyên nghiệp, dịch vụ chuyển phát nhanh của Viettel post là dịch vụ nhận gửi, vận chuyển và phát các loại chứng từ, hàng hóa theo các chỉ tiêu thời gian đã công bố. Hàng hóa được vận chuyển bởi Viettel Post được bảo hiểm 100% giá trị hàng hóa nếu xảy ra mất mát, hư hỏng. Viettel Post cũng cam kết về bảo đảm an toàn hàng hóa và thời gian chuyển phát.</span></span></p>\r\n\r\n<p style="text-align: justify;"><span class="NewsDetail_content" id="dnn_ctr2040_news_DichVu_Main_ctl00_lbContent"><span style="font-size: 14px; font-family: times new roman;">Với Viettel Post, dịch vụ hoàn trả báo phát dễ dàng, nhanh chóng; thanh toán linh hoạt, tra cước online với các chính sách giá, khuyến mãi đặc biệt hấp dẫn. Quy trình khai thác bưu phẩm bưu kiện chuyên nghiệp, áp dụng cùng với các công nghệ hiện đại với mục đích phục vụ đáp ứng thỏa mãn khách hàng tốt nhất: Công nghệ PDA đọc mã vạch tự động, công nghệ In E-bill tự động cân điện tử áp dụng xác định khối trọng lượng bưu phẩm, bưu kiện, công nghệ định vị GPS xác định chính xác tọa độ, vị trí bưu phẩm, bưu kiện trên lịch trình chuyển phát.</span></span></p>\r\n\r\n<p style="text-align: justify;"><span class="NewsDetail_content" id="dnn_ctr2040_news_DichVu_Main_ctl00_lbContent"><span style="font-size: 14px; font-family: times new roman;">Viettel Post có hệ thống mạng lưới bưu cục 63 tỉnh thành, tuyến huyện xã, vùng sâu, vùng xa trên toàn quốc; phương tiện vận tải hiện đại và dịch vụ tra cứu thông tin trực tiếp trên trang web www.viettelpost.com.vn về gói hàng. Tùy vào các nhu cầu các bạn có thể chọn một trong các gói dịch vụ của chúng tôi: Dịch vụ 60h, dịch vụ bưu kiện, dịch vụ trong ngày, dịch vụ 12h…. Hoặc gọi trực tiếp cho chúng tôi để được tư vấn miễn phí qua hotline: <strong>19008095.</strong> Chúng tôi sẽ  giúp các bạn lựa chọn gói chuyển hợp lý và tiết kiệm chi phí nhất. </span></span></p>\r\n', '', '', '', '', '', 1, 1, 1450065247, 1450065254, 0),
