(36, 0, 0, 0, 0, 'hotrokhachhang', 1, 0, 'mychau-3493.jpg', 'mychau-3493_230x190.jpg', 'Chính sách bảo hành', '', 'chinh-sach-bao-hanh', '', '', '', '', '', '', 'Chính sách bảo hành', 'đồ gia dụng, đồ dùng nhà bếp, điện gia dụng, thủy tinh, nồi inox, chảo chống dính, xay sinh to, bàn ủi, xô nhựa, thau nhựa, chén, dĩa, camen, sành sứ, bếp ga mini, đồ dùng sinh hoạt', 'đồ gia dụng, đồ dùng nhà bếp, điện gia dụng, thủy tinh, nồi inox, chảo chống dính, xay sinh to, bàn ủi, xô nhựa, thau nhựa, chén, dĩa, camen, sành sứ, bếp ga mini, đồ dùng sinh hoạt', 0, 0, 0, 0, 'Chính sách bảo hành', '<p><span style="font-size:18px;">Căn cứ trên từng sản phẩm và đặc tính chi tiết chúng tôi sẽ có những quy chế bảo hành riêng biệt.</span></p>\r\n\r\n<p><span style="font-size:18px;">* Thông tin đến khách hàng những trung tâm bảo hành có địa chỉ gần nhà quý khách nhất.</span></p>\r\n\r\n<p><span style="font-size:18px;">* Sản phẩm chúng tôi bán luôn luôn kèm theo phiếu bảo hành ( nếu có ) trong từng sản phẩm</span></p>\r\n', '', '', '', '', '', 1, 1, 1452049334, 1458725236, 0),
