(39, 0, 0, 0, 0, 'header', 1, 0, 'a2-5917.png', 'a2-5917_86x86.png', 'Giao hàng tận nơi', '', 'giao-hang-tan-noi', '', '', '', '', '', '', 'Giao Hàng Tận Nơi', 'đồ gia dụng, đồ dùng nhà bếp, điện gia dụng, thủy tinh, nồi inox, chảo chống dính, xay sinh to, bàn ủi, xô nhựa, thau nhựa, chén, dĩa, camen, sành sứ, bếp ga mini, đồ dùng sinh hoạt', 'đồ gia dụng, đồ dùng nhà bếp, điện gia dụng, thủy tinh, nồi inox, chảo chống dính, xay sinh to, bàn ủi, xô nhựa, thau nhựa, chén, dĩa, camen, sành sứ, bếp ga mini, đồ dùng sinh hoạt', 0, 0, 0, 0, '', '<p style="text-align: center;"><strong><span style="font-size:20px;"><span style="color:#0000FF;">giadungmychau.com</span> chúng tôi có liên hệ với những đối tác vận chuyển uy tín trong nước.</span></strong></p>\r\n\r\n<p><span style="font-size:18px;">- Quy trình giao hàng cho quý khách ở tỉnh qua những đối tác vận chuyển sẽ được tiến hành theo 4 bước.</span></p>\r\n\r\n<p><span style="font-size:20px;"><span style="font-size:14px;">* Quý khách đăng ký thành viên, hoặc có thể không ( việc đăng ký thành viên giúp cho chúng tôi lưu trữ thông tin của khách hàng để thuận tiện quản lý đơn hàng, địa chỉ giao hàng, cũng như giới thiệu những trương trình khuyến mãi cho quý khách qua mail)</span></span></p>\r\n\r\n<p><span style="font-size: 14px; line-height: 22.4px;">* Chọn sản phẩm cần mua - cho vào giỏ hàng - click thanh toán.</span></p>\r\n\r\n<p><span style="font-size: 14px; line-height: 22.4px;">* Nhập thông tin cá nhận - địa chỉ.</span></p>\r\n\r\n<p><span style="font-size: 14px; line-height: 22.4px;">* Chúng tôi sau đó sẽ tiến hành kiểm tra đơn hàng và thông báo chi tiết đến quý khách tổng chi phí đơn hàng trong thời gian nhanh nhất.</span></p>\r\n\r\n<p><span style="font-size:18px;">- Đối với khách hàng các quận nội thành Shop có hệ thống nhân viên giao hàng riêng ( hôm nay đặt hàng - ngày mai nhận hàng ) trừ ngày CN với phí vận chuyển 20k.</span></p>\r\n', '', '', '', '', '', 1, 1, 1452218006, 1459248006, 0),
(40, 0, 0, 0, 0, 'header', 1, 0, 'a3-966.png', 'a3-966_86x86.png', 'Thu tiền tận nhà', '', 'thu-tien-tan-nha', '', '', '', '', '', '', 'Thu Tiền Tận Nhà', 'đồ gia dụng, đồ dùng nhà bếp, điện gia dụng, thủy tinh, nồi inox, chảo chống dính, xay sinh to, bàn ủi, xô nhựa, thau nhựa, chén, dĩa, camen, sành sứ, bếp ga mini, đồ dùng sinh hoạt', 'đồ gia dụng, đồ dùng nhà bếp, điện gia dụng, thủy tinh, nồi inox, chảo chống dính, xay sinh to, bàn ủi, xô nhựa, thau nhựa, chén, dĩa, camen, sành sứ, bếp ga mini, đồ dùng sinh hoạt', 0, 0, 0, 0, '', '<p><strong><span style="font-size:18px;">Chúng tôi nhận thu tiền tận nhà khi giao sản phẩm đến tay khách hàng, qua hình thức door to door.</span></strong></p>\r\n\r\n<p><span style="font-size:14px;">Ngoài ra chúng tôi còn hỗ trợ thanh toán qua hình thức chuyển khoản</span></p>\r\n\r\n<p><span style="font-size:14px;">* Vietcombank:</span></p>\r\n\r\n<p><span style="font-size:14px;">- Số tài khoản: <strong><span style="font-size:18px;">0501000092412</span></strong></span></p>\r\n\r\n<p><span style="font-size:14px;">- Chủ tài khoản: <strong><span style="font-size:16px;">VŨ BẢO HUY</span></strong></span></p>\r\n\r\n<p><span style="font-size:14px;">- Chi nhánh: <strong><span style="font-size:16px;">Gò Vấp</span></strong></span></p>\r\n\r\n<p><span style="font-size:14px;">* Sacombank:</span></p>\r\n\r\n<p><span style="font-size:14px;">- Số tài khoản: <strong><span style="font-size:18px;">060066866605</span></strong></span></p>\r\n\r\n<p><span style="font-size:14px;">- Chủ tài khoản: </span><strong><span style="font-size:16px;">VŨ BẢO HUY</span></strong></p>\r\n\r\n<p><span style="font-size:14px;">- Chi nhánh: <strong><span style="font-size:16px;">Gò Vấp</span></strong></span></p>\r\n\r\n<p> </p>\r\n\r\n<p> </p>\r\n', '', '', '', '', '', 1, 1, 1452218023, 1459266230, 0),
