(56, 0, 18, 0, 0, 'tintuc', 1, 0, 'mychau-6803.jpg', 'mychau-6803_230x190.jpg', 'Không bỏ phí thực phẩm bằng mẹo sử dụng khay làm đá.', '', 'khong-bo-phi-thuc-pham-bang-meo-su-dung-khay-lam-da', '', '', '', '', '', '', 'Không bỏ phí thực phẩm bằng mẹo sử dụng khay làm đá.', 'gia dụng my châu, gia dụng giá rẻ, đồ dùng nhà bếp, đồ dùng nhà bếp công nghiệp, đồ dùng nhà bếp công ty, đồ dùng nhà ăn công ty', 'gia dụng my châu, gia dụng giá rẻ, đồ dùng nhà bếp, đồ dùng nhà bếp công nghiệp, đồ dùng nhà bếp công ty, đồ dùng nhà ăn công ty', 0, 0, 0, 0, 'giadungmychau.com chia sẻ mẹo vặt cách không bỏ phí thực phẩm, không cần tốn thêm chi phí mà vẫn có được những món ăn ngon tráng miệng mát lạnh.', '<div class="short_intro txt_666" style="margin: 0px; padding: 0px 0px 10px; color: rgb(68, 68, 68); font-weight: 700; font-stretch: normal; font-size: 14px; line-height: 18px; font-family: arial; width: 480.016px; float: left; text-rendering: geometricPrecision;">Những chiếc khay làm đá có thể trở thành nơi đựng tuyệt vời của những rượu vang, trái cây, nước xương hầm... </div>\r\n\r\n<div class="fck_detail width_common" style="margin: 0px; padding: 0px 9.59375px 10px 0px; width: 470.406px; float: left; overflow: hidden; font-stretch: normal; font-size: 14px; line-height: normal; font-family: arial;">\r\n<p class="Normal" style="margin: 0px 0px 1em; padding: 0px; line-height: 18px; text-rendering: geometricPrecision;"><br />\r\nDưới đây là những thực phẩm mà bạn nên lưu giữ trong các khay đá, theo liệt kê của trang web <em style="margin: 0px; padding: 0px;">Purewow</em>.</p>\r\n\r\n<p class="subtitle" style="margin: 0px 0px 1em; padding: 0px; line-height: 18px; text-rendering: geometricPrecision; font-weight: 700;">Rượu vang</p>\r\n\r\n<table align="center" border="0" cellpadding="3" cellspacing="0" class="tplCaption" style="margin: 0px auto 10px; padding: 0px; max-width: 100%; width: 470px;">\r\n	<tbody style="margin: 0px; padding: 0px;">\r\n		<tr style="margin: 0px; padding: 0px;">\r\n			<td style="margin: 0px; padding: 0px; line-height: 0;"><img alt="tiet-kiem-thuc-phm-bang-giai-phap-tru-da-thong-minh" data-natural-width="500" data-pwidth="470.40625" data-width="500" src="http://img.f13.giadinh.vnecdn.net/2016/03/16/1-3853-1458117464.jpg" style="margin: 0px; padding: 0px; border: 0px; font-size: 0px; line-height: 0; max-width: 100%; width: 470px;" /></td>\r\n		</tr>\r\n		<tr style="margin: 0px; padding: 0px;">\r\n			<td style="margin: 0px; padding: 0px; line-height: 0;">\r\n			<p class="Image" style="margin: 0px; padding: 10px; line-height: normal; text-rendering: geometricPrecision; font-stretch: normal; font-size: 12px; background: rgb(245, 245, 245);">Ảnh: <em style="margin: 0px; padding: 0px;">Food Vs</em></p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p class="Normal" style="margin: 0px 0px 1em; padding: 0px; line-height: 18px; text-rendering: geometricPrecision;">Bạn làm một món ăn nào đó và chỉ cần vài muỗng rượu vang. Nếu chỉ vì thế mà phải chạy ra cửa hàng mua một chai rượu vang, vừa lãng phí vừa bất tiện. Hoặc nếu mỗi lần uống rượu không hết, bạn đổ rượu đi cũng rất phí.</p>\r\n\r\n<p class="Normal" style="margin: 0px 0px 1em; padding: 0px; line-height: 18px; text-rendering: geometricPrecision;">Thay vào đó bạn chỉ cần rót rượu vào các khay nhựa rồi cất lại vào ngăn đá tủ lạnh. Khi nào nấu ăn cần rượu vang, bạn chỉ cần nhặt vài viên rượu vừa lượng cần dùng, cho vào nồi là ổn.</p>\r\n\r\n<p class="subtitle" style="margin: 0px 0px 1em; padding: 0px; line-height: 18px; text-rendering: geometricPrecision; font-weight: 700;">Sữa và bánh quy</p>\r\n\r\n<table align="center" border="0" cellpadding="3" cellspacing="0" class="tplCaption" style="margin: 0px auto 10px; padding: 0px; max-width: 100%; width: 470px;">\r\n	<tbody style="margin: 0px; padding: 0px;">\r\n		<tr style="margin: 0px; padding: 0px;">\r\n			<td style="margin: 0px; padding: 0px; line-height: 0;"><img alt="tiet-kiem-thuc-phm-bang-giai-phap-tru-da-thong-minh-1" data-natural-width="500" data-pwidth="470.40625" data-width="500" src="http://img.f13.giadinh.vnecdn.net/2016/03/16/2-9160-1458117464.jpg" style="margin: 0px; padding: 0px; border: 0px; font-size: 0px; line-height: 0; max-width: 100%; width: 470px;" /></td>\r\n		</tr>\r\n		<tr style="margin: 0px; padding: 0px;">\r\n			<td style="margin: 0px; padding: 0px; line-height: 0;">\r\n			<p class="Image" style="margin: 0px; padding: 10px; line-height: normal; text-rendering: geometricPrecision; font-stretch: normal; font-size: 12px; background: rgb(245, 245, 245);">Ảnh: <em style="margin: 0px; padding: 0px;">Purewow</em></p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p class="Normal" style="margin: 0px 0px 1em; padding: 0px; line-height: 18px; text-rendering: geometricPrecision;">Bạn chỉ cần một ít sữa, ít bánh quy để bỏ vào ly cà phê của mình. Hãy chuẩn bị sẵn bằng cách đổ sữa hay bánh quy vào khay nhựa làm đá. Khi nào uống cà phê, bạn chỉ cần nhặt ra một viên thả vào cốc, vừa đơn giản, vừa tiết kiệm.</p>\r\n\r\n<p class="subtitle" style="margin: 0px 0px 1em; padding: 0px; line-height: 18px; text-rendering: geometricPrecision; font-weight: 700;">Rau thơm</p>\r\n\r\n<table align="center" border="0" cellpadding="3" cellspacing="0" class="tplCaption" style="margin: 0px auto 10px; padding: 0px; max-width: 100%; width: 470px;">\r\n	<tbody style="margin: 0px; padding: 0px;">\r\n		<tr style="margin: 0px; padding: 0px;">\r\n			<td style="margin: 0px; padding: 0px; line-height: 0;"><img alt="tiet-kiem-thuc-phm-bang-giai-phap-tru-da-thong-minh-2" data-natural-width="500" data-pwidth="470.40625" data-width="500" src="http://img.f13.giadinh.vnecdn.net/2016/03/16/3-4130-1458117465.jpg" style="margin: 0px; padding: 0px; border: 0px; font-size: 0px; line-height: 0; max-width: 100%; width: 470px;" /></td>\r\n		</tr>\r\n		<tr style="margin: 0px; padding: 0px;">\r\n			<td style="margin: 0px; padding: 0px; line-height: 0;">\r\n			<p class="Image" style="margin: 0px; padding: 10px; line-height: normal; text-rendering: geometricPrecision; font-stretch: normal; font-size: 12px; background: rgb(245, 245, 245);">Ảnh: <em style="margin: 0px; padding: 0px;">Kitchen.</em></p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p class="Normal" style="margin: 0px 0px 1em; padding: 0px; line-height: 18px; text-rendering: geometricPrecision;">Bạn lỡ mua quá nhiều rau thơm. Thay vì vứt bỏ những phần thừa không dùng đến, hãy cắt nhỏ rau và cho vào khay đá. Đổ thêm vào đó một ít dầu oliu rồi cất cả khay vào ngăn đá. Khi nào nấu súp, ăn khoai tây nướng, hoặc bất kỳ món ăn nào cần rau thơm, hãy nhặt vài viên đá rau thơm ra.</p>\r\n\r\n<p class="subtitle" style="margin: 0px 0px 1em; padding: 0px; line-height: 18px; text-rendering: geometricPrecision; font-weight: 700;">Nha đam</p>\r\n\r\n<table align="center" border="0" cellpadding="3" cellspacing="0" class="tplCaption" style="margin: 0px auto 10px; padding: 0px; max-width: 100%; width: 470px;">\r\n	<tbody style="margin: 0px; padding: 0px;">\r\n		<tr style="margin: 0px; padding: 0px;">\r\n			<td style="margin: 0px; padding: 0px; line-height: 0;"><img alt="tiet-kiem-thuc-phm-bang-giai-phap-tru-da-thong-minh-3" data-natural-width="500" data-pwidth="470.40625" data-width="500" src="http://img.f13.giadinh.vnecdn.net/2016/03/16/4-4592-1458117465.jpg" style="margin: 0px; padding: 0px; border: 0px; font-size: 0px; line-height: 0; max-width: 100%; width: 470px;" /></td>\r\n		</tr>\r\n		<tr style="margin: 0px; padding: 0px;">\r\n			<td style="margin: 0px; padding: 0px; line-height: 0;">\r\n			<p class="Image" style="margin: 0px; padding: 10px; line-height: normal; text-rendering: geometricPrecision; font-stretch: normal; font-size: 12px; background: rgb(245, 245, 245);">Ảnh: <em style="margin: 0px; padding: 0px;">Barefood Wine.</em></p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p class="Normal" style="margin: 0px 0px 1em; padding: 0px; line-height: 18px; text-rendering: geometricPrecision;">Bị cháy nắng sẽ khiến da đau rát. Tuy nhiên, không có gì dưỡng da tốt hơn những viên đá nha đam.</p>\r\n\r\n<p class="Normal" style="margin: 0px 0px 1em; padding: 0px; line-height: 18px; text-rendering: geometricPrecision;">Hãy xay hoặc cắt nhỏ nha đam, sau đó cho vào khay đá, cất vào tủ lạnh. Khi nào cần dùng, bạn chỉ cần bỏ những viên nha đam này ra.</p>\r\n\r\n<p class="subtitle" style="margin: 0px 0px 1em; padding: 0px; line-height: 18px; text-rendering: geometricPrecision; font-weight: 700;">Chanh</p>\r\n\r\n<table align="center" border="0" cellpadding="3" cellspacing="0" class="tplCaption" style="margin: 0px auto 10px; padding: 0px; max-width: 100%; width: 470px;">\r\n	<tbody style="margin: 0px; padding: 0px;">\r\n		<tr style="margin: 0px; padding: 0px;">\r\n			<td style="margin: 0px; padding: 0px; line-height: 0;"><img alt="tiet-kiem-thuc-phm-bang-giai-phap-tru-da-thong-minh-4" data-natural-width="500" data-pwidth="470.40625" data-width="500" src="http://img.f13.giadinh.vnecdn.net/2016/03/16/5-2201-1458117465.jpg" style="margin: 0px; padding: 0px; border: 0px; font-size: 0px; line-height: 0; max-width: 100%; width: 470px;" /></td>\r\n		</tr>\r\n		<tr style="margin: 0px; padding: 0px;">\r\n			<td style="margin: 0px; padding: 0px; line-height: 0;">\r\n			<p class="Image" style="margin: 0px; padding: 10px; line-height: normal; text-rendering: geometricPrecision; font-stretch: normal; font-size: 12px; background: rgb(245, 245, 245);">Ảnh: <em style="margin: 0px; padding: 0px;">GoodHouseKeeping.</em></p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p class="Normal" style="margin: 0px 0px 1em; padding: 0px; line-height: 18px; text-rendering: geometricPrecision;">Bạn mua rất nhiều chanh và sợ ăn không kịp trước khi chanh héo. Một cách giữ chanh tươi vô cùng đơn giản: vắt nước cốt chanh vào các khay nhựa và cất vào ngăn đá tủ lạnh. Mỗi khi cần ăn món gì đó, bạn chỉ cần lấy một hoặc vài viên đá chanh bỏ vào món ăn.</p>\r\n\r\n<p class="subtitle" style="margin: 0px 0px 1em; padding: 0px; line-height: 18px; text-rendering: geometricPrecision; font-weight: 700;">Trái cây</p>\r\n\r\n<table align="center" border="0" cellpadding="3" cellspacing="0" class="tplCaption" style="margin: 0px auto 10px; padding: 0px; max-width: 100%; width: 470px;">\r\n	<tbody style="margin: 0px; padding: 0px;">\r\n		<tr style="margin: 0px; padding: 0px;">\r\n			<td style="margin: 0px; padding: 0px; line-height: 0;"><img alt="tiet-kiem-thuc-phm-bang-giai-phap-tru-da-thong-minh-5" data-natural-width="499" data-pwidth="470.40625" data-width="499" src="http://img.f13.giadinh.vnecdn.net/2016/03/16/6-4579-1458117466.jpg" style="margin: 0px; padding: 0px; border: 0px; font-size: 0px; line-height: 0; max-width: 100%; width: 470px;" /></td>\r\n		</tr>\r\n		<tr style="margin: 0px; padding: 0px;">\r\n			<td style="margin: 0px; padding: 0px; line-height: 0;">\r\n			<p class="Image" style="margin: 0px; padding: 10px; line-height: normal; text-rendering: geometricPrecision; font-stretch: normal; font-size: 12px; background: rgb(245, 245, 245);">Ảnh: <em style="margin: 0px; padding: 0px;">The Things We\'ll Make.</em></p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p class="Normal" style="margin: 0px 0px 1em; padding: 0px; line-height: 18px; text-rendering: geometricPrecision;">Rất nhiều loại trái cây, từ xoài đến dâu, bạn đều có thể xay nhuyễn sau đó rót vào các khay đá và để đông lạnh. Khi nào có nhu cầu uống sinh tố, bạn chỉ việc xay viên đá trái cây này ra.</p>\r\n\r\n<p class="subtitle" style="margin: 0px 0px 1em; padding: 0px; line-height: 18px; text-rendering: geometricPrecision; font-weight: 700;">Tỏi</p>\r\n\r\n<table align="center" border="0" cellpadding="3" cellspacing="0" class="tplCaption" style="margin: 0px auto 10px; padding: 0px; max-width: 100%; width: 470px;">\r\n	<tbody style="margin: 0px; padding: 0px;">\r\n		<tr style="margin: 0px; padding: 0px;">\r\n			<td style="margin: 0px; padding: 0px; line-height: 0;"><img alt="tiet-kiem-thuc-phm-bang-giai-phap-tru-da-thong-minh-6" data-natural-width="499" data-pwidth="470.40625" data-width="499" src="http://img.f13.giadinh.vnecdn.net/2016/03/16/8-3608-1458117466.jpg" style="margin: 0px; padding: 0px; border: 0px; font-size: 0px; line-height: 0; max-width: 100%; width: 470px;" /></td>\r\n		</tr>\r\n		<tr style="margin: 0px; padding: 0px;">\r\n			<td style="margin: 0px; padding: 0px; line-height: 0;">\r\n			<p class="Image" style="margin: 0px; padding: 10px; line-height: normal; text-rendering: geometricPrecision; font-stretch: normal; font-size: 12px; background: rgb(245, 245, 245);">Ảnh:<em style="margin: 0px; padding: 0px;"> Food Network.</em></p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p class="Normal" style="margin: 0px 0px 1em; padding: 0px; line-height: 18px; text-rendering: geometricPrecision;">Thật bất ngờ là bạn hoàn toàn có thể bảo quản tỏi trong các khay nhựa đựng đá. Đầu tiên bóc vỏ tỏi, sau đó rang tỏi lên, rồi cất vào ngăn đá. Khi nào sử dụng, bạn chỉ cần lấy một viên tỏi ra.</p>\r\n\r\n<p class="subtitle" style="margin: 0px 0px 1em; padding: 0px; line-height: 18px; text-rendering: geometricPrecision; font-weight: 700;">Lòng trắng trứng</p>\r\n\r\n<table align="center" border="0" cellpadding="3" cellspacing="0" class="tplCaption" style="margin: 0px auto 10px; padding: 0px; max-width: 100%; width: 295px;">\r\n	<tbody style="margin: 0px; padding: 0px;">\r\n		<tr style="margin: 0px; padding: 0px;">\r\n			<td style="margin: 0px; padding: 0px; line-height: 0;"><img alt="tiet-kiem-thuc-phm-bang-giai-phap-tru-da-thong-minh-7" data-pwidth="470.40625" data-width="295" src="http://img.f13.giadinh.vnecdn.net/2016/03/16/9-8626-1458117466.jpg" style="margin: 0px; padding: 0px; border: 0px; font-size: 0px; line-height: 0; max-width: 100%;" /></td>\r\n		</tr>\r\n		<tr style="margin: 0px; padding: 0px;">\r\n			<td style="margin: 0px; padding: 0px; line-height: 0;">\r\n			<p class="Image" style="margin: 0px; padding: 10px; line-height: normal; text-rendering: geometricPrecision; font-stretch: normal; font-size: 12px; background: rgb(245, 245, 245);">Ảnh: <em style="margin: 0px; padding: 0px;">Baked by Rachel.</em></p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p class="Normal" style="margin: 0px 0px 1em; padding: 0px; line-height: 18px; text-rendering: geometricPrecision;">Sau khi đã tách lòng trắng lòng đỏ, nếu chưa sử dụng lòng trắng trứng, bạn có thể đổ vào khay đá và cất vào ngăn đá tủ lạnh. Lưu ý nhớ đậy nắp khay. Khi nào cần sử dụng có thể đem trứng ra rã đông.</p>\r\n\r\n<p class="subtitle" style="margin: 0px 0px 1em; padding: 0px; line-height: 18px; text-rendering: geometricPrecision; font-weight: 700;">Nước xương, thịt bằm, cá bằm</p>\r\n\r\n<p class="Normal" style="margin: 0px 0px 1em; padding: 0px; line-height: 18px; text-rendering: geometricPrecision;">Nếu nhà bạn có trẻ em, một bữa cháo hay bột của bé chỉ cần một lượng nhỏ nước xương hầm cũng như một lượng nhỏ thịt, tôm.... Nếu mỗi lần nấu bạn đều hầm xương sẽ rất mất thời gian. Thay vào đó, bạn có thể hầm xương cho nhiều lần dùng, sau đó trút nước hầm vào các khay đá, mỗi lần nấu sẽ dùng một vài viên.</p>\r\n\r\n<p class="Normal" style="margin: 0px 0px 1em; padding: 0px; line-height: 18px; text-rendering: geometricPrecision;">Tôm, thịt cũng thế, bạn có thể bằm một lần cho nhiều lần ăn. Sau khi bằm xong, nhớ chia thành các phần nhỏ trong các khay đá. Mỗi lần ăn, bạn chỉ cần lấy một hai viên. Do đó, bạn chỉ cần rã đông đúng lượng cần dùng, không ảnh hưởng đến chất lượng của phần còn lại. </p>\r\n\r\n<p class="Normal" style="margin: 0px 0px 1em; padding: 0px; line-height: 18px; text-rendering: geometricPrecision;"><strong style="text-align: right; margin: 0px; padding: 0px;">Kim An</strong><strong style="text-align: right; margin: 0px; padding: 0px;">h</strong></p>\r\n</div>\r\n', '', '', '', '', '', 1, 1, 1458438157, 0, 0),
