(32, 42, 20, 39, 0, '', 0, 0, '', '', 'product', 0, 0, 'kangaroo-436i-5889.jpg', 'kangaroo-436i-5889_195x195.jpg', 'Bếp Hồng Ngoại Kangaroo 436', 'KG436i', 'bep-hong-ngoai-kangaroo-436', '', '', '2000w', 'PRC', 0, 4000, '12 tháng', '', 'Bếp Hồng Ngoại Kangaroo', 'Gia Dụng My Châu, bếp hồng ngoại, bếp từ, bếp điện, bếp hồng ngoại tốt, bếp hồng ngoại giá rẻ', 'Sp với công xuất 2000W. bếp điện bằng kính cường lực siên bền, chống xước .có mần hình hiiển thị. sủ dụng được tát cả nồi ,đa chức năng nấu ', 0, 0, 1450000, 1450000, 'Sp với công xuất 2000W. bếp điện bằng kính cường lực siên bền, chống xước .có mần hình hiiển thị. sủ dụng được tát cả nồi ,đa chức năng nấu ', '<p><span style="font-size:20px;"><strong><span style="color:#8B4513;">Bếp Hồng Ngoại</span> <span style="color:#0000CD;">Kangaroo 436 :</span></strong></span></p>\r\n\r\n<p><span style="color:#000000;"><span style="font-size:16px;"><span style="font-family: Arial; line-height: 22px;">• Mặt kính siêu bền chịu nhiệt </span><br style="color: rgb(119, 119, 119); font-family: Arial; font-size: 14px; line-height: 22px;" />\r\n<span style="font-family: Arial; line-height: 22px;">• Bộ điều khiển cảm ứng, đèn LED hiển thị nhiệt độ </span><br style="color: rgb(119, 119, 119); font-family: Arial; font-size: 14px; line-height: 22px;" />\r\n<span style="font-family: Arial; line-height: 22px;">• Chế độ nấu hẹn giờ </span><br style="color: rgb(119, 119, 119); font-family: Arial; font-size: 14px; line-height: 22px;" />\r\n<span style="font-family: Arial; line-height: 22px;">• Sử dụng được cho tất cả các loại nồi </span><br style="color: rgb(119, 119, 119); font-family: Arial; font-size: 14px; line-height: 22px;" />\r\n<span style="font-family: Arial; line-height: 22px;">• Đa chức năng nấu </span><br style="color: rgb(119, 119, 119); font-family: Arial; font-size: 14px; line-height: 22px;" />\r\n<span style="font-family: Arial; line-height: 22px;">Điện áp: 220V/50Hz </span><br style="color: rgb(119, 119, 119); font-family: Arial; font-size: 14px; line-height: 22px;" />\r\n<span style="font-family: Arial; line-height: 22px;">Khối lượng: 2,95 kg </span><br style="color: rgb(119, 119, 119); font-family: Arial; font-size: 14px; line-height: 22px;" />\r\n<span style="font-family: Arial; line-height: 22px;">Kích thước: 345x115x425 (mm) </span><br style="color: rgb(119, 119, 119); font-family: Arial; font-size: 14px; line-height: 22px;" />\r\n<span style="font-family: Arial; line-height: 22px;">Công suất: 2,000W</span></span></span></p>\r\n\r\n<p><span style="font-size:16px;"><span style="color: rgb(119, 119, 119); font-family: Arial; line-height: 22px;"><img alt="" height="400" src="http://mych.vn/vubaohuy/upload/images/BEP%20TU%2C%20BEP%20HONG%20NGOAI/Kangaroo%20436i.jpg" width="400" /></span></span></p>\r\n\r\n<p style="color: rgb(0, 0, 0); line-height: normal; font-family: arial; padding: 0px; margin: 0px; font-size: 12px;"><span style="font-size:18px;"><strong><span style="color:#0000CD;"><span style="font-weight: bold;">BẾP HỒNG NGOẠI ĐƠN KANGAROO KG 436i :</span></span></strong></span></p>\r\n\r\n<p><span style="color:#8B4513;"><span style="font-size:16px;"><span style="font-weight: bold; font-family: arial; line-height: normal;">• Mặt kính siêu bền chịu nhiệt</span></span></span></p>\r\n\r\n<p><span style="font-size:16px;"><span style="color: rgb(0, 0, 0); font-family: arial; line-height: normal;">Mặt bếp điện bằng kính cường lực siên bền, chống xước, chịu được nhiệt độ lớn, tránh cho bề mặt bếp bị biến dạng hoặc nóng chảy. Chất liệu kính sáng bóng dễ dàng làm sạch.</span></span></p>\r\n\r\n<p><span style="color:#8B4513;"><span style="font-size:16px;"><span style="font-weight: bold; font-family: arial; line-height: normal;">• Bộ điều khiển cảm ứng, đèn LED hiển thị nhiệt độ</span></span></span></p>\r\n\r\n<p><span style="font-size:16px;"><span style="color: rgb(0, 0, 0); font-family: arial; line-height: normal;">Các hướng dẫn và điều khiển bếp được hiển thị rõ nét trên màn hình LCD hiện đại, rất dễ hiểu và dễ sử dụng.</span></span></p>\r\n\r\n<p><span style="color:#8B4513;"><span style="font-size:16px;"><span style="font-weight: bold; font-family: arial; line-height: normal;">. Chế độ nấu hẹn giờ</span></span></span></p>\r\n\r\n<p><span style="font-size:16px;"><span style="color: rgb(0, 0, 0); font-family: arial; line-height: normal;">Bếp có chế độ hẹn giờ trong khi nấu, giúp bạn tiết kiệm thời gian và rảnh tay làm các việc khác.</span></span></p>\r\n\r\n<p><span style="color:#8B4513;"><span style="font-size:16px;"><span style="font-weight: bold; font-family: arial; line-height: normal;">• Sử dụng được cho tất cả các loại nồi</span></span></span></p>\r\n\r\n<p><span style="font-size:16px;"><span style="color: rgb(0, 0, 0); font-family: arial; line-height: normal;">Bếp không kén chọn loại nồi chuyên dụng: nồi inox, nhôm, sứ, thủy tinh… giúp tận dụng tối đa các loại nồi sẵn có, tiết kiệm tiền bạc và không gian lưu trữ cho nhà bếp.</span></span></p>\r\n\r\n<p><span style="color:#8B4513;"><span style="font-size:16px;"><span style="font-weight: bold; font-family: arial; line-height: normal;">• Đa chức năng nấu : </span></span></span><span style="color: rgb(0, 0, 0); font-family: arial; line-height: normal; font-size: 16px;">Lẩu, hầm, đun nước, nướng, chiên xào...</span></p>\r\n\r\n<p><span style="color:#8B4513;"><span style="font-size:16px;"><span style="font-weight: bold; font-family: arial; line-height: normal;">• Chế độ khóa an toàn </span></span></span></p>\r\n\r\n<p><span style="font-size:16px;"><span style="color: rgb(0, 0, 0); font-family: arial; line-height: normal;">Nút khóa an toàn giúp khóa bảng điều khiển khi bếp đang hoạt động, an toàn tuyệt đối với trẻ em. Đèn cảnh báo nóng giúp báo hiệu bếp còn đang nóng, an toàn cho người sử dụng.</span></span></p>\r\n', '', '', '', '', '', '', 1, 1, 1453164164, 1464412082, 0),
