s-serif; line-height: 1.4; color: #333333; font-weight: 500; font-size: 24px;" style="font-size: 24px; box-sizing: border-box; margin: 0px 0px 10px; font-family: Helvetica, Arial, sans-serif; line-height: 1.4;">Điểm nổi bật</h3>\r\n\r\n<div class="wysiwyg" data-mce-style="box-sizing: border-box; color: #333333; font-family: Helvetica, Arial, sans-serif; font-size: 14px; line-height: 20px;" style="box-sizing: border-box; font-family: Helvetica, Arial, sans-serif; font-size: 14px; line-height: 20px;">\r\n<p data-mce-style="box-sizing: border-box; margin: 5px 0px !important; line-height: 22px;" style="box-sizing: border-box; line-height: 22px; margin: 5px 0px !important;">- Lẩu điện kim cương với dung tích lên đến 3.5 lít cho bạn thoải mái nấu nướng.</p>\r\n\r\n<p data-mce-style="box-sizing: border-box; margin: 5px 0px !important; line-height: 22px;" style="box-sizing: border-box; line-height: 22px; margin: 5px 0px !important;">- Thanh điều chỉnh nhiệt độ từ 65 – 220 độ C thuận tiện để bạn điều chỉnh nhiệt độ theo nhu cầu sử dụng</p>\r\n\r\n<p data-mce-style="box-sizing: border-box; margin: 5px 0px !important; line-height: 22px;" style="box-sizing: border-box; line-height: 22px; margin: 5px 0px !important;">- Nồi có dung tích lớn, công suất 1300W giúp nước mau sôi, nhanh chóng làm chín thịt và các loại hải sản.</p>\r\n\r\n<p data-mce-style="box-sizing: border-box; margin: 5px 0px !important; line-height: 22px;" style="box-sizing: border-box; line-height: 22px; margin: 5px 0px !important;">- Lòng nồi phủ chất chống dính, an toàn khi nấu, kèm nắp thủy tinh giúp bạn dễ dàng quan sát thực phẩm đang chế biến bên trong.</p>\r\n\r\n<p data-mce-style="box-sizing: border-box; margin: 5px 0px !important; line-height: 22px;" style="box-sizing: border-box; line-height: 22px; margin: 5px 0px !important;">- Bảo hành: 12 tháng tại 183 - 185 Nguyễn Phúc Nguyên, Phường 9, Quận 3</p>\r\n</div>\r\n', '', '', '', '', '', '', 1, 1, 1453164566, 1462321160, 0),
