(35, 48, 20, 77, 0, '', 1, 10, '', '', 'product', 0, 0, 'sieu-kim-cuong-4219.jpg', 'sieu-kim-cuong-4219_195x195.jpg', 'Siêu Thuốc Điện Kim Cương', 'STDKC', 'sieu-thuoc-dien-kim-cuong', '', '', '450w', 'Việt Nam', 3300, 3000, '12 tháng', '', 'Siêu Thuốc Điện Kim Cương', 'Gia Dụng My Châu, siêu thuốc, siêu thuốc điện, siêu sắc thuốc, siêu sắc thuốc điện', 'Gia Dụng My Châu, siêu thuốc điện, siêu sắc thuốc điện, siêu điện', 0, 0, 295000, 295000, 'Siêu thuốc điện thương hiệu Việt Nam, chất lượng đảm bảo.', '<h3 class="product-well-title" style="box-sizing: border-box; font-family: Helvetica, Arial, sans-serif; line-height: 1.4; margin: 0px 0px 10px; font-size: 24px;">Điểm nổi bật</h3>\r\n\r\n<div class="wysiwyg" style="box-sizing: border-box; font-family: Helvetica, Arial, sans-serif; font-size: 14px; line-height: 20px;">\r\n<p style="box-sizing: border-box; margin: 5px 0px !important; line-height: 22px;">- Siêu sắc thuốc Bắc điện 3.3 lít Kim Cương giúp bạn tiết kiệm thời gian mà vẫn có được chén thuốc chứa nhiều công dụng điều trị bệnh tật.</p>\r\n\r\n<p style="box-sizing: border-box; margin: 5px 0px !important; line-height: 22px;">- Sản phẩm được làm từ gốm theo tiêu chuẩn Nhật Bản có khả năng chịu nhiệt tốt, không làm ảnh hưởng đến tính chất của các vị thuốc trong quá trình sắc.</p>\r\n\r\n<p style="box-sizing: border-box; margin: 5px 0px !important; line-height: 22px;">- Siêu sắc thuốc Bắc Kim Cương có 2 chức năng: nấu nhanh và nấu chậm, tự động giữ ấm thuốc sau khi sắc.</p>\r\n\r\n<p style="box-sizing: border-box; margin: 5px 0px !important; line-height: 22px;">- Ngoài công dụng nấu thuốc, ấm còn có thể sử dụng để hầm gà, nấu súp…</p>\r\n\r\n<p style="box-sizing: border-box; margin: 5px 0px !important; line-height: 22px;">- Sản phẩm có bán trong các siêu thị trên toàn quốc.</p>\r\n\r\n<p style="box-sizing: border-box; margin: 5px 0px !important; line-height: 22px;">- Bảo hành: 1 năm tại 183 - 185 Nguyễn Phúc Nguyên, Phường 9, Quận 3, Tp.HCM</p>\r\n</div>\r\n', '', 