(38, 44, 20, 41, 0, '', 0, 0, '390000|350000', 'Loại 3 cốc|Loại 2 cốc', 'product', 0, 0, 'sinh-to-khaluck-3-trong-1-430k12-5388.jpg', 'sinh-to-khaluck-3-trong-1-430k12-5388_195x195.jpg', 'Máy Xay Sinh Tố Khaluck', 'XSTKL', 'may-xay-sinh-to-khaluck', '', '', '300w', 'PRC', 1500, 4000, '12 tháng', '', 'Xay Sinh Tố Khaluck', 'Gia Dụng My Châu, máy xay sinh tố, máy xay sinh tố cao cấp, máy xay sinh tố loại tốt, máy xay sinh tố tốt', 'SP  công suất 350W,  dung tích bình chứa lớn 1.5L ,Lưỡi dao bằng thép không rỉ  chống ăn mòn ,Giúp bạn dễ dàng lau chùi và vệ sinh thiết bị .', 0, 0, 0, 0, 'SP  công suất 350W,  dung tích bình chứa lớn 1.5L ,Lưỡi dao bằng thép không rỉ  chống ăn mòn ,Giúp bạn dễ dàng lau chùi và vệ sinh thiết bị', '<p><span style="font-size:20px;"><strong><span style="color:#8B4513;"><span style="font-family: Helvetica, Arial, sans-serif; line-height: 14.4px;">Máy xay sinh tố </span></span><span style="color:#0000CD;"><span style="margin: 0px; padding: 0px; font-weight: 700; font-family: Helvetica, Arial, sans-serif; line-height: 14.4px;">Khaluck.Home KL- 333</span></span></strong></span><span style="color: rgb(64, 64, 64); font-family: Helvetica, Arial, sans-serif; font-size: 12px; line-height: 14.4px;"> </span></p>\r\n\r\n<p><span style="color: rgb(64, 64, 64); font-family: Helvetica, Arial, sans-serif; font-size: 12px; line-height: 14.4px;"><span style="font-size:16px;">- Hoạt động mạnh mẽ với công suất 350W và lưỡi dao bằng thép không rỉ siêu bền, giúp xay mạnh, nghiền được mọi loại thực phẩm. Bên cạnh đó, máy xay sinh tố còn có dung tích bình chứa lớn 1.5L, giúp xay được nhiều hơn chỉ với một lần bấm. Với cối xay tiện dụng đi kèm máy xay sinh tố </span></span><span style="font-size:16px;"><span style="margin: 0px; padding: 0px; font-weight: 700; color: rgb(64, 64, 64); font-family: Helvetica, Arial, sans-serif; line-height: 14.4px;">Khaluck.Home KL- 333</span><span style="color: rgb(64, 64, 64); font-family: Helvetica, Arial, sans-serif; line-height: 14.4px;">, bạn đã có thể hoàn toàn an tâm chế biến những món ăn ngon cho bữa ăn mà không tốn nhiều thời gian.</span></span></p>\r\n\r\n<div style="margin: 0px 0px 10px; padding: 0px; color: rgb(64, 64, 64); font-family: Helvetica, Arial, sans-serif; font-size: 12px; line-height: 14.4px;"><span style="color:#8B4513;"><span style="font-size:16px;"><span style="margin: 0px; padding: 0px; font-weight: 700;">TÍNH NĂNG NỔI BẬT</span></span></span></div>\r\n\r\n<p style="margin: 0px 0px 10px; padding: 0px; color: rgb(64, 64, 64); font-family: Helvetica, Arial, sans-serif; font-size: 12px; line-height: 14.4px;"><span style="color:#000000;"><span style="font-size:18px;"><span style="margin: 0px; padding: 0px; font-weight: 700;">Dung tích cối xay lớn 1.5L</span><br style="margin: 0px; padding: 0px;" />\r\n - Giúp xay thực phẩm được nhiều hơn, cả gia đình có thể dễ dàng thưởng thức những món nước uống đầy dinh dưỡng chỉ với một lần bấm.</span></span></p>\r\n\r\n<p style="margin: 0px 0px 10px; padding: 0px; color: rgb(64, 64, 64); font-family: Helvetica, Arial, sans-serif; font-size: 12px; line-height: 14.4px;"><span style="color:#000000;"><span style="font-size:18px;"><span style="margin: 0px; padding: 0px; font-weight: 700;">Lưỡi dao bằng thép không rỉ</span><br style="margin: 0px; padding: 0px;" />\r\n - Hệ thống dao xay mạnh mẽ, chống ăn mòn, cho độ bền sản phẩm lâu dài đồng thời dễ dàng chùi rửa.</span></span></p>\r\n\r\n<p style="margin: 0px 0px 10px; padding: 0px; color: rgb(64, 64, 64); font-family: Helvetica, Arial, sans-serif; font-size: 12px; line-height: 14.4px;"><span style="color:#000000;"><span style="font-size:18px;"><span style="margin: 0px; padding: 0px; font-weight: 700;">Thiết kế lưỡi dao dễ tháo lắp</span><br style="margin: 0px; padding: 0px;" />\r\n - Giúp bạn dễ dàng lau chùi và vệ sinh thiết bị sau khi sử dụng.</span></span></p>\r\n\r\n<p style="margin: 0px 0px 10px; padding: 0px; color: rgb(64, 64, 64); font-family: Helvetica, Arial, sans-serif; font-size: 12px; line-height: 14.4px;"><span style="color:#000000;"><span style="font-size:18px;"><span style="margin: 0px; padding: 0px; font-weight: 700;">Thiết kế chắc chắn</span><br style="margin: 0px; padding: 0px;" />\r\n -Thiết kế nguyên khối chắc chắn và sang trọng, làm đẹp thêm gian bếp nhà bạn.</span></span></p>\r\n\r\n<p style="margin: 0px 0px 10px; padding: 0px; color: rgb(64, 64, 64); font-family: Helvetica, Arial, sans-serif; font-size: 12px; line-height: 14.4px;"><span style="color:#000000;"><span style="font-size:18px;"><span style="margin: 0px; padding: 0px; font-weight: 700;">Cối xay tiện dụng đi kèm</span><br style="margin: 0px; padding: 0px;" />\r\n - Mang đến sự tiện lợi cho người dùng khi cần xay các loại hạt, tiêu hoặc các loại thực phẩm khô.</span></span></p>\r\n\r\n<div style="margin: 0px 0px 10px; padding: 0px; color: rgb(64, 64, 64); font-family: Helvetica, Arial, sans-serif; font-size: 12px; line-height: 14.4px;"><span style="color:#8B4513;"><span style="font-size:18px;"><span style="margin: 0px; padding: 0px; font-weight: 700;">THÔNG TIN THƯƠNG HIỆU</span></span></span></div>\r\n\r\n<p style="margin: 0px 0px 10px; padding: 0px; color: rgb(64, 64, 64); font-family: Helvetica, Arial, sans-serif; font-size: 12px; line-height: 14.4px;"><span style="color:#000000;"><span style="font-size:18px;"><span style="margin: 0px; padding: 0px; font-weight: 700;">Khaluck.Home</span> là nhãn hiệu thuôc sở hữu của công ty TNHH Khang Luân, được thành lập vào năm 2005 chuyên sản xuất và phân phối các sản phẩm gia dụng tại Việt Nam. Dây chuyền sản xuất của <span style="margin: 0px; padding: 0px; font-weight: 700;">Khaluck.Home</span> dựa trên nền công nghệ kỹ thuật và quy trình quản lý hiện đại, góp phần cải thiện và từng bước nâng cao chất lượng sản phẩm. Các sản phẩm điện gia dụng <span style="margin: 0px; padding: 0px; font-weight: 700;">Khaluck.Home</span> nổi bật với hiệu suất vận hành tốt, mức an toàn cao cũng như dễ thao tác mang lại sự tiện ích tối đa cho người tiêu dùng.</span></span></p>\r\n\r\n<p style="margin: 0px 0px 10px; padding: 0px; color: rgb(64, 64, 64); font-family: Helvetica, Arial, sans-serif; font-size: 12px; line-height: 14.4px;"><img alt="" data-mce-selected="1" data-mce-src="http://media3.scdn.vn/img1/2016/5_14/554f87_simg_d0daf0_800x1200_max.jpg" data-mce-style="margin: 0 auto; display: block;" height="400" src="http://media3.scdn.vn/img1/2016/5_14/554f87_simg_d0daf0_800x1200_max.jpg" style="border: 0px; outline: black solid 1px; color: rgb(0, 0, 0); font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 10px; line-height: normal; margin: 0px auto; display: block;" width="400" /></p>\r\n\r\n<div><img alt="" data-mce-selected="1" data-mce-src="http://media3.scdn.vn/img1/2016/5_14/7c80c2_simg_d0daf0_800x1200_max.jpg" data-mce-style="margin: 0 auto; display: block;" height="400" src="http://media3.scdn.vn/img1/2016/5_14/7c80c2_simg_d0daf0_800x1200_max.jpg" style="border: 0px; outline: black solid 1px; color: rgb(0, 0, 0); font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 10px; line-height: normal; margin: 0px auto; display: block;" width="400" /></div>\r\n\r\n<div> </div>\r\n', '', '', '', '', '', '', 1, 1, 1453168286, 1464579725, 0),
