(44, 54, 25, 66, 0, '', 0, 0, '', '', 'product', 0, 0, 'phich-giu-nhiet-elmich-inox-304-500ml-185k-h5-5106.jpg', 'phich-giu-nhiet-elmich-inox-304-500ml-185k-h5-5106_195x195.jpg', 'Bình giữ nhiệt Elmich 500ml H5', 'BGNELH5', 'binh-giu-nhiet-elmich-500ml-h5', '', '', '', 'Czech Republic', 500, 0, '12 tháng', '', 'Bình giữ nhiệt Elmich 500ml', 'bình giữ nhiệt, bình giữ nhiệt inox, bình inox, bình nhựa, bình giứ lạnh, bình giứ nóng, bình đựng nước', 'Dung tích: 500 ml.Kết cấu 3 lớp, lớp trong cùng là inox  tráng bạc.Gồm 2 chức năng: giữ nóng, giữ lạnh.chứng nhận an toàn,theo tiêu chuẩn Châu Âu.mych.vn', 0, 0, 185000, 0, 'Bình giữ nhiệt Inox 304 cao cấp của tập đoàn Elmich Cộng Hòa Czech', '<p><span style="color:#8B4513;"><span style="font-size:20px;"><strong>Bình giữ nhiệt</strong></span></span><span style="color:#0000CD;"><span style="font-size:20px;"><strong> Elmich 500ml H5 :</strong></span></span></p>\r\n\r\n<p><strong><span style="color:#8B4513;"><span style="font-size: large; font-family: Arial, Helvetica, sans-serif; line-height: 20.4px;">Điểm nổi bật:</span></span></strong></p>\r\n\r\n<p data-mce-style="outline: none; line-height: 20.4px; margin: 10px 0px; padding: 0px; color: #111111; font-family: Arial, Helvetica, sans-serif; font-size: 12px;" style="outline: none; line-height: 20.4px; margin: 10px 0px; padding: 0px; color: rgb(17, 17, 17); font-family: Arial, Helvetica, sans-serif; font-size: 12px;">-<span data-mce-style="font-size: medium;" style="font-size: medium;"> Bình giữ nhiệt cao cấp Elmich có thiết kế thon gọn nhỏ nhắn, bạn có thể mang theo trong balo hay túi xách mà không mất nhiều không gian.</span></p>\r\n\r\n<p data-mce-style="outline: none; line-height: 20.4px; margin: 10px 0px; padding: 0px; color: #111111; font-family: Arial, Helvetica, sans-serif; font-size: 12px;" style="outline: none; line-height: 20.4px; margin: 10px 0px; padding: 0px; color: rgb(17, 17, 17); font-family: Arial, Helvetica, sans-serif; font-size: 12px;"><span data-mce-style