(135, 56, 16, 78, 0, '', 0, 0, '130000|160000|185000|230000|305000|365000', '(1/9) 108mm x 176mm|(1/6) 162mm x 176mm|(1/4) 162mm x 265mm|(1/3) 176mm x 325mm|(1/2) 265mm x 325mm|(1/1) 325mm x 530mm', 'product', 1, 0, 'khay-dung-thuc-an-bufflet-co-nap-f-9252.jpg', 'khay-dung-thuc-an-bufflet-co-nap-f-9252_195x195.jpg', 'Khay đựng thức ăn inox có nắp', 'KDTA', 'khay-dung-thuc-an-inox-co-nap', '', '', '', 'Việt Nam', 0, 0, '', '', 'Khay đựng thức ăn inox có nắp', 'khay đựng thức ăn, khay cơm phần inox, khay cơm phần, khay inox vuông, khay vuông, khay inox đựng thức ăn, khay buffet', 'khay đựng thức ăn, khay cơm phần inox, khay cơm phần, khay inox vuông, khay vuông, khay inox đựng thức ăn, khay buffet', 0, 0, 0, 0, '', '<div data-mce-style="font-family: Arial, Helvetica, sans-serif; font-size: 12px; line-height: 18px; text-align: justify;" style="color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans-serif; font-size: 12px; line-height: 18px; text-align: justify;">\r\n<p><strong><span data-mce-style="color: #0000ff;" style="color: rgb(0, 0, 255);"><span style="font-size:20px;">khay đựng thức ăn inox có nắp, khay buffet 1/1</span></span></strong></p>\r\n\r\n<p><span data-mce-style="font-size: medium;" style="font-size: medium;">Sản phẩm <em>khay cơm inox </em>ngày càng được sử dụng rộng rãi tại các cơ quan, xí nghiệp, trường học, nhà hàng, quán ăn với những kiểu dáng đa dạng và phong phú. Sản phẩm <strong><span data-mce-style="text-decoration: underline;" style="text-decoration: underline;">khay đựng thức ăn, buffet cỡ lớn</span></strong> được sản xuất trên dây chuyền công nghệ tiến bộ với thiết kế tinh tế và đảm bảo an toàn về chất lượng.</span></p>\r\n</div>\r\n\r\n<p style="color: rgb(0, 0, 0); font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 10px; line-height: normal;"><span data-mce-style="font-size: medium; color: #0000ff;" style="font-size: medium; color: rgb(0, 0, 255);"><strong>Khay đựng thức ăn có nắp inox (sâu 6,10,15,20 cm)(dài 53cm,rộng33cm) : </strong></span><span data-mce-style="font-size: medium;" style="font-size: medium;">Inox cao cấp nên rất mượt và sáng bóng, sang trọng, không bám vi sinh, dễ dàng vệ sinh tiệt trùng sau mỗi lần sử dụng. Ngoài ra, khay còn được sản xuất thêm nắp đậy bằng inox vừa khít, có tay cầm rất tiện lợi. Khay được sử dụng rộng rãi tại nhà hàng, khách sạn, tại các bữa tiệc để làm khay đựng thức ăn, khay đựng hoa quả rất đẹp mắt và sang trọng.</span></p>\r\n\r\n<p> </p>\r\n\r\n<p><img alt="" height="400" src="http://mych.vn/vubaohuy/upload/images/INOX%20KIM%20LOAI/Khay%20dung%20thuc%20an%20bufflet%20co%20nap%20f.jpg" width="400" /></p>\r\n', '', '', '', '', '', '', 1, 1, 1455428115, 1464163846, 0),
