(184, 51, 25, 51, 0, '', 0, 0, 'Call|Call|Call', 'JZ1011-1|JZ1011|JZ1012', 'product', 0, 0, 'tho-dia-jz1011-jz1012-e-3162.jpg', 'tho-dia-jz1011-jz1012-e-3162_195x195.jpg', 'Thố dĩa thủy tinh hoa văn nổi JZ1011', '', 'tho-dia-thuy-tinh-hoa-van-noi-jz1011', '', '', '', 'RPC', 0, 0, '', '', 'Thố dĩa thủy tinh hoa văn', 'dĩa thủy tinh, thố thủy tinh, tô thủy tinh, chén thủy tinh, ly thủy tinh, bình thủy tinh, dĩa thủy tinh có đế', 'dĩa thủy tinh, thố thủy tinh, tô thủy tinh, chén thủy tinh, ly thủy tinh, bình thủy tinh, dĩa thủy tinh có đế', 0, 0, 0, 0, 'Kích thước\r\n* JZ1011-1\r\n- D20 x R20 x C10cm\r\n* JZ1011\r\n- D27 x R27 x C12cm\r\n* JZ1012\r\n- D35 x R35 x C4.5cm', '', '', '', '', '', '', '', 1, 1, 1456809283, 1461921314, 0),
(211, 50, 16, 49, 0, '', 0, 0, '', '', 'product', 1, 0, 'thot-kova-sizem-36x23cm-702.jpg', 'thot-kova-sizem-36x23cm-702_195x195.jpg', 'Thớt nhựa kháng khuẩn Kova nẹp 4 góc', 'TKSM', 'thot-nhua-khang-khuan-kova-nep-4-goc', '', '', '', 'Korea', 0, 600, '', '', 'Thớt nhựa kháng khuẩn Kova', 'thớt nhựa, thớt kháng khuẩn, thớt gỗ, thớt vuông, thớt tròn, thớt nhập khẩu', 'thớt nhựa, thớt kháng khuẩn, thớt gỗ, thớt vuông, thớt tròn, thớt nhập khẩu', 0, 0, 139000, 0, '- SP không áp dụng trong chương trình giảm giá 10%\r\nThớt Nhựa Kova TKSM được sản xuất tại Hàn Quốc theo công nghệ tiên tiến. Thớt sử dụng được cả hai mặt, bạn có thể dùng một mặt để thái đồ sống và mặt kia thái đồ chín rất tiện lợi. Đặc biệt thớt khắc phục hầu hết những khuyết điểm của thớt gỗ, thớt nhựa có góc KOVA đã và đang chinh phục hầu hết những bà nội trợ khó tính. Thớt chắc chắn, kháng khuẩn, độ bền cao và thiết kế đẹp mắt là sản phẩm không thể thiếu trong gian bếp nhà bạn.', '<div class="product-content-detail" style="box-sizing: border-box; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;">\r\n<div class="content js-content expand" id="gioi-thieu" itemprop="description" style="box-sizing: border-box; overflow: hidden; margin-bottom: 15px; max-height: none;">\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; text-align: justify;"><span style="box-sizing: border-box; text-decoration: underline; color: rgb(0, 128, 0);"><span style="box-sizing: border-box; font-weight: 700;">Tính năng sản phẩm:</span></span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; text-align: justify;"><span style="box-sizing: border-box; color: rgb(128, 0, 128);"><span style="box-sizing: border-box; font-weight: 700;">- Nhựa PP kháng khuẩn</span></span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; text-align: justify;">Thớt Kova TKSS-GR làm từ nhựa P.P có độ bền cao, là loại nhựa an toàn, không gây hại cho sức khỏe người dùng. Thớt còn có khả năng kháng khuẩn, nên bạn có thể yên tâm cắt thức ăn chín.</p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; text-align: justify;"><span style="box-sizing: border-box; color: rgb(128, 0, 128);"><span style="box-sizing: border-box; font-weight: 700;">- Rãnh thoát nước</span></span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; text-align: justify;"><span style="box-sizing: border-box;">Rãnh thoát nước chống ẩm mốc, kháng khuẩn tốt, dễ vệ sinh. Nên sử dụng 1 thớt cho thực phẩm  chín và 1 thớt cho thực phẩm sống.</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; text-align: justify;"><span style="box-sizing: border-box; color: rgb(128, 0, 128);"><span style="box-sizing: border-box; font-weight: 700;">- Tính tiện lợi cao</span></span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px;">Thớt Nhựa Kova TKSM sử dụng được cả hai mặt, có thể sử dụng để thái, băm, chặt... rất tiện lợi.</p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px;"><span style="box-sizing: border-box; color: rgb(128, 0, 128);"><span style="box-sizing: border-box; font-weight: 700;">- Vệ sinh thớt</span></span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px;">Sau khi cắt thức ăn, thớt rửa không sạch sẽ phát sinh nhiều vi khuẩn. Do đó bạn nhớ rửa sạch bằng nước rửa chén ngay sau khi sử dụng rồi dựng hoặc treo thớt lên cho ráo nước. Để tăng khả năng chống vi khuẩn, bạn hãy rắc một ít muối lên bề mặt thớt, sau đó dùng nửa trái chanh chà lên thớt hoặc bạn đổ nước nóng lên thớt, rồi dùng bàn chải cứng để chà rửa.</p>\r\n\r\n<p><img alt="mych.vn thớt nhựa kháng khuẩn kova nẹp 4 góc" height="400" src="http://mych.vn/vubaohuy/upload/images/NHUA%2C%20MELAMINE/Th%E1%BB%9Bt%20KOVA%20sizeM%2036x23cm.jpg" style="box-sizing:border-box; vertical-align:middle; border:0px; display:block; max-width:100%; height:auto; margin-left:auto; margin-right:auto; float:left" width="400" /></p>\r\n\r\n<p style="box-sizing: bo