(204, 41, 20, 26, 0, '', 0, 0, '', '', 'product', 0, 0, 'bluestone-hdb1821b-250k188-4775.jpg', 'bluestone-hdb1821b-250k188-4775_195x195.jpg', 'Máy sấy tóc BLUESTONE HDB1821B', 'HDB1821B', 'may-say-toc-bluestone-hdb1821b', '', '', '1000', 'USA', 0, 320, '', '', 'Máy sấy tóc BlueStone', 'máy sấy tóc bluestone hdb1821b, máy sấy tóc, máy ép tóc, tông đơ điện, máy cạo râu, máy đo huyết áp, máy mát xa, máy phun sương dưỡng da, máy uốn tóc', 'Máy sấy tóc Bluestone HDB-1821B chất lượng tốt, kiểu dáng gọn nhẹ, an toàn, màu sắc tinh tế, công suất lớn, đa cấp độ nhiệt, sấy khô nhanh, giảm ồn ào.\r\n• 2 mức điều chỉnh nhiệt linh hoạt khi sấy\r\n• Thiết kế giảm ồn với nắp thông gió cấu trúc tổ ong và cánh quạt nghiêng\r\n32 độ', 0, 0, 250000, 0, 'Máy sấy tóc Bluestone HDB-1821B chất lượng tốt, kiểu dáng gọn nhẹ, an toàn, màu sắc tinh tế, công suất lớn, đa cấp độ nhiệt, sấy khô nhanh, giảm ồn ào.\r\n• 2 mức điều chỉnh nhiệt linh hoạt khi sấy\r\n• Thiết kế giảm ồn với nắp thông gió cấu trúc tổ ong và cánh quạt nghiêng\r\n32 độ', '<h3 style="line-height: 1.3; box-sizing: border-box; clear: both; font-family: Arial, Roboto, Georgia, serif; color: rgb(211, 18, 66); font-size: 22px; margin: 22px 0px;"><strong><a href="http://mych.vn/do-dien-gia-dung/ban-ui-may-say-toc"><span style="color:#8B4513;">Máy sấy tóc</span></a></strong> <span style="color:#0000CD;"><strong>BlueStone HDB 1821B</strong></span></h3>\r\n\r\n<h3 style="box-sizing: border-box; clear: both; font-family: Arial, Roboto, Georgia, serif; color: rgb(211, 18, 66); line-height: 1.3; font-size: 22px; margin: 22px 0px;"><span style="color:#0000CD;">Tính năng nổi bật</span></h3>\r\n\r\n<ul style="box-sizing: border-box; margin: 16px 0px; padding-right: 0px; list-style-type: square; color: rgb(87, 87, 87); font-family: Arial, \'Open Sans\', Helvetica, sans-serif; font-size: 14px; line-height: 25.2px;">\r\n	<li style="box-sizing: border-box;"><span style="font-size:16px;">2 mức điều chỉnh nhiệt linh hoạt khi sấy.</span></li>\r\n	<li style="box-sizing: border-box;"><span style="font-size:16px;">Nắp thông gió với cấu trúc tổ ong kết hợp với cánh quạt nghiêng 32 độ giúp giảm tiếng ồn trong khi sấy.</span></li>\r\n	<li style="box-sizing: border-box;"><span style="font-size:16px;">Phân bố nhiệt đều, giúp nhẹ nhàng sấy khô tóc.</span></li>\r\n	<li style="box-sizing: border-box;"><span style="font-size:16px;">Sử dụng an toàn với chức năng tự ngắt khi máy hoạt động quá tải.</span></li>\r\n</ul>\r\n\r\n<h3 style="box-sizing: border-box; clear: both; font-family: Arial, Roboto, Georgia, serif; color: rgb(211, 18, 66); line-height: 1.3; font-size: 22px; margin: 22px 0px;"><span style="color:#0000CD;">Thông số kỹ thuật</span></h3>\r\n\r\n<ul style="box-sizing: border-box; margin: 16px 0px; padding-right: 0px; list-style-type: square; color: rgb(87, 87, 87); font-family: Arial, \'Open Sans\', Helvetica, sans-serif; font-size: 14px; line-height: 25.2px;">\r\n	<li style="box-sizing: border-box;"><span style="font-size:16px;">Hiệu điện thế: 230V/50Hz</span></li>\r\n	<li style="box-sizing: border-box;"><span style="font-size:16px;">Công suất: 1000W</span></li>\r\n	<li style="box-sizing: border-box;"><span style="font-size:16px;">Cân bằng nhiệt: Có</span></li>\r\n	<li style="box-sizing: border-box;"><span style="font-size:16px;">Đa cấp độ nhiệt: Có</span></li>\r\n	<li style="box-sizing: border-box;"><span style="font-size:16px;">Giảm độ ồn: Có</span></li>\r\n	<li style="box-sizing: border-box;"><span style="font-size:16px;">Tự ngắt điện khi quá nhiệt: Có</span></li>\r\n	<li style="box-sizing: border-box;"><span style="font-size:16px;">Khối lượng sản phẩm: 0.32kg</span></li>\r\n</ul>\r\n\r\n<p style="box-sizing: border-box;"><img alt="mych.vn máy sấy tóc BlueStone HDB1821B" height="400" src="http://mych.vn/vubaohuy/upload/images/MAY%20SAY%20TOC%2C%20BAN%20UI/BlueStone%20HDB1821B%20250k-188.jpg" width="400" /></p>\r\n\r\n<h3 style="box-sizing: border-box; clear: both; font-family: Arial, Roboto, Georgia, serif; color: rgb(211, 18, 66); line-height: 1.3; font-size: 22px; margin: 22px 0px;"><span style="color:#0000CD;">Hướng dẫn sử dụng an toàn</span></h3>\r\n\r\n<ul style="box-sizing: border-box; margin: 16px 0px; padding-right: 0px; list-style-type: square; color: rgb(87, 87, 87); font-family: Arial, \'Open Sans\', Helvetica, sans-serif; font-size: 14px; line-height: 25.2px;">\r\n	<li style="box-sizing: border-box;"><span style="font-size:16px;">Nên lau khô tay trước khi sử dụng máy.</span></li>\r\n	<li style="box-sizing: border-box;"><span style="font-size:16px;">Không đặt máy sấy lên trên gối hoặc mền khi đang sử dụng, không phủ khăn, áo,…vào nắp thông gió khi máy đang hoạt động, đảm bảo luồng gió được lưu thông tốt khi máy sấy hoạt động.</span></li>\r\n	<li style="box-sizing: border-box;"><span style="font-size:16px;">Luôn rút phích cắm ra khỏi nguồn điện sau khi sử dụng xong.</span></li>\r\n	<li style="box-sizing: border-box;"><span style="font-size:16px;">Không sử dụng máy sấy tóc ở những nơi có khí gas hay vật liệu gây cháy khác (như benzen, chất pha loãng sơn, các loại bình phun khí,…)</span></li>\r\n	<li style="box-sizing: border-box;"><span style="font-size:16px;">Không dùng vật liệu thô cứng để lau chùi sản phẩm. Nên dùng vải mỏng, mềm và ẩm để lau sau đó lau lại bằng vải khô.</span></li>\r\n</ul>\r\n\r\n<h3 style="box-sizing: border-box; clear: both; font-family: Arial, Roboto, Georgia, serif; color: rgb(211, 18, 66); line-height: 1.3; font-size: 22px; margin: 22px 0px;"><span style="color:#0000CD;">Khuyên bạn nên vệ sinh máy sấy tóc:</span></h3>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 24px; color: rgb(87, 87, 87); font-family: Arial, \'Open Sans\', Helvetica, sans-serif; font-size: 14px; line-height: 25.2px;"><span style="font-size:16px;">Sau một thời gian sử dụng, máy sấy tóc thường hay bị bám bụi nghiêm trọng ở bộ phận thổi và nạp khí, và thường làm giảm hiệu suất làm khô tóc hay làm hư tổn tóc. Chúng tôi khuyên bạn một số điều sau để máy sấy sử dụng bền và hiệu quả hơn:</span></p>\r\n\r\n<ul style="box-sizing: border-box; margin: 16px 0px; padding-right: 0px; list-style-type: square; color: rgb(87, 87, 87); font-family: Arial, \'Open Sans\', Helvetica, sans-serif; font-size: 14px; line-height: 25.2px;">\r\n	<li style="box-sizing: border-box;"><span style="font-size:16px;">Nên vệ sinh máy sấy tóc mỗi tháng một hoặc nhiều lần hơn, nếu có thể.</span></li>\r\n	<li style="box-sizing: border-box;"><span style="font-size:16px;">Để làm sạch bộ phận thổi khí, găm điện, bạn nên bật công tắc sang chế độ sấy thấp nhất, sử dụng bàn chải mềm để móc bụi ra trong khi máy vẫn đang thổi khí mát ra ngoài.</span></li>\r\n	<li style="box-sizing: border-box;"><span style="font-size:16px;">Với bộ phận nạp khí, bạn nên tắt máy về vị trí 0, sau đó sử dụng bàn chải mềm hoặc máy hút bụi mini để lấy bụi ra.</span></li>\r\n</ul>\r\n\r\n<p><span style="font-size:16px;"> Máy được thiết kế gọn nhẹ với kiểu dáng trang nhã, màu trắng tinh tế, phù hợp với nhiều lứa tuổi. Tay cầm nhỏ nhắn, dễ dàng khi sử dụng. Với thiết kế nhỏ xinh, bạn có thể dễ dàng đem máy theo bên người ngay cả khi đi du lịch hay đi công tác. Móc treo tường rất tiện lợi khi bạn muốn lưu giữ, bảo quản máy sau khi sử dụng xong.</span></p>\r\n\r\n<ul style="box-sizing: border-box; margin: 16px 0px; padding-right: 0px; list-style-type: square; color: rgb(87, 87, 87); font-family: Arial, \'Open Sans\', Helvetica, sans-serif; font-size: 14px; line-height: 25.2px;">\r\n	<li style="box-sizing: border-box;"><span style="font-size:16px;">Vỏ ngoài được làm bằng chất liệu nhựa cứng cao cấp, không bị vỡ khi va đập nhẹ, giúp bạn sử dụng an toàn và lâu bền hơn. Chất liệu nhựa được sơn sáng bóng, không bám bụi, rất dễ dàng khi bạn muốn lau chùi, vệ sinh máy, để máy luôn trông sạch đẹp như khi mới mua.</span></li>\r\n	<li style="box-sizing: border-box;"><span style="font-size:16px;">Với 2 mức điều chỉnh nhiệt độ, bạn có thể tùy chọn nhiệt độ sấy phù hợp với nhiều loại tóc và nhu cầu sấy khác nhau.<br style="box-sizing: border-box;" />\r\n	Chức năng cân bằng nhiệt giúp máy giữ nhiệt ổn định ở mức 57 độ C giúp luôn giữ được độ ẩm vốn có của tóc. Thiết kế phân bố nhiệt đều giúp tóc được sấy khô nhẹ nhàng, mượt mà, không cần phải di chuyển quá nhiều lần.</span></li>\r\n	<li style="box-sizing: border-box;"><span style="font-size:16px;">Đặc biệt, máy sấy tóc HDB 1821B còn được trang bị chức năng tự bảo vệ thông minh: máy tự ngắt điện khi nhiệt độ quá cao, máy quá nóng, mạch điện trong nhà quá tải, đảm bảo an toàn tuyệt đối cho gia đình bạn, giúp tiết kiệm điện năng và kéo dài tuổi thọ sử dụng máy.</span></li>\r\n	<li style="box-sizing: border-box;"><span style="font-size:16px;">Công suất máy 1000W, giúp bạn sấy khô tóc nhanh mà không làm hư tóc, đem lại mái tóc khỏe đẹp tự nhiên cho người dùng.</span></li>\r\n	<li style="box-sizing: border-box;"><span style="font-size:16px;">Ngoài chức năng sấy tóc, máy sấy Bluestone còn có thể giúp bạn thổi bay những hạt bụi li ti dính trên bàn phím máy tính, hay có thể sấy khô một số quần áo nhỏ, khăn mỏng hay tất…<br style="box-sizing: border-box;" />\r\n	Được áp dụng công nghệ hiện đại của Hoa Kỳ, sử dụng motor chất lượng tốt, máy vận hành êm ái. Thiết kế nắp thông gió với cấu trúc dạng tổ ong, cùng cánh quạt có độ nghiêng 320 làm giảm tiếng ồn tối đa khi sử dụng, đem lại cảm giác thoải mái cho người dùng.</span></li>\r\n</ul>\r\n\r\n<p> </p>\r\n', '', '', '', '', '', '', 1, 1, 1457824941, 1464321277, 0);
