(205, 41, 20, 26, 0, '', 0, 0, '', '', 'product', 0, 0, 'bluestone-hdb1828f-325k245-2034.jpg', 'bluestone-hdb1828f-325k245-2034_195x195.jpg', 'Máy sấy tóc BLUESTONE HDB1828F', 'HDB1828F', 'may-say-toc-bluestone-hdb1828f', '', '', '1200', 'USA', 0, 410, '', '', 'Máy sấy tóc BlueStone', 'máy sấy tóc bluestone hdb1828f, máy sấy tóc, máy ép tóc, tông đơ điện, máy cạo râu, máy đo huyết áp, máy mát xa, máy phun sương dưỡng da, máy uốn tóc', 'Máy sấy tóc Bluestone HDB-1828F chất lượng tốt, kiểu dáng gọn nhẹ, an toàn, màu sắc tinh tế, công suất lớn, đa cấp độ nhiệt, sấy khô nhanh, giảm ồn ào.\r\n• Chức năng làm mát, chăm sóc tóc giúp tóc mềm mại.\r\n• Tay cầm gập được tiện lợi khi đi du lịch và cất giữ.\r\n• Thiết kế nữ tính với hoa văn trang nhã trên thân máy.\r\n• Chế độ sấy mát 57oC giúp bảo vệ độ ẩm của tóc', 0, 0, 325000, 0, 'Máy sấy tóc Bluestone HDB-1828F chất lượng tốt, kiểu dáng gọn nhẹ, an toàn, màu sắc tinh tế, công suất lớn, đa cấp độ nhiệt, sấy khô nhanh, giảm ồn ào.\r\n• Chức năng làm mát, chăm sóc tóc giúp tóc mềm mại.\r\n• Tay cầm gập được tiện lợi khi đi du lịch và cất giữ.\r\n• Thiết kế nữ tính với hoa văn trang nhã trên thân máy.\r\n• Chế độ sấy mát 57oC giúp bảo vệ độ ẩm của tóc', '<h2 style="box-sizing: border-box; clear: both; font-family: Arial, Roboto, Georgia, serif; color: rgb(211, 18, 66); line-height: 1.3; font-size: 24px; margin: 25px 0px;"><u><em><strong><a href="http://mych.vn/do-dien-gia-dung/ban-ui-may-say-toceywords=may+say+toc"><span style="color:#8B4513;">Máy sấy tóc</span></a></strong></em></u> <span style="color:#0000CD;"><strong>Bluestone HDB-1828F</strong></span></h2>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 24px; color: rgb(87, 87, 87); font-family: Arial, \'Open Sans\', Helvetica, sans-serif; font-size: 14px; line-height: 25.2px;"><span style="font-size:16px;">“Cái răng cái tóc là góc con người”, mái tóc luôn được các chị em đặc biệt quan tâm. Nhưng làm thế nào để chăm sóc tóc tốt khi cuộc sống, công việc quá bận rộn? Họ thường xuyên bị mắc các bệnh về da đầu, hay rụng tóc khi chăm sóc không đúng cách, do đều da đầu bị ẩm ướt quá lâu sau khi gội đầu hay khi bị mắc mưa. Được trang bị những tính năng hiện đại, an toàn và kiểu dáng nữ tính, đẹp mắt, <strong style="box-sizing: border-box;">máy sấy tóc Bluestone HDB-1828F</strong> giúp bạn sấy khô tóc nhanh chóng mà không sự bị hư tổn, tạo những kiểu tóc mới một cách dễ dàng, đem lại mái tóc khỏe đẹp tự nhiên cho bạn.</span></p>\r\n\r\n<h3 style="box-sizing: border-box; clear: both; font-family: Arial, Roboto, Georgia, serif; color: rgb(211, 18, 66); line-height: 1.3; font-size: 22px; margin: 22px 0px;"><span style="color:#8B4513;">Mô tả máy sấy tóc</span><span style="color:#0000CD;"> </span><a href="http://mych.vn"><span style="color:#0000CD;">Bluestone</span></a><span style="color:#0000CD;"> HDB 1828F</span></h3>\r\n\r\n<p><img alt="mych.vn máy sấy tóc BlueStone HDB 1828F" height="400" src="http://mych.vn/vubaohuy/upload/images/MAY%20SAY%20TOC%2C%20BAN%20UI/BlueStone%20HDB1828F%20325k-245%20b.jpg" width="400" /></p>\r\n\r\n<ul style="box-sizing: border-box; margin: 16px 0px; padding-right: 0px; list-style-type: square; color: rgb(87, 87, 87); font-family: Arial, \'Open Sans\', Helvetica, sans-serif; font-size: 14px; line-height: 25.2px;">\r\n	<li style="box-sizing: border-box;"><span style="font-size:16px;">Máy màu trắng, được trang trí hoa văn trang nhã. Thiết kế máy sấy nhỏ gọn, tay cầm có thể gập lại, rất tiện lợi khi bạn muốn đem theo bên mình khi muốn đi du lịch hay đi công tác xa nhà. Ngoài ra, máy còn trang bị thêm móc treo tường rất thuận tiện cho việc lưu giữ và bảo quản máy sau khi sử dụng xong.</span></li>\r\n	<li style="box-sizing: border-box;"><span style="font-size:16px;">Vỏ ngoài được làm bằng chất liệu nhựa cứng cao cấp, chịu lực tốt và có khả năng chịu nhiệt độ cao, không bị vỡ khi va đập nhẹ, giúp bạn sử dụng máy sấy an toàn và lâu bền. Chất liệu nhựa sơn bóng loáng, không bị bám bẩn, giúp bạn dễ dàng lau chùi khi vệ sinh máy.</span></li>\r\n	<li style="box-sizing: border-box;"><span style="font-size:16px;">Máy sấy tóc Bluestone được trang bị hai tốc độ sấy khác nhau, giúp bạn có thể tùy chỉnh và chọn lựa tốc độ sấy phù hợp với mục đích sấy và tạo kiểu tóc của mình. Đặc biệt, máy được trang bị thêm chức năng sấy mát, không nóng, phù hợp để bạn sấy tóc cho trẻ nhỏ hay những người có mái tóc yếu, dễ bị tổn thương.</span></li>\r\n	<li style="box-sizing: border-box;"><span style="font-size:16px;">Máy sấy tóc HDB-1828F là thiết bị làm đẹp an toàn với chức năng tự ngắt điện khi nhiệt độ máy quá nóng, mạch điện trong nhà quá tải,…rất an toàn cho người dùng và kéo dài tuổi thọ sử dụng máy.</span></li>\r\n	<li style="box-sizing: border-box;"><span style="font-size:16px;">Với công suất lớn lên tới 1200W, máy giúp bạn sấy khô tóc trong thời gian ngắn, không làm tóc bị hư tổn, đem lại cho bạn mái tóc óng mượt tự nhiên.</span></li>\r\n</ul>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 24px; color: rgb(87, 87, 87); font-family: Arial, \'Open Sans\', Helvetica, sans-serif; font-size: 14px; line-height: 25.2px;"><span style="font-size:16px;">Với thiết kế gọn nhẹ, màu sắc tinh tế, kiểu dáng sang trọng, nhiều tính năng tiện lợi, thiết kế an toàn, <em style="box-sizing: border-box;">máy sấy tóc tạo kiểu HDB-1828F của Bluestone</em> có thể giúp bạn sấy khô tóc trong thời gian ngắn, đem lại cho bạn mái tóc mềm mại, tự nhiên. Sản phẩm đã được đánh giá cao và rất được người tiêu dùng ưa chuộng trong suốt thời gian qua.</span></p>\r\n\r\n<h3 style="box-sizing: border-box; clear: both; font-family: Arial, Roboto, Georgia, serif; color: rgb(211, 18, 66); line-height: 1.3; font-size: 22px; margin: 22px 0px;"><span style="color:#0000CD;">Tính năng nổi trội của máy sấy tóc Bluestone HDB 1828F</span></h3>\r\n\r\n<ul style="box-sizing: border-box; margin: 16px 0px; padding-right: 0px; list-style-type: square; color: rgb(87, 87, 87); font-family: Arial, \'Open Sans\', Helvetica, sans-serif; font-size: 14px; line-height: 25.2px;">\r\n	<li style="box-sizing: border-box;"><span style="font-size:16px;">Thiết kế nữ tính với hoa văn trang nhã trên thân máy.</span></li>\r\n	<li style="box-sizing: border-box;"><span style="font-size:16px;">Tay cầm gập được tiện lợi khi đi du lịch và cất giữ.</span></li>\r\n	<li style="box-sizing: border-box;"><span style="font-size:16px;">Chức năng làm mát, chăm sóc tóc giúp tóc mềm mại.</span></li>\r\n	<li style="box-sizing: border-box;"><span style="font-size:16px;">An toàn với chức năng tự ngắt điện khi quá nhiệt.</span></li>\r\n</ul>\r\n\r\n<h3 style="box-sizing: border-box; clear: both; font-family: Arial, Roboto, Georgia, serif; color: rgb(211, 18, 66); line-height: 1.3; font-size: 22px; margin: 22px 0px;"><span style="font-size:20px;"><span style="color:#0000CD;">Thông số kỹ thuật</span></span></h3>\r\n\r\n<ul style="box-sizing: border-box; margin: 16px 0px; padding-right: 0px; list-style-type: square; color: rgb(87, 87, 87); font-family: Arial, \'Open Sans\', Helvetica, sans-serif; font-size: 14px; line-height: 25.2px;">\r\n	<li style="box-sizing: border-box;"><span style="font-size:16px;">Hiệu điện thế: 220-240V/50-60Hz</span></li>\r\n	<li style="box-sizing: border-box;"><span style="font-size:16px;">Công suất: 1200W</span></li>\r\n	<li style="box-sizing: border-box;"><span style="font-size:16px;">Chức năng sấy mát: Có</span></li>\r\n	<li style="box-sizing: border-box;"><span style="font-size:16px;">Cân bằng nhiệt: Có</span></li>\r\n	<li style="box-sizing: border-box;"><span style="font-size:16px;">Đa cấp độ nhiệt: Có</span></li>\r\n	<li style="box-sizing: border-box;"><span style="font-size:16px;">Giảm độ ồn: Có</span></li>\r\n	<li style="box-sizing: border-box;"><span style="font-size:16px;">Đầu sấy phụ đi kèm: Có</span></li>\r\n	<li style="box-sizing: border-box;"><span style="font-size:16px;">Tay cầm gập được: Có</span></li>\r\n	<li style="box-sizing: border-box;"><span style="font-size:16px;">Tự ngắt điện khi quá nhiệt: Có</span></li>\r\n	<li style="box-sizing: border-box;"><span style="font-size:16px;">Khối lượng sản phẩm: 0.41kg</span></li>\r\n</ul>\r\n\r\n<h3 style="box-sizing: border-box; clear: both; font-family: Arial, Roboto, Georgia, serif; color: rgb(211, 18, 66); line-height: 1.3; font-size: 22px; margin: 22px 0px;"><span style="color:#0000CD;">Hướng dẫn sử dụng an toàn</span></h3>\r\n\r\n<ul style="box-sizing: border-box; margin: 16px 0px; padding-right: 0px; list-style-type: square; color: rgb(87, 87, 87); font-family: Arial, \'Open Sans\', Helvetica, sans-serif; font-size: 14px; line-height: 25.2px;">\r\n	<li style="box-sizing: border-box;"><span style="font-size:16px;">Nên lau khô tay trước khi sử dụng máy.<br style="box-sizing: border-box;" />\r\n	Không đặt máy sấy lên trên gối hoặc mền khi đang sử dụng, không phủ khăn, áo,…vào nắp thông gió khi máy đang hoạt động, đảm bảo luồng gió được lưu thông tốt khi máy sấy hoạt động.</span></li>\r\n	<li style="box-sizing: border-box;"><span style="font-size:16px;">Luôn rút phích cắm ra khỏi nguồn điện sau khi sử dụng xong.</span></li>\r\n	<li style="box-sizing: border-box;"><span style="font-size:16px;">Không sử dụng máy sấy tóc ở những nơi có khí gas hay vật liệu gây cháy khác (như benzen, chất pha loãng sơn, các loại bình phun khí,…)</span></li>\r\n	<li style="box-sizing: border-box;"><span style="font-size:16px;">Không dùng vật liệu thô cứng để lau chùi sản phẩm. Nên dùng vải mghỏng, mềm và ẩm để lau sau đó lau lại bằng vải khô.</span></li>\r\n</ul>\r\n\r\n<h3 style="box-sizing: border-box; clear: both; font-family: Arial, Roboto, Georgia, serif; color: rgb(211, 18, 66); line-height: 1.3; font-size: 22px; margin: 22px 0px;"><span style="color:#0000CD;">Lời khuyên bạn nên vệ sinh máy sấy tóc</span></h3>\r\n\r\n<ul style="box-sizing: border-box; margin: 16px 0px; padding-right: 0px; list-style-type: square; color: rgb(87, 87, 87); font-family: Arial, \'Open Sans\', Helvetica, sans-serif; font-size: 14px; line-height: 25.2px;">\r\n	<li style="box-sizing: border-box;"><span style="font-size:16px;"><span style="color:#000000;">Sau một thời gian sử dụng, máy sấy tóc thường hay bị bám bụi nghiêm trọng ở bộ phận thổi và nạp khí, và thường làm giảm hiệu suất làm khô tóc hay làm hư tổn tóc. Chúng tôi khuyên bạn một số điều sau để máy sấy sử dụng bền và hiệu quả hơn:</span></span></li>\r\n	<li style="box-sizing: border-box;"><span style="font-size:16px;"><span style="color:#000000;">Nên vệ sinh máy sấy tóc mỗi tháng một hoặc nhiều lần hơn, nếu có thể.</span></span></li>\r\n	<li style="box-sizing: border-box;"><span style="font-size:16px;"><span style="color:#000000;">Để làm sạch bộ phận thổi khí, găm điện, bạn nên bật công tắc sang chế độ sấy thấp nhất, sử dụng bàn chải mềm để móc bụi ra trong khi máy vẫn đang thổi khí mát ra ngoài.</span></span></li>\r\n	<li style="box-sizing: border-box;"><span style="font-size:16px;"><span style="color:#000000;">Với bộ phận nạp khí, bạn nên tắt máy về vị trí 0, sau đó sử dụng bàn chải mềm hoặc máy hút bụi mini để lấy bụi ra.</span></span></li>\r\n</ul>\r\n', '', '', '', '', '', '', 1, 1, 1457825118, 1464321120, 0),
(214, 40, 20, 23, 0, '', 0, 0, '', '', 'product', 0, 0, 'bluestone-ktb3317-b-2915.jpg', 'bluestone-ktb3317-b-2915_195x195.jpg', 'Ấm siêu tốc BlueStone 1,7L KTB3317', 'KTB3317', 'am-sieu-toc-bluestone-17l-ktb3317', '', '', '1850 - 2200', 'USA', 1700, 1270, '24 tháng', '', 'Ấm siêu tốc BlueStone KTB3317', 'ấm siêu tốc bluestone ktb3317, ấm siêu tốc, bình siêu tốc, ấm siêu tốc nhựa, ấm siêu tốc inox, bình đun nước, ấm đun nước điện, ấm đun nước', '• Tấm nhiệt phẳng bằng inox 304 (thép không gỉ) giúp đun sôi nhanh, an\r\ntoàn cho sức khỏe.\r\n• Nhựa chịu nhiệt cao đạt tiêu chuẩn LFGB của Đức, an toàn cho sức khỏe.\r\n• Tự động ngắt điện khi sôi và khi ấm cạn nước, an toàn khi sử dụng.', 0, 0, 350000, 0, '• Tấm nhiệt phẳng bằng inox 304 (thép không gỉ) giúp đun sôi nhanh, an\r\ntoàn cho sức khỏe.\r\n• Nhựa chịu nhiệt cao đạt tiêu chuẩn LFGB của Đức, an toàn cho sức khỏe.\r\n• Tự động ngắt điện khi sôi và khi ấm cạn nước, an toàn khi sử dụng.', '<p><span style="font-size:20px;"><span style="box-sizing: border-box;"><span style="box-sizing: border-box; font-weight: 700;"><a href="http://mych.vn/do-dien-gia-dung/am-sieu-toc-may-pha-ca-phe" style="box-sizing: border-box; color: rgb(51, 122, 183); text-decoration: none; background-color: transparent;"><span style="color:#8B4513;">Ấm Siêu Tốc</span></a></span></span><span style="box-sizing: border-box; color: rgb(0, 138, 183);"><span style="box-sizing: border-box; font-weight: 700;"> </span></span><span style="line-height: 1.6; color: rgb(0, 0, 205);"><span style="box-sizing: border-box;"><span style="box-sizing: border-box; font-weight: 700;">BLUESTONE KTB-3317 :</span></span></span></span></p>\r\n\r\n<div class="content js-content expand" id="gioi-thieu" itemprop="description" style="box-sizing: border-box; overflow: hidden; margin-bottom: 15px; max-height: none;">\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px;"><span style="line-height: 1.6; box-sizing: border-box; font-weight: 700;">- <span style="font-size:16px;">V</span></span><span style="font-size:16px;"><span style="line-height: 1.6;">ới dung tích bình lớn 1.7L giúp bạn có thể đun lượng nước lớn cùng lúc, đáp ứng nhu cầu sử dụng của gia đình. Chỉ trong ít phút bạn đã có ngay 1 tách trà hay bát mì ăn liền nóng hổi cho bữa sáng của cả nhà. Với thiết kế sang trọng cùng màu trắng pha viền cam bắt mắt, chiếc ấm đun nước siêu tốc tạo nên điểm nhấn dễ thương cho căn bếp của chị em nội trợ.</span></span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px;"><img alt="mych.vn Ấm Siêu Tốc BLUESTONE KTB-3317 " height="400" src="http://mych.vn/vubaohuy/upload/images/AM%20SIEU%20TOC/BlueStone%20KTB3317.jpg" style="box-sizing: border-box; vertical-align: middle; border: 0px; display: block; max-width: 100%; height: auto; margin-left: auto; margin-right: auto;" title="Ấm Đun Nước Siêu Tốc BLUESTONE KTB-3317 " width="400" /></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px;"><span style="color:#8B4513;"><span style="font-size:16px;"><span style="box-sizing: border-box; font-weight: 700;">Tính năng nổi bật</span></span></span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px;"><span style="font-size:16px;">-    Tấm nhiệt phẳng bằng inox 304 (thép không gỉ) giúp đun sôi nhanh, an toàn cho sức khỏe.</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px;"><span style="font-size:16px;">-     Nhựa chịu nhiệt cao đạt tiêu chuẩn LFGB của Đức, an toàn cho sức khỏe.</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px;"><span style="font-size:16px;">-    Tự động ngắt điện khi sôi và khi ấm cạn nước, an toàn khi sử dụng.</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px;"><span style="font-size:16px;">-    Đế xoay 360 độ.</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px;"><span style="font-size:16px;">-    Hiển thị mực nước.</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px;"><span style="font-size:16px;">-    Khe chứa dây điện</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px;"><span style="font-weight: 700; font-size: 16px; color: rgb(139, 69, 19); line-height: 1.6;">Thông số kỹ thuật</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px;"><span style="font-size:16px;">-    Model: KTB-3317</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px;"><span style="font-size:16px;">-    Công suất: 1850-2200W</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px;"><span style="font-size:16px;">-    Dung tích: 1.7L</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px;"><span style="font-size:16px;">-    Chất liệu:</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px;"><span style="font-size:16px;">+ Thân ấm: Nhựa chịu nhiệt</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px;"><span style="font-size:16px;">+ Mâm nhiệt phẳng (chống bám cặn): Thép không gỉ 304</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px;"><span style="color:#0000CD;"><span style="font-size:20px;"><span style="box-sizing: border-box; font-weight: 700;">Mô tả tính năng :</span></span></span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px;"><span style="color:#8B4513;"><span style="font-size:16px;"><span style="box-sizing: border-box; font-weight: 700;">Chất liệu cao cấp, an toàn cho sức khỏe</span></span></span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px;"><span style="font-size:16px;"><span style="box-sizing: border-box; font-weight: 700;">- </span>có thân ấm được làm bằng nhựa chịu nhiệt cao đạt tiêu chuẩn LFGB của Đức, tấm nhiệt phẳng bằng thép không gỉ 304 giúp đun sôi nhanh, không phát sinh độc tố trong quá trình sử dụng, an toàn cho sức khỏe. Ngoài ra, tay cầm với chất liệu giúp cách nhiệt, đảm bảo tay không bị bỏng khi tiếp xúc với bình.</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px;"><span style="color:#8B4513;"><span style="font-size:16px;"><span style="box-sizing: border-box; font-weight: 700;">Công suất 1850-2200W</span></span></span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px;"><span style="font-size:16px;">Ấm Đun Nước Siêu Tốc  BLUESTONE KTB-3317 có công suất lớn lên đến 2200W cho tốc độ đun siêu nhanh, tiện lợi cho việc pha trà, cà phê hay chế mì ăn liền, giúp bạn tiết kiệm thời gian tối đa.</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px;"><span style="color:#8B4513;"><span style="font-size:16px;"><span style="box-sizing: border-box; font-weight: 700;">Tự động ngắt điện</span></span></span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px;"><span style="font-size:16px;">Bình có chế độ tự động ngắt điện khi nước sôi, ngoài công dụng tiết kiệm năng lượng, còn tránh được tình trạng cạn nước cháy bình, rất an toàn cho người sử dụng.</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px;"><span style="color:#8B4513;"><span style="font-size:16px;"><span style="box-sizing: border-box; font-weight: 700;">Kiểu dáng sang trọng, tiện dụng</span></span></span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px;"><span style="font-size:16px;">Bình sở hữu gam màu trắng sang trọng cùng thiết kế nhỏ gọn với tay cầm tiện dụng giúp bạn dễ dàng di chuyển mà lại không chiếm nhiều không gian trong căn bếp. Bên cạnh đó, bình được  trang bị thước đo tiện dụng có thể hiển thị mực nước, giúp bạn kiểm soát được lượng nước trong bình dễ dàng.</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px;"><span style="color:#8B4513;"><span style="font-size:16px;"><span style="box-sizing: border-box; font-weight: 700;">Hướng dẫn sử dụng và bảo quản</span></span></span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px;"><span style="font-size:16px;">- Không tiếp xúc trực tiếp với thân ấm khi đang sử dụng</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px;"><span style="font-size:16px;">- Không để tay gần vị trí vòi rót nước khi nước đang sôi</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px;"><span style="font-size:16px;">- Bảo quản nơi thoáng mát</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px;"><span style="font-size:16px;">- Tháo phích cắm khỏi ổ điện khi không sử dụng.</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px;"><span style="font-size:16px;">- Không để dây điện hoặc phích cắm tiếp xúc với nước hoặc chất lỏng khác.</span></p>\r\n</div>\r\n\r\n<p> </p>\r\n', '', '', '', '', '', '', 2, 1, 1458458371, 1464253067, 0),
