(208, 40, 20, 23, 0, '', 0, 0, '', '', 'product', 0, 0, 'ast-bluestone-ktb3368-17l-5829.jpg', 'ast-bluestone-ktb3368-17l-5829_195x195.jpg', 'Ấm siêu tốc BlueStone 1,7L KTB3368', 'KTB3368', 'am-sieu-toc-bluestone-17l-ktb3368', '', '', '2000 - 2400', 'USA', 1700, 1150, '12 Tháng', '', 'Ấm siêu tốc BlueStone', 'ấm siêu tốc bluestone ktb3368, ấm siêu tốc, bình siêu tốc, ấm siêu tốc nhựa, ấm siêu tốc inox, bình đun nước, ấm đun nước điện, ấm đun nước', 'Với tốc độ đun sôi chỉ trong vài phút sau khi bật nút "ON", bạn không cần phải ngồi chờ nước sôi. Bình đun siêu tốc BlueStone được trang bị bộ điều khiển tiên tiến hiệu Strix và Otter của Anh cùng hệ thống nung nóng bằng tấm nhiệt phẳng, nước sôi trước khi bạn hoàn thành phần chuẩn bị của mình.\r\n• Thiết kế thân ấm 2 lớp đặc biệt với lớp inox 304 (thép không gỉ) an toàn\r\nbên trong và lớp nhựa chịu nhiệt bên ngoài.\r\n• Bộ điều khiển Strix được sản xuất tại Anh, giúp nâng cao hiệu suất và tăng\r\ntuổi thọ ấm.\r\n• Tự động ngắt điện khi nước sôi và cạn nước, Có đèn báo hiệu khi ấm hoạt\r\nđộng.', 0, 0, 1065000, 0, 'Với tốc độ đun sôi chỉ trong vài phút sau khi bật nút "ON", bạn không cần phải ngồi chờ nước sôi. Bình đun siêu tốc BlueStone được trang bị bộ điều khiển tiên tiến hiệu Strix và Otter của Anh cùng hệ thống nung nóng bằng tấm nhiệt phẳng, nước sôi trước khi bạn hoàn thành phần chuẩn bị của mình.\r\n• Thiết kế thân ấm 2 lớp đặc biệt với lớp inox 304 (thép không gỉ) an toàn\r\nbên trong và lớp nhựa chịu nhiệt bên ngoài.\r\n• Bộ điều khiển Strix được sản xuất tại Anh, giúp nâng cao hiệu suất và tăng\r\ntuổi thọ ấm.\r\n• Tự động ngắt điện khi nước sôi và cạn nước, Có đèn báo hiệu khi ấm hoạt\r\nđộng.', '<p style="box-sizing: border-box; margin: 0px 0px 10px;"><span style="font-size:20px;"><span style="box-sizing: border-box;"><span style="box-sizing: border-box; font-weight: 700;"><a href="http://mych.vn/do-dien-gia-dung/am-sieu-toc-may-pha-ca-phe" style="box-sizing: border-box; color: rgb(51, 122, 183); text-decoration: none; background-color: transparent;"><span style="color:#8B4513;">Ấm Siêu Tốc</span></a></span></span><span style="box-sizing: border-box; color: rgb(0, 138, 183);"><span style="box-sizing: border-box; font-weight: 700;"> </span></span><span style="color:#0000CD;"><strong><span style="box-sizing: border-box;"><span style="box-sizing: border-box; font-weight: 700;">Bluestone KTB-3368 :</span></span></strong></span></span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px;"><span style="font-size:16px;"><b>-</b> Có dung tích 1.7 L hoạt động với công suất 2200W - 2400W, giúp thời gian nấu nước nhanh hơn. Đồng thời tiết kiệm chi phí điện năng.  Với sắc trắng tinh khôi cùng hoa văn trang nhã, sản phẩm giống như một vật trang trí trong căn bếp nhà bạn. Thiết kế đơn giản gọn nhẹ, không tốn nhiều diện tích cất giữ. Hoạt động với công nghệ cùng thiết kế hiện đại, an toàn <span style="color:#8B4513;"><span style="box-sizing: border-box; font-weight: 700;">Ấm Đun Siêu Tốc Hai Lớp Bluestone KTB-3368</span><span style="box-sizing: border-box; font-weight: 700;"> </span></span>mang đến cho bạn và gia đình một cuộc sống đầy tiện nghi.</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px;"><img alt="mych.vn Ấm Đun Siêu Tốc Bluestone KTB-3368" height="400" src="http://mych.vn/vubaohuy/upload/images/AM%20SIEU%20TOC/AST%20BLUESTONE%20KTB3368%201%2C7L%20d.jpg" style="box-sizing:border-box; vertical-align:middle; border:0px; display:block; max-width:100%; height:auto; margin-left:auto; margin-right:auto; float:left" title="Ấm Đun Siêu Tốc Bluestone KTB-3368" width="400" /></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px;"> </p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px;"> </p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px;"> </p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px;"> </p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px;"> </p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px;"> </p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px;"> </p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px;"> </p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px;"> </p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px;"> </p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px;"> </p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px;"> </p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px;"> </p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px;"> </p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px;"><span style="color:#0000CD;"><span style="font-size:18px;"><span style="box-sizing: border-box; font-weight: 700;">Thông tin sản phẩm :</span></span></span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px;"><span style="font-size:16px;"><span style="color:#8B4513;"><span style="box-sizing: border-box; font-weight: 700;">Đun sôi nước nhanh chóng cùng dung tích chứa đựng lớn</span></span></span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px;"><span style="font-size:16px;">Ấm đun được trang bị hệ thống đung sôi với công suất 2200 - 2400W, cho thời gian đun sôi nước nhanh chóng. Dung tích sử dụng sản phẩm lên đến 1.7l phù hợp cho bạn dùng nước sôi để chế biến mì gói, trà, cà phê,...</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px;"><span style="color:#8B4513;"><span style="font-size:16px;"><span style="box-sizing: border-box; font-weight: 700;">Thiết kế 2 lớp đặc biệt</span></span></span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px;"><span style="font-size:16px;">Thiết kế thân ấm 2 lớp đặc biệt với lớp inox 304 (thép không gỉ) an toàn bên trong và lớp nhựa chịu nhiệt bên ngoài. Sản phẩm đảm bảo cho thời gian sử dụng dài lâu.</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px;"><span style="color:#8B4513;"><span style="font-size:16px;"><span style="box-sizing: border-box; font-weight: 700;">Tích hợp công nghệ tiên tiến</span></span></span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px;"><span style="font-size:16px;">Ấm đun được tích hợp bộ điều khiển Strix được sản xuất tại Anh, giúp nâng cao hiệu suất và tăng tuổi thọ ấm. Ấm có khả năng tự động ngắt điện khi nước sôi và cạn nước. Có kèm đèn báo hiệu khi ấm hoạt động. Bảng hiện mực nước trên thân ấm giúp dễ dàng quan sát được lượng nước bên trong.</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px;"><span style="color:#8B4513;"><span style="font-size:16px;"><span style="box-sizing: border-box; font-weight: 700;">Hướng dẫn sử dụng lần đầu tiên:</span></span></span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px;"><span style="font-size:16px;">1. Lấy ấm ra khỏi hộp, lấy tất cả các vật liệu (nếu có) ra khỏi ấm.</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px;"><span style="font-size:16px;">2. Trước khi cắm điện, hãy kiểm tra điện thế ghi trên ấm có phù hợp với điện thế nguồn tại nhà bạn không.</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px;"><span style="font-size:16px;">3. Đổ nước vào ấm đến điểm “Max” và đun nước. Sau khi nước sôi, ngắt điện và đổ nước đi, sau đó đun lại lần 2 để sử dụng.</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px;"><span style="color:#8B4513;"><span style="font-size:16px;"><span style="box-sizing: border-box; font-weight: 700;">Lưu ý khi sử dụng</span></span></span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px;"><span style="font-size:16px;">- Không đổ nước dưới mức min hoặc quá đầy trên mức max vì dễ làm tràn nước gây chập điện hoặc cháy máy.</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px;"><span style="font-size:16px;">- Kiểm tra ổ điện trước khi cắm phích.</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px;"><span style="font-size:16px;">- Không để nước đọng lại trong ấm lâu ngày làm hoen gỉ đọng cặn, giảm tuổi thọ của ấm.</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px;"><span style="font-size:16px;">- Để nơi an toàn, tránh các thiết bị điện khác như nồi cơm điện, nồi áp suất</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px;"><span style="font-size:16px;">- Thường xuyên vệ sinh máy để tăng tuổi thọ.</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px;"><span style="color:#0000CD;"><span style="font-size:18px;"><span style="font-weight: 700; line-height: 1.6;">Thông số kỹ thuật:</span></span></span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px;"><span style="font-size:16px;">- Chất liệu thân ấm: <span style="box-sizing: border-box;">2 Lớp: Lớp ngoài - Nhựa; Lớp trong - Thép không gỉ 304</span></span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px;"><span style="font-size:16px;">- Mâm nhiệt phẳng: Thép không gỉ</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px;"><span style="font-size:16px;">- Đèn báo: Có</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px;"><span style="font-size:16px;">- Thân ấm không dây: Có</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px;"><span style="font-size:16px;">- Tự động ngắt khi nước sôi: Có</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px;"><span style="font-size:16px;">- Đế xoay 360 độ: Có</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px;"><span style="font-size:16px;">- Hiển thị mực nước: Có</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px;"><span style="font-size:16px;">- Khe chứa dây điện: Có</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px;"><span style="font-size:16px;">- Bộ lọc: Có</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0p