al-align: top; border: 1px solid rgb(221, 221, 221);"><span style="font-size:16px;">Điện áp</span></td>\r\n			<td class="last" style="box-sizing: border-box; padding: 8px; line-height: 1.42857; vertical-align: top; border: 1px solid rgb(221, 221, 221);"><span style="font-size:16px;">220-240V/50-60Hz</span></td>\r\n		</tr>\r\n		<tr class="odd" style="box-sizing: border-box;">\r\n			<td style="box-sizing: border-box; padding: 8px; line-height: 1.42857; vertical-align: top; border: 1px solid rgb(221, 221, 221);"><span style="font-size:16px;">Thời hạn bảo hành</span></td>\r\n			<td class="last" style="box-sizing: border-box; padding: 8px; line-height: 1.42857; vertical-align: top; border: 1px solid rgb(221, 221, 221);"><span style="font-size:16px;">24 tháng chính hãng</span></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', '', '', '', '', '', '', 6, 1, 1458098978, 1464254021, 0);
