ne-height: 1.42857; vertical-align: top; border: 1px solid rgb(221, 221, 221);"><span style="font-size:16px;">Trọng lượng vận chuyển (gram)</span></td>\r\n			<td class="last" style="box-sizing: border-box; padding: 8px; line-height: 1.42857; vertical-align: top; border: 1px solid rgb(221, 221, 221);"><span style="font-size:16px;">1000</span></td>\r\n		</tr>\r\n		<tr class="odd" style="box-sizing: border-box;">\r\n			<td style="box-sizing: border-box; padding: 8px; line-height: 1.42857; vertical-align: top; border: 1px solid rgb(221, 221, 221);"><span style="font-size:16px;">Kích thước</span></td>\r\n			<td class="last" style="box-sizing: border-box; padding: 8px; line-height: 1.42857; vertical-align: top; border: 1px solid rgb(221, 221, 221);"><span style="font-size:16px;">Đang cập nhật</span></td>\r\n		</tr>\r\n		<tr class="even" style="box-sizing: border-box; background-color: rgb(249, 249, 249);">\r\n			<td style="box-sizing: border-box; padding: 8px; line-height: 1.42857; vertical-align: top; border: 1px solid rgb(221, 221, 221);"><span style="font-size:16px;">Công suất (W)</span></td>\r\n			<td class="last" style="box-sizing: border-box; padding: 8px; line-height: 1.42857; vertical-align: top; border: 1px solid rgb(221, 221, 221);"><span style="font-size:16px;">1800</span></td>\r\n		</tr>\r\n		<tr class="odd" style="box-sizing: border-box;">\r\n			<td style="box-sizing: border-box; padding: 8px; line-height: 1.42857; vertical-align: top; border: 1px solid rgb(221, 221, 221);"><span style="font-size:16px;">Chất liệu</span></td>\r\n			<td class="last" style="box-sizing: border-box; padding: 8px; line-height: 1.42857; vertical-align: top; border: 1px solid rgb(221, 221, 221);"><span style="font-size:16px;">Nhựa</span></td>\r\n		</tr>\r\n		<tr class="even" style="box-sizing: border-box; background-color: rgb(249, 249, 249);">\r\n			<td style="box-sizing: border-box; padding: 8px; line-height: 1.42857; vertical-align: top; border: 1px solid rgb(221, 221, 221);"><span style="font-size:16px;">Dung tích</span></td>\r\n			<td class="last" style="box-sizing: border-box; padding: 8px; line-height: 1.42857; vertical-align: top; border: 1px solid rgb(221, 221, 221);"><span style="font-size:16px;">1700</span></td>\r\n		</tr>\r\n		<tr class="odd" style="box-sizing: border-box;">\r\n			<td style="box-sizing: border-box; padding: 8px; line-height: 1.42857; vertical-align: top; border: 1px solid rgb(221, 221, 221);"><span style="font-size:16px;">Thời hạn bảo hành</span></td>\r\n			<td class="last" style="box-sizing: border-box; padding: 8px; line-height: 1.42857; vertical-align: top; border: 1px solid rgb(221, 221, 221);"><span style="font-size:16px;">24 tháng</span></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p> </p>\r\n', '', '', '', '', '', '', 5, 1, 1458099725, 1464253706, 0),
