span style="box-sizing: border-box;"><span style="box-sizing: border-box;">- <span style="box-sizing: border-box;">Thiết kế thân bình 2 lớp, gồm lớp ngoài là nhựa chống bỏng có hoa văn lạ mắt, đẹp và sang trọng, bên trong là inox không gỉ, an toàn cho sức khỏe.</span></span></span></span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; text-align: justify;"><span style="box-sizing: border-box;">- <span style="box-sizing: border-box;">Mâm nhiệt phẳng, rộng bằng thép không gỉ, nấu nước nhanh hơn mà lại dễ dàng vệ sinh.</span></span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; text-align: justify;"><span style="box-sizing: border-box;">- <span style="box-sizing: border-box;">Đế tiếp điện xoay 360 độ, thiết kế tháo rời tiện sử dụng, dây điện có thể thu gọn dưới chân đế để bảo quản khi không sử dụng.</span></span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; text-align: justify;"><span style="box-sizing: border-box;">- <span style="box-sizing: border-box;">Chế độ tự động ngắt điện khi nước sôi và khi cạn nước mang lại sự an tâm cho người dùng. Bình có đèn báo khi hoạt động và tự tắt khi nước sôi.</span></span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; text-align: justify;"><span style="box-sizing: border-box;"><span style="box-sizing: border-box;"><span style="box-sizing: border-box;">- T<span style="box-sizing: border-box;">hiết kế tiện dụng, tay cầm cách nhiệt tiện di chuyển, miệng bình và miệng vòi lớn, dễ dàng châm nước ở miệng bình đun và ngay cả ở miệng vòi.</span></span></span></span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; text-align: justify;"><span style="box-sizing: border-box; color: rgb(0, 0, 0);"><span style="box-sizing: border-box; font-weight: 700;">Thông số kỹ thuật:</span></span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; text-align: justify;"><span style="box-sizing: border-box;">- Công suất: 2200W</span></p>\r\n\r