(222, 41, 20, 26, 0, '', 0, 0, '', '', 'product', 0, 0, 'bu-bluestone-sib3815b-2154.jpg', 'bu-bluestone-sib3815b-2154_195x195.jpg', 'Bàn ủi du lịch hơi nước BlueStone SIB3815B', '', 'ban-ui-du-lich-hoi-nuoc-bluestone-sib3815b', '', '', '1000', 'USA', 0, 0, '24 tháng', '', 'Bàn ủi du lịch hơi nước BlueStone SIB3815B', 'bàn ủi du lich, bàn ủi hơi nước, bluestone sib3815b, bàn ủi bluestone, bàn ủi, bàn ủi khô, bàn ủi hơi nước', '• Thiết kế thô nhỏ gọn và cho phép xếp gọn chuyên biệt cho người đi du lịch\r\nmang theo\r\n• Mặt đế cao cấp bằng Ceramic giúp bàn ủi chống dính, lướt êm\r\n• Sử dụng được cả hai nguồn điện 110V và 220V', 0, 0, 499000, 0, '• Thiết kế thô nhỏ gọn và cho phép xếp gọn chuyên biệt cho người đi du lịch\r\nmang theo\r\n• Mặt đế cao cấp bằng Ceramic giúp bàn ủi chống dính, lướt êm\r\n• Sử dụng được cả hai nguồn điện 110V và 220V', '<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="box-sizing: border-box; font-size: medium;"><span style="box-sizing: border-box; font-weight: 700;"><a href="http://mych.vn/do-dien-gia-dung/ban-ui-may-say-toc" style="box-sizing: border-box; color: rgb(51, 122, 183); text-decoration: none; background-color: transparent;"><span style="color:#8B4513;">Bàn Ủi Hơi Nước</span></a></span></span><span style="box-sizing: border-box; font-size: medium;"><span style="box-sizing: border-box; font-weight: 700;"><a href="http://giadungmychau.com/thuong-hieu-bluestone-usa/ban-ui-may-say-toc" style="box-sizing: border-box; color: rgb(51, 122, 183); text-decoration: none; background-color: transparent;"><span style="color:#0000CD;"> </span></a></span></span><strong><span style="box-sizing: border-box; font-size: medium;"><span style="box-sizing: border-box; font-weight: 700;"><a href="http://giadungmychau.com/thuong-hieu-bluestone-usa/ban-ui-may-say-toc" style="box-sizing: border-box; color: rgb(51, 122, 183); text-decoration: none; background-color: transparent;"><span style="color:#0000CD;">BLUESTONE</span></a><span style="color:#0000CD;"> SIB-3815B</span></span></span></strong></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><a href="http://giadungmychau.com/thuong-hieu-bluestone-usa/ban-ui-may-say-toc" style="box-sizing: border-box; color: rgb(51, 122, 183); text-decoration: none; background-color: transparent;">Bàn Ủi Hơi Nước</a> BLUESTONE SIB-3815B với nhiều tính năng vượt trội hơn <a href="http://giadungmychau.com/thuong-hieu-bluestone-usa/ban-ui-may-say-toc" style="box-sizing: border-box; color: rgb(51, 122, 183); text-decoration: none; background-color: transparent;">bàn ủi</a> thông thường sẽ giúp bạn tiết kiệm thời gian và cho bạn những bộ trang phục gọn gàng theo nếp.</p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="color:#0000CD;"><span style="font-size:16px;"><span style="box-sizing: border-box;"><span style="box-sizing: border-box; font-weight: 700;">Tính năng nổi bật</span></span></span></span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="font-size:16px;">- Mặt đế cao cấp bằng Ceramic giúp bàn ủi hơi nước lướt êm hơn.</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="font-size:16px;">- Tiện lợi với tùy chọn 1 trong 2 điện thế 100V hoặc 220V giúp sử dụng được tất cả các nước trên thế giới.</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="font-size:16px;">- Dễ dàng mang theo và cất giữ với tay cầm có thể gấp lại được.</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="font-size:16px;">- Thiết kế thô nhỏ gọn và cho phép xếp gọn chuyên biệt cho người đi du lịch mang theo.</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><img alt="mych.vn bàn ủi hơi nước du lịch bluestone-3815b" height="400" src="http://mych.vn/vubaohuy/upload/images/MAY%20SAY%20TOC%2C%20BAN%20UI/BU%20BLUESTONE%20SIB3815B.jpg" width="400" /></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="font-size:16px;"><span style="color:#0000CD;"><span style="box-sizing: border-box;"><span style="box-sizing: border-box; font-weight: 700;">Thông số kĩ thuật</span></span></span></span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="font-size:16px;">- Hiệu điện thế: 115V - 230V/50Hz.</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="font-size:16px;">- Công suất: 1000W.</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="font-size:16px;">- Thể tích: 50ml.</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="font-size:16px;"><span style="color:#0000CD;"><span style="box-sizing: border-box;"><span style="box-sizing: border-box; font-weight: 700;">Mẹo sử dụng bản ủi hơi nước an toàn</span></span></span></span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="font-size:16px;">- Nên sử dụng nước sạch cho lần sử dụng đầu tiên sử dụng máy bàn ủi hơi nước</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="font-size:16px;">- Không cho chất phụ gia, hương thơm, chất tẩy vào khoang chứa nước</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="font-size:16px;">- Luôn kiểm tra kí hiệu hướng dẫn ủi đồ ghi trên nhãn quần áo để xem loại vải có nằm trong danh mục được ủi không</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="font-size:16px;">- Để tăng tuổi thọ bàn ủi hơi nước, sau 1 vài ngày sử dụng, bạn nên đổ đầy nước vào bình chứa nước theo mức chỉ dẫn “Max” và vặn nút điều chỉnh hơi nước ở vị trí “0”. Sau đó nhận nút”self- cleaning”-“tự lau chùi”, bàn ủi hơi nước sẽ tự lau chùi những vết bẩn trong bình chứa. Sau đó đổ hết nước ra ngoài</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="font-size:16px;">- Đối với mặt đế bàn ủi nên lau chùi bằng vải ẩm và chất tẩy rửa (dạng lỏng) không ăn mòn</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="font-size:16px;">- Để giữ mặt đế bàn ủi nhẵn và trơ, bạn nên tránh va chạm mạnh với vật thể bằng kim loại.</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="font-size:16px;">- Bảo quản bàn ủi bằng cách dựng đứng phần chân đế của bàn ủi.</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="font-size:16px;">- Thường xuyên kiểm tra dây điện còn trong điều kiện tốt và an toàn không</span></p>\r\n', '', '', '', '', '', '', 1, 1, 1458546779, 1464319382, 0),
(223, 41, 20, 26, 0, '', 0, 0, '', '', 'product', 0, 0, 'bu-bluestone-sib3871-b-5615.jpg', 'bu-bluestone-sib3871-b-5615_195x195.jpg', 'Bàn ủi hơi nước BlueStone SIB3871', 'SIB3871', 'ban-ui-hoi-nuoc-bluestone-sib3871', '', '', '2200', 'USA', 300, 0, '24 tháng', '', 'Bàn ủi hơi nước BlueStone SIB3871', 'bàn ủi bluestone sib3871, bàn ủi bluestone, bàn ủi, bàn ủi khô, bàn ủi hơi nước', '• Chức năng ion giúp bảo vệ vải, giảm tĩnh điện\r\n• Mặt đế cao cấp bằng Ceramic độ cứng 8H giúp chống ăn mòn, siêu bền &\r\nlướt êm hơn\r\n• Bàn ủi bền hơn với chức năng chống vôi hóa, tự làm sạch, chống nhỏ giọt\r\n• An toàn với chức năng tự ngắt điện', 0, 0, 799000, 0, '• Chức năng ion giúp bảo vệ vải, giảm tĩnh điện\r\n• Mặt đế cao cấp bằng Ceramic độ cứng 8H giúp chống ăn mòn, siêu bền &\r\nlướt êm hơn\r\n• Bàn ủi bền hơn với chức năng chống vôi hóa, tự làm sạch, chống nhỏ giọt\r\n• An toàn với chức năng tự ngắt điện', '<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; line-height: normal;"><span style="font-size:20px;"><strong><span style="color:#8B4513;">Bàn ủi hơi nước</span><span style="color:#0000CD;"> BlueStone SIB3871</span></strong></span> : <span style="font-size:16px;"><span style="color: rgb(0, 0, 0);">V</span>ới công suất hoạt động lên đến 2200W cùng hệ thống hơi nước tương cường 80g/ phút sẽ cũng cấp cho bạn lượng hơi nước hoàn hảo để loại bỏ mọi nếp nhăn. Là dòng <a href="http://giadungmychau.com/thuong-hieu-bluestone-usa/ban-ui-may-say-toc" style="box-sizing: border-box; color: rgb(51, 122, 183); text-decoration: none; background-color: transparent;">bàn ủi</a> chống dính siêu trượt với mặt đế cao cấp bằng Ceramic độ cứng 8H giúp chống ăn mòn, siêu bền và lướt êm hơn, Bàn Ủi Hơi Nước BLUESTONE SIB-3871 chắc chắn sẽ là lựa chọn đáng tin cậy để chị em nội trợ chăm sóc quần áo cho cả gia đình.</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><img alt="mych.vn bàn ủi hơi nước bluestone sib-3871" height="400" src="http://mych.vn/vubaohuy/upload/images/MAY%20SAY%20TOC%2C%20BAN%20UI/BU%20BLUESTONE%20SIB3871%20b.jpg" width="400" /></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="font-size:16px;">- Chức năng ion giúp bảo vệ vải, giảm tĩnh điện</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="font-size:16px;">- Mặt đế cao cấp bằng Ceramic độ cứng 8H giúp chống ăn mòn, siêu bền & lướt êm hơn</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="font-size:16px;">- Bàn ủi bền hơn với chức năng chống vôi hóa, tự làm sạch, chống nhỏ giọt</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="font-size:16px;">- An toàn với chức năng tự ngắt điện</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="font-size:16px;">- Chức năng ủi hơi nước bảo vệ bề mặt vải không bị mòn.</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="font-size:16px;">- Khởi động nhanh, và công suất 2200 W mạnh mẽ, giúp ủi thẳng quần áo nhanh chóng.</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="font-size:16px;">- Hơi nước có thể điều chỉnh mức độ.</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="font-size:16px;">- Chức năng phun sương, cho phép bạn bổ sung thêm nước lên quần áo khi cần.</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="font-size:16px;">- Lỗ nạp nước rộng, bạn dễ dàng châm nước vào khoang chứa nước.</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="font-size:16px;">- Tay cầm chắc chắn và được thiết kế chống trượt, nên mang lại cảm giác thoải mái cho người sử dụng.</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"> </p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="color:#0000CD;"><span style="font-size:16px;"><span style="box-sizing: border-box; font-weight: 700;">Thông số kỹ thuật</span></span></span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="font-size:16px;">- Thương hiệu: BLUESTONE</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="font-size:16px;">- Model: SIB-3871</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="font-size:16px;">- Hiệu điện thế:  220-240V/50Hz</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="font-size:16px;">- Công suất:  2200W</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="font-size:16px;">- Chất liệu mặt đế: Ceramic</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="font-size:16px;">- Dung tích bình chứa: 300ml</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="font-size:16px;">- Phun hơi tăng cường: Có</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="font-size:16px;">- Phun sương:  0,7g/ lần</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="font-size:16px;">- Phun hơi: 30g/min</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="font-size:16px;">- Hơi tăng cường: 80g/min</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="font-size:16px;">- Tự động ngắt điện: Có</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="font-size:16px;">- Chống vôi hóa: Có</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="font-size:16px;">- Tự làm sạch: Có</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="font-size:16px;">- Chức năng ion: Có</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="font-size:16px;">- Khối lượng sản phẩm:   1.54 Kg</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="font-size:16px;"><span style="box-sizing: border-box; font-weight: 700;"><em style="box-sizing: border-box;">* Lưu ý: Không cho trẻ em đến gần bàn ủi khi đang ủi quần áo, hoặc sau khi vừa sử dụng xong.</em></span></span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="font-size:16px;"><span style="box-sizing: border-box; font-weight: 700;">Mô tả tính năng</span></span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="color:#0000CD;"><span style="font-size:16px;"><span style="box-sizing: border-box; font-weight: 700;">Chức năng ion giúp bảo vệ vải và giảm tĩnh điện</span></span></span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="font-size:16px;">Bàn Ủi Hơi Nước BLUESTONE SIB-3871 được trang bị chức năng ion hiện đại có thể sử dụng cả khi ủi khô và ủi nước. Khi hoạt động, các ion sẽ được phòng ra từ các lỗ có sẵn trên mặt đế, len lỏi vào các nếp nhăn khó ủi giúp ủi thẳng  những bất kỳ nếp nhăn cứng đầu nào.</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="color:#0000CD;"><span style="font-size:16px;"><span style="box-sizing: border-box; font-weight: 700;">Mặt đế bằng Caremic cao cấp</span></span></span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="font-size:16px;">Bàn ủi có mặt đến được làm bằng Ceramic cao cấp độ cứng 8H giúp chống ăn mòn, siêu bền và lướt êm hơn trên mọi bề mặt vải.</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="color:#0000CD;"><span style="font-size:16px;"><span style="box-sizing: border-box; font-weight: 700;">Hệ thống chống vôi hóa và tự động làm sạch</span></span></span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="font-size:16px;">Bộ lọc đặc biệt bên trong khoang chứa nước làm mềm các cặn rắn trong nước và ngăn cản gỉ đóng ở tấm kim loại. Hệ thống tự làm sạch sẽ giúp lấy đi những cặn rắn bám trong khoang chứa nước và hệ thống dẫn nước hóa hơi, giúp tăng độ bền của bàn ủi.</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="color:#0000CD;"><span style="font-size:16px;"><span style="box-sizing: border-box; font-weight: 700;">Ngắt điện tự động</span></span></span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="font-size:16px;">Bàn ủi sẽ tự động ngắt điện nếu không được sử dụng trong một lúc (30 giây ở vị trí nằm ngang, 8 phút ở vị trí thẳng đứng). Khi màn hình LCD hiển thị PAUSE và có tiếng bíp, bàn ủi sẽ tự động ngắt điện.</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="color:#0000CD;"><span style="font-size:16px;"><span style="box-sizing: border-box; font-weight: 700;">Chức năng chống nhỏ giọt</span></span></span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="font-size:16px;">Khi nhiệt độ của bàn ủi xuống thấp, chức năng chống nhỏ giọt sẽ được kích hoạt, bàn ủi sẽ tự động ngừng việc tạo hơi nước giúp ngăn chặn những giọt nước rớt xuống từ bề mặt.</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="color:#0000CD;"><span style="font-size:16px;"><span style="box-sizing: border-box; font-weight: 700;">Chức năng phun sương</span></span></span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="font-size:16px;">Tính năng phun sương sử dụng bằng nút nhấn, cho phép bạn cung cấp thêm độ ẩm trực tiếp cho quần áo khi cần.</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="color:#0000CD;"><span style="font-size:16px;"><span style="box-sizing: border-box; font-weight: 700;">Thiết kế tiện dụng</span></span></span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="font-size:16px;">- Lỗ nạp nước rộng, bạn dễ dàng châm nước vào khoang chứa nước.</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="font-size:16px;">-  Đế viền cong, cùng thiết kế bàn ủi xẻ rãnh và mũi nhọn, giúp ủi các vị trí khó như hàng nút, xếp li một cách dễ dàng.</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="font-size:16px;">- Tay cầm chắc chắn và được thiết kế chống trượt, nên mang lại cảm giác thoải mái cho người sử dụng.</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="font-size:16px;">- Bàn ủi dễ dàng sử dụng, chỉ cần nối thiết bị với nguồn điện, sau đó tùy chỉnh mức nhiệt độ phù hợp là có thể sử dụng.</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="font-size:16px;">- Kiểu dáng nhỏ gọn, trọng lượng bàn ủi nhẹ, dễ sử dụng.</span></p>\r\n', '', '', '', '', '', '', 1, 1, 1458547074, 1464319259, 0),
(224, 41, 20, 26, 0, '', 0, 0, '', '', 'product', 0, 0, 'bu-bluestone-sib3888g-765.jpg', 'bu-bluestone-sib3888g-765_195x195.jpg', 'Bàn ủi hơi nước BlueStone SIB3888G', 'SIB3888G', 'ban-ui-hoi-nuoc-bluestone-sib3888g', '', '', '2400', 'USA', 350, 0, '24 tháng', '', 'Bàn ủi hơi nước BlueStone SIB3888G', 'bàn ủi bluestone sib3888G, bàn ủi bluestone, bàn ủi, bàn ủi khô, bàn ủi hơi nước', '• Màn hình LCD thể hiện loại vải phù hợp với mức nhiệt điều chỉnh\r\n• Mặt đế cao cấp bằng Ceramic độ cứng 8H giúp chống ăn mòn, siêu bền &\r\nlướt êm hơn\r\n• Hàm lượng hơi nước phun lớn, liên tục: 30g/phút.\r\n• Chức năng ngắt điện khi nằm ngang 3s và khi đứng là 8p', 0, 0, 123900, 0, '• Màn hình LCD thể hiện loại vải phù hợp với mức nhiệt điều chỉnh\r\n• Mặt đế cao cấp bằng Ceramic độ cứng 8H giúp chống ăn mòn, siêu bền &\r\nlướt êm hơn\r\n• Hàm lượng hơi nước phun lớn, liên tục: 30g/phút.\r\n• Chức năng ngắt điện khi nằm ngang 3s và khi đứng là 8p', '<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="font-size:20px;"><strong><span style="color:#8B4513;">Bàn ủi hơi nước</span><span style="color:#0000CD;"> BlueStone SIB3888G</span></strong></span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><a href="http://giadungmychau.com/index.php?com=tim-kiem&amp;keywords=ban+ui" style="box-sizing: border-box; color: rgb(51, 122, 183); text-decoration: none; background-color: transparent;"><span style="color:#8B4513;">Bàn Ủi Hơi Nước</span></a> BLUESTONE SIB-3888G với thiết kế hiện đại, tích hợp nhiều tính năng vượt trội sẽ cho bạn những bộ trang phục gọn gàng theo nếp.</p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="color:#0000CD;"><span style="box-sizing: border-box;"><span style="box-sizing: border-box; font-weight: 700;">Tính năng nổi bật</span></span></span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="font-size:16px;">- Màng hình LCD thể hiện loại vải phù hợp với mức nhiệt điều chỉnh.</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="font-size:16px;">- Mặt đế cao cấp bằng Ceramic giúp <a href="http://tiki.vn/ban-ui-ban-la/c1993" style="box-sizing: border-box; color: rgb(51, 122, 183); text-decoration: none; background-color: transparent;">bàn ủi</a> lướt êm hơn.</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="font-size:16px;">- Hàm lượng gơi nước phun liên tục: 35g/phút.</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="font-size:16px;">- An toàn với chức năng tự ngắt điện khi ngưng sử dụng.</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="font-size:16px;">- Chức năng tự động làm sạch và chống vôi hóa giúp tăng độ bền cho bàn ủi.</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="font-size:16px;">- Tiện lợi với chức năng chống nhỏ giọt.</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="font-size:16px;">- Chức năng ủi hơi bảo vệ bề mặt vải không bị mòn.</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><img alt="mych.vn bàn ủi bluestone sib-3888g" height="400" src="http://mych.vn/vubaohuy/upload/images/MAY%20SAY%20TOC%2C%20BAN%20UI/BU%20BLUESTONE%20SIB3888G%20c.jpg" width="400" /></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="color:#0000CD;"><span style="font-size:16px;"><span style="box-sizing: border-box;"><span style="box-sizing: border-box; font-weight: 700;">Thông số kĩ thuật</span></span></span></span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="font-size:16px;">- Hiệu điện thế: 220V - 240V/50Hz.</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="font-size:16px;">- Thể tích: 350ml</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="color:#0000CD;"><span style="font-size:16px;"><span style="box-sizing: border-box;"><span style="box-sizing: border-box; font-weight: 700;">Hướng dẫn sử dụng an toàn</span></span></span></span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="font-size:16px;">- Nên sử dụng nước sạch cho lần sử dụng đầu tiên sử dụng máy bàn ủi hơi nước</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="font-size:16px;">- Không cho chất phụ gia, hương thơm, chất tẩy vào khoang chứa nước</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="font-size:16px;">- Luôn kiểm tra kí hiệu hướng dẫn ủi đồ ghi trên nhãn quần áo để xem loại vải có nằm trong danh mục được ủi không</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="font-size:16px;">- Để tăng tuổi thọ sau 1 vài ngày sử dụng, bạn nên đổ đầy nước vào bình chứa nước theo mức chỉ dẫn <span style="color:#8B4513;"><span style="box-sizing: border-box; font-weight: 700;">“Max”</span></span> và vặn nút điều chỉnh hơi nước ở vị trí<span style="box-sizing: border-box; font-weight: 700;"> “0”</span>. Sau đó nhận nút<span style="color:#8B4513;"><span style="box-sizing: border-box; font-weight: 700;">”self- cleaning”</span>-<span style="box-sizing: border-box; font-weight: 700;">“tự lau chùi”</span></span>, bàn ủi hơi nước sẽ tự lau chùi những vết bẩn trong bình chứa. Sau đó đổ hết nước ra ngoài</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="font-size:16px;"><span style="box-sizing: border-box; color: rgb(0, 0, 0);">- Đối với mặt đế bàn ủi nên lau chùi bằng vải ẩm và chất tẩy rửa (dạng lỏng) kh</span>ông ăn mòn</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="font-size:16px;">- Để giữ mặt đế bàn ủi nhẵn và trơ, bạn nên tránh va chạm mạnh với vật thể bằng kim loại.</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="font-size:16px;">- Bảo quản bàn ủi bằng cách dựng đứng phần chân đế của bàn ủi.</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="font-size:16px;">- Thường xuyên kiểm tra dây điện còn trong điều kiện tốt và an toàn không.</span></p>\r\n', '', '', '', '', '', '', 1, 1, 1458548181, 1464318791, 0);
