(225, 41, 20, 26, 0, '', 0, 0, '', '', 'product', 0, 0, 'mst-bluestone-hdb1858b-3288.jpg', 'mst-bluestone-hdb1858b-3288_195x195.jpg', 'Máy sấy tóc BlueStone HDB1858B', 'HDB1858B', 'may-say-toc-bluestone-hdb1858b', '', '', '1400', 'USA', 0, 750, '24 tháng', '', 'Máy sấy tóc BlueStone HDB1858B', 'máy sấy tóc bluestone hdb1858b, máy sấy tóc, máy ép tóc, tông đơ điện, máy cạo râu, máy đo huyết áp, máy mát xa, máy phun sương dưỡng da, máy uốn tóc', '• Công suất mạnh. Độ ồn rất nhỏ nhờ thiết kế lọc gió dạng lưới tổ ong\r\n• Thiết kế xếp gọn tay cầm để tiện xếp vào hành lý\r\n• Máy có nút điều chỉnh 2 tốc độ sấy & Chế độ sấy mát cho phép người\r\ndùng tiết kiệm thời gian sấy khi cần', 0, 0, 469000, 0, '• Công suất mạnh. Độ ồn rất nhỏ nhờ thiết kế lọc gió dạng lưới tổ ong\r\n• Thiết kế xếp gọn tay cầm để tiện xếp vào hành lý\r\n• Máy có nút điều chỉnh 2 tốc độ sấy & Chế độ sấy mát cho phép người\r\ndùng tiết kiệm thời gian sấy khi cần', '<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><strong><span style="font-size:20px;"><span style="color:#8B4513;">Máy sấy tóc</span><span style="color:#0000CD;"> BlueStone HDB1858B</span></span></strong></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;">Máy Sấy Tóc BLUESTONE HDB-1858B - một dụng cụ làm đẹp cho tóc với nhiều tính năng hiện đại.</p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="color:#8B4513;"><span style="font-size:16px;"><span style="box-sizing: border-box;"><span style="box-sizing: border-box; font-weight: 700;">Tính năng nổi bật</span></span></span></span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="font-size:16px;">- Cân bằng nhiệt giúp sấy khô tóc nhẹ nhàng</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="font-size:16px;">- Tay cầm gập được tiện lợi khi đi du lịch và cất giữ.</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="font-size:16px;">- Chức năng sấy mát giúp tóc mền mại</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="font-size:16px;">- Có thể điều chỉnh nhiệt độ linh hoạt  khi sấy.</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="color:#8B4513;"><span style="font-size:16px;"><span style="box-sizing: border-box;"><span style="box-sizing: border-box; font-weight: 700;">Thông số kĩ thuật</span></span></span></span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="font-size:16px;">- Hiệu điện thế: 230V/50Hz.</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="font-size:16px;">- Công suất: 1400W.</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="color:#8B4513;"><span style="font-size:16px;"><span style="box-sizing: border-box;"><span style="box-sizing: border-box; font-weight: 700;">Hướng dẫn sử dụng an toàn</span></span></span></span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="font-size:16px;">- Không sử dụng máy khi tay ướt</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="font-size:16px;">- Khi đang sử dụng máy, không quấn khăn, áo… vào nắp thông gió, đảm bảo không khí vào và ra được thông suốt khi dùng</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="font-size:16px;">- Cần thường xuyên lau bụi và tóc dính trên máy bằng chổi hoặc cọ</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="font-size:16px;">- Khi sử dụng máy sấy tóc trong nhà tắm, rút điện ra sau khi sử dụng vì khi máy ở gần nước, sẽ gây nguy hiểm ngay đã khi đã tắt máy.</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><img alt="mych.vn máy sấy tóc bluestone hdb-1858b" height="400" src="http://mych.vn/vubaohuy/upload/images/MAY%20SAY%20TOC%2C%20BAN%20UI/MST%20BLUESTONE%20HDB1858B%20b.jpg" width="400" /></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"> </p>\r\n', '', '', '', '', '', '', 1, 1, 1458556599, 1464318585, 0),
(226, 41, 20, 26, 0, '', 0, 0, '', '', 'product', 0, 0, 'mst-bluestone-hdb1866-4007.jpg', 'mst-bluestone-hdb1866-4007_195x195.jpg', 'Máy sấy tóc BLUESTONE HDB1866', 'HDB1866', 'may-say-toc-bluestone-hdb1866', '', '', '2000', 'USA', 0, 900, '24 tháng', '', 'Máy sấy tóc BlueStone HDB1866', 'máy sấy tóc bluestone hdb1866, máy sấy tóc, máy ép tóc, tông đơ điện, máy cạo râu, máy đo huyết áp, máy mát xa, máy phun sương dưỡng da, máy uốn tóc', '• Công suất mạnh 2000W,3 tốc độ nhiệt và 2 chế độ thổi gió giúp linh hoạt\r\ntrong việc sấy tóc và tạo kiểu tóc đẹp\r\n• Chức năng ion không gây tích điện giúp bảo vệ tóc\r\n• Đầu sấy phụ và lược giúp dễ dàng tạo kiểu cho tóc', 0, 0, 769000, 0, '• Công suất mạnh 2000W,3 tốc độ nhiệt và 2 chế độ thổi gió giúp linh hoạt\r\ntrong việc sấy tóc và tạo kiểu tóc đẹp\r\n• Chức năng ion không gây tích điện giúp bảo vệ tóc\r\n• Đầu sấy phụ và lược giúp dễ dàng tạo kiểu cho tóc', '<div class="prd_dt_info_title" style="color: rgb(64, 64, 64); font-family: Arial, sans-serif; line-height: normal; border: 0px; margin: 0px 0px 20px; padding: 0px;"><span style="font-size:20px;"><strong><span class="prd_dt_zone_title" style="border: 0px; margin: 0px 0px 3px; padding: 0px;"><a href="http://mych.vn/do-dien-gia-dung/ban-ui-may-say-toc"><span style="color:#8B4513;">Máy sấy tóc</span></a></span></strong><span class="prd_dt_zone_title" style="border: 0px; margin: 0px 0px 3px; padding: 0px; color: rgb(51, 51, 51);"> </span><span style="color:#0000CD;"><strong><span class="prd_dt_zone_title" style="border: 0px; margin: 0px 0px 3px; padding: 0px;">BLUESTONE </span><span style="line-height: 1.3;">HDB-1866</span></strong></span></span></div>\r\n\r\n<div style="color: rgb(64, 64, 64); font-family: Arial, sans-serif; line-height: normal; border: 0px; margin: 0px; padding: 0px;"><span style="font-size:16px;">Công nghệ ion, màn hình điều khiển LCD, chức năng cân bằng nhiệt, sấy mát, đa cấp độ nhiệt và gió, xếp gọn tay cầm, cấu trúc thông gió tổ ong giảm ồn là 7 trong nhiều tính năng ưu việt của máy sấy tóc BlueStone.<br />\r\n<br />\r\nNhờ những tính năng và công nghệ ưu việt này, máy sấy tóc BlueStone không chỉ làm tóc khô nhanh mà còn giúp bảo vệ mái tóc luôn mượt mà.<br />\r\n<br />\r\nPhun ion trong quá trình sấy là giải pháp đưa ion âm vào bên trong sợi tóc. Được tích điện âm, sợi tóc sẽ hấp thu nước và giữ lại độ ẩm cần thiết như được làm khô tự nhiên vì vậy tóc được nuôi dưỡng không bị gãy rụng, óng mượt và mềm mại như được chăm sóc ở salon.</span></div>\r\n\r\n<p> </p>\r\n\r\n<div class="prd_dt_content" style="border: 0px; margin: 0px 0px 15px; padding: 0px; color: rgb(64, 64, 64); font-family: Arial, sans-serif; line-height: normal;">\r\n<div class="prd_dt_img" style="border: 0px; margin: 0px; padding: 0px; float: left; width: 750px; position: relative; text-align: center;">\r\n<div class="prd_img_sl" style="border: 0px; margin: 0px; padding: 0px;"><img alt="mych.vn máy sấy tóc BlueStone HDB1866" height="400" src="http://mych.vn/vubaohuy/upload/images/MAY%20SAY%20TOC%2C%20BAN%20UI/MST%20BLUESTONE%20HDB1866%20b.jpg" style="border:0px; margin:0px; padding:0px; font-size:0px; color:transparent; vertical-align:middle; max-width:100%; float:left" width="400" /></div>\r\n</div>\r\n</div>\r\n\r\n<div class="Specification_prd" style="border: 0px; margin: 0px 0px 20px; padding: 0px; clear: both; color: rgb(64, 64, 64); font-family: Arial, sans-serif; line-height: normal; background: rgb(228, 228, 228);">\r\n<div class="clear" style="border: 0px; margin: 0px; padding: 0px; clear: both; overflow: hidden; visibility: hidden; width: 0px; height: 0px;"> </div>\r\n</div>\r\n\r\n<p> </p>\r\n\r\n<div class="prd_dt_info_title" style="color: rgb(64, 64, 64); font-family: Arial, sans-serif; line-height: normal; border: 0px; margin: 0px 0px 20px; padding: 0px;"> </div>\r\n\r\n<ul class="nav" style="border: 0px; margin: 0px; padding-right: 0px; padding-left: 0px; list-style: none;">\r\n	<li style="border: 0px; margin: 0px; padding: 0px; f