x-sizing: border-box; font-weight: 700;">Thông số kĩ thuật</span></span></span></span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="font-size:16px;">- Hiệu điện thế: 220V - 240V/50Hz.</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="font-size:16px;">- Công suất: 2000W.</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="font-size:16px;"><span style="color:#0000CD;"><span style="box-sizing: border-box;"><span style="box-sizing: border-box; font-weight: 700;">Hướng dẫn sử dụng an toàn</span></span></span></span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="font-size:16px;">- Không sử dụng máy khi tay ướt</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="font-size:16px;">- Khi đang sử dụng máy, không quấn khăn, áo… vào nắp thông gió, đảm bảo không khí vào và ra được thông suốt khi dùng</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="font-size:16px;">- Cần thường xuyên lau bụi và tóc dính trên máy bằng chổi hoặc cọ</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="font-size:16px;">- Khi sử dụng máy sấy tóc trong nhà tắm, rút điện ra sau khi sử dụng vì khi máy ở gần nước, sẽ gây nguy hiểm ngay đã khi đã tắt máy.</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><img alt="mych.vn máy sấy tóc BlueStone HDB1888BK" height="400" src="http://mych.vn/vubaohuy/upload/images/MAY%20SAY%20TOC%2C%20BAN%20UI/MST%20BLUESTONE%20HDB1888BK%20b.jpg" width="400" /></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"> </p>\r\n', '', '', '', '', '', '', 1, 1, 1458557443, 1464318216, 0),
(229, 43, 20, 33, 0, '', 1, 10, '', '', 'product', 1, 0, 'bluestone-eob7566s-b-6798.jpg', 'bluestone-eob7566s-b-6798_195x195.jpg', 'Lò nướng BlueStone EOB7566S', 'EOB7566S', 'lo-nuong-bluestone-eob7566s', '', '', '1500', '', 28000, 0, '24 tháng', '', 'Lò nướng BlueStone EOB7566S', 'lò nướng, lò nướng bluestone eob7566S, bếp nướng, bếp nướng bluestone eob7566S, lò nướng giá rẻ, bếp nướng giá rẻ', 'lò nướng, lò nướng bluestone eob7566S, bếp nướng, bếp nướng bluestone eob7566S, lò nướng giá rẻ, bếp nướng giá rẻ', 0, 0, 2279000, 0, '• Chức năng nướng xiên quay và quạt đối lưu giúp thức ăn chín đều và\r\nthơm ngon\r\n• Nướng được nhiều loại thực phẩm: thịt bò, gia cầm, cá, bánh, pizza, khoai\r\ntây cắt lát, bánh bông lan…\r\n• Quá trình nướng hoàn toàn tự động, tiết kiệm được thời gian', '<div class="prd_dt_content" style="border: 0px; margin: 0px 0px 15px; padding: 0px; color: rgb(64, 64, 64); font-family: Arial, sans-serif; line-height: normal;">\r\n<div class="prd_dt_img" style="border: 0px; margin: 0px; padding: 0px; float: left; width: 750px; position: relative; text-align: center;">\r\n<div class="prd_img_sl" style="border: 0px; margin: 0px; padding: 0px; text-align: left;"><span style="font-size:20px;"><a href="http://mych.vn/do-dien-gia-dung/bep-nuong-lo-nuong-lo-vi-song"><span style="color:#8B4513;">Lò nướng</span></a> <strong><span style="color:#000080;">BlueStone EOB7566S</span></strong></span></div>\r\n\r\n<div class="prd_img_sl" style="border: 0px; margin: 0px; padding: 0px; text-align: left;"> </div>\r\n\r\n<div class="prd_img_sl" style="border: 0px; margin: 0px; padding: 0px; text-align: left;">- <span style="color: rgb(76, 76, 76); font-family: Arial, sans-serif; font-size: 14px; line-height: 18px; background-color: rgb(227, 227, 227);">Thức ăn nướng là món ăn khoái khẩu của nhiều người. Bạn không có nhiều cơ hội ăn món nướng ở nhà bằng phương pháp nướng than truyền thống bởi điều đó quá phiền phức nếu bạn sống trong những căn hộ hiện đại hay phải dành nhiều thời gian cho công việc.</span></div>\r\n\r\n<div class="prd_img_sl" style="border: 0px; margin: 0px; padding: 0px; text-align: left;"><span style="color: rgb(76, 76, 76); font-family: Arial, sans-serif; font-size: 14px; line-height: 18px; background-color: rgb(227, 227, 227);">- Bằng chức năng nướng xiên quay và quạt đối lưu phân bố nhiệt đều khắp buồng nướng, lò nướng BlueStone giúp món nướng chín rất đều và vàng ươm một cách tự động trong lúc bạn chuẩn bị nước chấm. Bên cạnh đó, với dung tích buồng nướng 42 lít cùng công suất 2000W, lò nướng BlueStone không chỉ cho phép nướng hầu hết các loại thịt từ bò, gà đến cá mà còn nướng được bánh Pizza, khoai tây và nhiều loại bánh khác.</span></div>\r\n\r\n<div class="prd_img_sl" style="border: 0px; margin: 0px; padding: 0px;"> </div>\r\n\r\n<div class="prd_img_sl" style="border: 0px; margin: 0px; padding: 0px;"><img alt="mych.vn lò nướng bluestone eob7566S" height="400" src="http://mych.vn/vubaohuy/upload/images/BEP%20NUONG%2C%20BEP%20GA%2C%20LO%20VI%20SONG%2C%20LO%20NUONG/BLUESTONE%20EOB7566S%20c.jpg" style="border:0px; margin:0px; padding:0px; font-size:0px; color:transparent; vertical-align:middle; max-width:100%; float:left" width="400" /></div>\r\n\r\n<div class="prd_img_sl" style="border: 0px; margin: 0px; padding: 0px;"> </div>\r\n</div>\r\n\r\n<p> </p>\r\n\r\n<p> </p>\r\n</div>\r\n\r\n<div class="Specification_prd" style="border: 0px; margin: 0px 0px 20px; padding: 0px; clear: both; color: rgb(64, 64, 64); font-family: Arial, sans-serif; line-height: normal; background: rgb(228, 228, 228);">\r\n<div class="clear" style="border: 0px; margin: 0px; padding: 0px; clear: both; overflow: hidden; visibility: hidden; width: 0px; height: 0px;"> </div>\r\n</div>\r\n\r\n<div class="tab_wrap" style="border: 0px; margin: 0px 0px 8px; padding: 0px; color: rgb(64, 64, 64); font-family: Arial, sans-serif; line-height: normal;">\r\n<div class="tab-nav" style="border-width: 0px 0px 4px; border-bottom-style: solid; border-botto