vertical-align: middle;"><span style="font-size:16px;">Sản phẩm tặng kèm</span></td>\r\n			<td style="border-width: 0px 0px 1px; border-bottom-style: solid; border-bottom-color: rgb(187, 187, 187); margin: 0px; padding: 7px 10px; vertical-align: middle;"><span style="font-size:16px;"><span style="border: 0px; margin: 0px; padding: 0px;">Nồi lấu tiện dụng (inox, nắp thuỷ tinh)</span></span></td>\r\n		</tr>\r\n		<tr style="border: 0px; margin: 0px; padding: 0px;">\r\n			<td style="border-width: 0px 0px 1px; border-bottom-style: solid; border-bottom-color: rgb(187, 187, 187); margin: 0px; padding: 7px 10px; vertical-align: middle;"><span style="font-size:16px;">Kích thước mặt bếp</span></td>\r\n			<td style="border-width: 0px 0px 1px; border-bottom-style: solid; border-bottom-color: rgb(187, 187, 187); margin: 0px; padding: 7px 10px; vertical-align: middle;"><span style="font-size:16px;"><span style="border: 0px; margin: 0px; padding: 0px;">280 x 280 mm</span></span></td>\r\n		</tr>\r\n		<tr style="border: 0px; margin: 0px; padding: 0px; background: rgb(248, 248, 248);">\r\n			<td style="border-width: 0px 0px 1px; border-bottom-style: solid; border-bottom-color: rgb(187, 187, 187); margin: 0px; padding: 7px 10px; vertical-align: middle;"><span style="font-size:16px;">Khối lượng sản phẩm</span></td>\r\n			<td style="border-width: 0px 0px 1px; border-bottom-style: solid; border-bottom-color: rgb(187, 187, 187); margin: 0px; padding: 7px 10px; vertical-align: middle;"><span style="font-size:16px;"><span style="border: 0px; margin: 0px; padding: 0px;">3.8 kg</span></span></td>\r\n		</tr>\r\n		<tr style="border: 0px; margin: 0px; padding: 0px;">\r\n			<td style="border-width: 0px 0px 1px; border-bottom-style: solid; border-bottom-color: rgb(187, 187, 187); margin: 0px; padding: 7px 10px; vertical-align: middle;"><span style="font-size:16px;">Số lượng sản phẩm/thùng</span></td>\r\n			<td style="border-width: 0px 0px 1px; border-bottom-style: solid; border-bottom-color: rgb(1