\n<p style="border: 0px; margin: 0px 0px 0.8em; padding: 0px; color: rgb(64, 64, 64); font-family: Arial, sans-serif; line-height: normal;"> </p>\r\n\r\n<ul style="border: 0px; margin: 0px 1.5em 1.5em 0px; padding-right: 0px; padding-left: 1.5em; color: rgb(64, 64, 64); font-family: Arial, sans-serif; line-height: normal;">\r\n	<li style="border: 0px; margin: 0px; padding: 0px;"><span style="font-size:16px;">Đặt nồi với thức ăn ngay giữa mặt kính bếp.</span></li>\r\n	<li style="border: 0px; margin: 0px; padding: 0px;"><span style="font-size:16px;">Cắm dây điện vào ổ cắm phù hợp để dây điện tiếp xúc tốt với ổ cắm.</span></li>\r\n	<li style="border: 0px; margin: 0px; padding: 0px;"><span style="font-size:16px;">Lau sạch thành và đáy nồi trước khi đặt lên bếp.</span></li>\r\n	<li style="border: 0px; margin: 0px; padding: 0px;"><span style="font-size:16px;">Không đặt nồi rỗng lên bếp để tránh hư hỏng nồi hoặc gây cháy.</span></li>\r\n</ul>\r\n\r\n<p style="border: 0px; margin: 0px 0px 0.8em; padding: 0px; color: rgb(64, 64, 64); font-family: Arial, sans-serif; line-height: normal;"><span style="color:#8B4513;"><span style="font-size:16px;"><strong style="border: 0px; margin: 0px; padding: 0px;">2. Hướng dẫn Tắt/ Mở thiết bị</strong></span></span></p>\r\n\r\n<p style="border: 0px; margin: 0px 0px 0.8em; padding: 0px; color: rgb(64, 64, 64); font-family: Arial, sans-serif; line-height: normal;"> </p>\r\n\r\n<ul style="border: 0px; margin: 0px 1.5em 1.5em 0px; padding-right: 0px; padding-left: 1.5em; color: rgb(64, 64, 64); font-family: Arial, sans-serif; line-height: normal;">\r\n	<li style="border: 0px; margin: 0px; padding: 0px;"><span style="font-size:16px;">Đặt nồi lên giữa mặt bếp.</span></li>\r\n	<li style="border: 0px; margin: 0px; padding: 0px;"><span style="font-size:16px;">Cắm điện, máy sẽ phát ra tiếng “bíp”, máy ở trạng thái sẵn sàng.</span></li>\r\n	<li style="border: 0px; margin: 0px; padding: 0px;"><span style="font-size:16px;">Nhấn nút On/Off, chọn chức năng nấu.</span></li>\r\n	<li style="border: 0px; margin: 0px; padding: 0px;"><span style="font-size:16px;">Sau khi nấu, nhấn nút On/Off để tắt bếp, quạt giải nhiệt trong bếp vẫn tiếp tục hoạt động trong 1 phút.</span></li>\r\n	<li style="border: 0px; margin: 0px; padding: 0px;"><span style="font-size:16px;">Sau khi quạt ngừng, rút phích cắm ra khỏi ổ điện. </span></li>\r\n</ul>\r\n', '', '', '', '', '', '', 1, 1, 1459122709, 1464411449, 0),
(231, 42, 20, 32, 0, '', 0, 0, '', '', 'product', 0, 0, 'bep-tu-bluestone-icb6627-b-5969.jpg', 'bep-tu-bluestone-icb6627-b-5969_195x195.jpg', 'Bếp từ BlueStone ICB6627', 'ICB6627', 'bep-tu-bluestone-icb6627', '', '', '2100', 'USA', 0, 2700, '24 tháng', '', 'Bếp từ BlueStone ICB6627', 'bếp từ, bếp từ bluestone icb6627, bếp từ giá rẻ, bếp từ cao cấp, bếp từ ngoại nhập, bếp hồng ngoại, bếp hồng ngoại giá rẻ', 'KT mặt bếp:\r\n360 x 280 mm\r\n• Công nghệ điều khiển cảm ứng giúp vận hành dễ dàng.\r\n• An toàn với chức năng tự ngắt điện khi quá nhiệt, khóa trẻ em và thuận\r\ntiện với chức năng hẹn giờ tắt & nấu.\r\n• Mặt bếp bằng kính cao cấp loại A, chịu nhiệt cao.\r\n• Đa năng: nấu lẩu, xào dinh dưỡng, hấp, chiên xào, nấu\r\nvới công suất cao, nấu với công suất thấp.', 0, 0, 1289000, 0, 'KT mặt bếp:\r\n360 x 280 mm\r\n• Công nghệ điều khiển cảm ứng giúp vận hành dễ dàng.\r\n• An toàn với chức năng tự ngắt điện khi quá nhiệt, khóa trẻ em và thuận\r\ntiện với chức năng hẹn giờ tắt & nấu.\r\n• Mặt bếp bằng kính cao cấp loại A, chịu nhiệt cao.\r\n• Đa năng: nấu lẩu, xào dinh dưỡng, hấp, chiên xào, nấu\r\nvới công suất cao, nấu với công suất thấp.', '<p><span style="font-size:20px;"><strong><a href="http://mych.vn/do-dien-gia-dung/bep-tu-bep-hong-ngoai"><span style="color:#8B4513;">Bếp từ</span></a></strong> <span style="color:#0000CD;"><strong>BlueStone ICB6627</strong></span></span></p>\r\n\r\n<p><span style="font-size:16px;"><span style="color: rgb(76, 76, 76); font-family: Arial, sans-serif; line-height: 18px; text-align: justify;">- Nấu nhanh, tiết kiệm điện năng tiêu thụ, an toàn, sạch sẽ và siêu tiện dụng là những ưu điểm có tính cách mạng trong ngành điện gia dụng. Từ nay, tất cả quý bà nội trợ không chỉ dễ dàng mang lại bữa ăn ngon, nhanh, gọn cho cả nhà mà còn có thêm thời gian cho riêng mình.</span></span></p>\r\n\r\n<p><span style="font-size:16px;"><span style="color: rgb(76, 76, 76); font-family: Arial, sans-serif; line-height: 18px; text-align: justify;">- Khác 