; border-bottom-style: solid; border-bottom-color: rgb(187, 187, 187); margin: 0px; padding: 7px 10px; vertical-align: middle;"><span style="font-size:16px;">Số lượng sản phẩm/thùng</span></td>\r\n			<td style="border-width: 0px 0px 1px; border-bottom-style: solid; border-bottom-color: rgb(187, 187, 187); margin: 0px; padding: 7px 10px; vertical-align: middle;"><span style="font-size:16px;"><span style="border: 0px; margin: 0px; padding: 0px;">3 cái</span></span></td>\r\n		</tr>\r\n		<tr style="border: 0px; margin: 0px; padding: 0px;">\r\n			<td style="border-width: 0px 0px 1px; border-bottom-style: solid; border-bottom-color: rgb(187, 187, 187); margin: 0px; padding: 7px 10px; vertical-align: middle;"><span style="font-size:16px;">Khối lượng thùng</span></td>\r\n			<td style="border-width: 0px 0px 1px; border-bottom-style: solid; border-bottom-color: rgb(187, 187, 187); margin: 0px; padding: 7px 10px; vertical-align: middle;"><span style="font-size:16px;"><span style="border: 0px; margin: 0px; padding: 0px;">17.6kg</span></span></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p><strong><span style="color:#8B4513;">TÍNH NĂNG NỔI BẬT</span></strong></p>\r\n\r\n<p><span style="font-size:16px;">- <span style="color: rgb(64, 64, 64); font-family: Arial, sans-serif; line-height: normal;">Công nghệ điều khiển cảm ứng giúp vận hành dễ dàng.</span></span></p>\r\n\r\n<p><span style="font-size:16px;"><span style="color: rgb(64, 64, 64); font-family: Arial, sans-serif; line-height: normal;">- Công suất mạnh 2100W, tự do lựa chọn 9 mức công suất tùy theo từng loại thực phẩm.</span></span></p>\r\n\r\n<p><span style="font-size:16px;"><span style="color: rgb(64, 64, 64); font-family: Arial, sans-serif; line-height: normal;">- Mặt bếp cao cấp loại A, chịu nhiệt cao.</span></span></p>\r\n\r\n<p><span style="font-size:16px;"><span style="color: rgb(64, 64, 64); font-family: Arial, sans-serif; line-height: normal;">- Đa năng: nấu lẩu, xào dinh dưỡng, hấp, chiên xào, nấu</span><br style="color: rgb(64, 64, 64); font-family: Arial, sans-serif; line-height: normal;" />\r\n<span style="color: rgb(64, 64, 64); font-family: Arial, sans-serif; line-height: normal;">với công suất cao, nấu với công suất thấp.</span></span></p>\r\n\r\n<p><span style="font-size:16px;"><span style="color: rgb(64, 64, 64); font-family: Arial, sans-serif; line-height: normal;">- An toàn với khóa trẻ em và thuận tiện với chức năng hẹn giờ tắt và nấu, giúp cài đặt thời gian nấu chính xác.</span></span></p>\r\n\r\n<p><strong><span style="color:#0000CD;">HƯỚNG DẪN SỬ DỤNG</span></strong></p>\r\n\r\n<p style="border: 0px; margin: 0px 0px 0.8em; padding: 0px; color: rgb(64, 64, 64); font-family: Arial, sans-serif; line-height: normal;"><span style="color:#8B4513;"><span style="font-size:16px;"><strong style="border: 0px; margin: 0px; padding: 0px;">1. Chú ý trước khi sử dụng</strong></span></span></p>\r\n\r\n<ul style="border: 0px; margin: 0px 1.5em 1.5em 0px; padding-right: 0px; padding-left: 1.5em; color: rgb(64, 64, 64); font-family: Arial, sans-serif; line-height: normal;">\r\n	<li style="border: 0px; margin: 0px; padding: 0px;"><span style="font-size:16px;">Đặt nồi với thức ăn ngay giữa mặt kính bếp.</span></li>\r\n	<li style="border: 0px; margin: 0px; padding: 0px;"><span style="font-size:16px;">Cắm dây điện vào ổ cắm phù hợp để dây điện tiếp xúc tốt với ổ cắm.</span></li>\r\n</ul>\r\n\r\n<p style="border: 0px; margin: 0px 0px 0.8em; padding: 0px; color: rgb(64, 64, 64); font-family: Arial, sans-serif; line-height: normal;"><span style="color:#8B4513;"><span style="font-size:16px;"><strong style="border: 0px; margin: 0px; padding: 0px;">2. Hướng dẫn Tắt/ Mở thiết bị</strong></span></span></p>\r\n\r\n<ul style="border: 0px; margin: 0px 1.5em 1.5em 0px; padding-right: 0px; padding-left: 1.5em; color: rgb(64, 64, 64); font-family: Arial, sans-serif; line-height: normal;">\r\n	<li style="border: 0px; margin: 0px; padding: 0px;"><span style="font-size:16px;">Đặt nồi lên giữa mặt bếp.</span></li>\r\n	<li style="border: 0px; margin: 0px; padding: 0px;"><span style="font-size:16px;">Cắm điện, máy sẽ phát ra tiếng “bíp”, máy ở trạng thái sẵn sàng.</span></li>\r\n	<li style="border: 0px; margin: 0px; padding: 0px;"><span style="font-size:16px;">Nhấn nút On/Off, chọn chức năng nấu.</span></li>\r\n	<li style="border: 0px; margin: 0px; padding: 0px;"><span style="font-size:16px;">Sau khi nấu, nhấn nút On/Off để tắt bếp, quạt giải nhiệt trong bếp vẫn tiếp tục hoạt động trong 1 phút.</span></li>\r\n	<li style="border: 0px; margin: 0px; padding: 0px;"><span style="font-size:16px;">Sau khi quạt ngừng, rút phích cắm ra khỏi ổ điện. </span></li>\r\n</ul>\r\n\r\n<p> </p>\r\n', '', '', '', '', '', '', 1, 1, 1459123980, 1464410606, 0),
(232, 42, 20, 32, 0, '', 0, 0, '', '', 'product', 0, 0, 'bep-tu-bluestone-icb6655-6415.jpg', 'bep-tu-bluestone-icb6655-6415_195x195.jpg', 'Bếp từ BlueStone ICB6655', 'ICB6655', 'bep-tu-bluestone-icb6655', '', '', '2100', 'USA', 0, 4000, '24 tháng', '', 'Bếp từ BlueStone ICB6655', 'bếp từ, bếp từ bluestone icb6655, bếp từ giá rẻ, bếp từ cao cấp, bếp từ ngoại nhập, bếp hồng ngoại, bếp hồng ngoại giá rẻ', 'KT mặt bếp:\r\n381x295x4mm\r\n• - Công suất mạnh 2100W, tự do lựa chọn 9 mức điều chỉnh công suất\r\n• Mặt bếp bằng kính cao cấp loại A, chịu nhiệt cao.\r\n• Đa chế độ nấu: nấu lẩu, hấp, nấu canh, cháo, xào dinh dưỡng…\r\n• Thiết kế siêu mỏng\r\n• - Công nghệ điều khiển cảm ứng giúp vận hành dễ dàng', 0, 0, 1619000, 0, 'KT mặt bếp:\r\n381x295x4mm\r\n• - Công suất mạnh 2100W, tự do lựa chọn 9 mức điều chỉnh công suất\r\n• Mặt bếp bằng kính cao cấp loại A, chịu nhiệt cao.\r\n• Đa chế độ nấu: nấu lẩu, hấp, nấu canh, cháo, xào dinh dưỡng…\r\n• Thiết kế siêu mỏng\r\n• - Công nghệ điều khiển cảm ứng giúp vận hành dễ dàng', '<p><span style="font-size:20px;"><strong><a href="http://mych.vn/do-dien-gia-dung/bep-tu-bep-hong-ngoai"><span style="color:#8B4513;">Bếp từ</span></a></strong> <span style="color:#0000CD;"><strong>BlueStone ICB6655</strong></span></span></p>\r\n\r\n<p><span style="font-size:16px;">- <span style="color: rgb(76, 76, 76); font-family: Arial, sans-serif; line-height: 18px;">Nấu nhanh, tiết kiệm điện năng tiêu thụ, an toàn, sạch sẽ và siêu tiện dụng là những ưu điểm có tính cách mạng trong ngành điện gia dụng. Từ nay, tất cả quý bà nội trợ không chỉ dễ dàng mang lại bữa ăn ngon, nhanh, gọn cho cả nhà mà còn có thêm thời gian cho riêng mình.</span></span></p>\r\n\r\n<p><span style="font-size:16px;"><span style="color: rgb(76, 76, 76); font-family: Arial, sans-serif; line-height: 18px;">- Khác biệt với mâm từ lớn cho công suất thực đủ, đúng với công bố để mang lại hiệu quả và thời gian nấu nướng nhanh nhất, bếp từ BlueStone còn được trang bị màn hình cảm ứng 