px; padding: 0px;">Cảm ứng</span></td>\r\n		</tr>\r\n		<tr style="border: 0px; margin: 0px; padding: 0px;">\r\n			<td style="border-width: 0px 0px 1px; border-bottom-style: solid; border-bottom-color: rgb(187, 187, 187); margin: 0px; padding: 7px 10px; vertical-align: middle;">Chế độ nấu</td>\r\n			<td style="border-width: 0px 0px 1px; border-bottom-style: solid; border-bottom-color: rgb(187, 187, 187); margin: 0px; padding: 7px 10px; vertical-align: middle;"><span style="border: 0px; margin: 0px; padding: 0px;">8</span></td>\r\n		</tr>\r\n		<tr style="border: 0px; margin: 0px; padding: 0px; background: rgb(248, 248, 248);">\r\n			<td style="border-width: 0px 0px 1px; border-bottom-style: solid; border-bottom-color: rgb(187, 187, 187); margin: 0px; padding: 7px 10px; vertical-align: middle;">Sản phẩm tặng kèm</td>\r\n			<td style="border-width: 0px 0px 1px; border-bottom-style: solid; border-bottom-color: rgb(187, 187, 187); margin: 0px; padding: 7px 10px; vertical-align: middle;"><span style="border: 0px; margin: 0px; padding: 0px;">Nồi lấu tiện dụng (inox, nắp thuỷ tinh)</span></td>\r\n		</tr>\r\n		<tr style="border: 0px; margin: 0px; padding: 0px;">\r\n			<td style="border-width: 0px 0px 1px; border-bottom-style: solid; border-bottom-color: rgb(187, 187, 187); margin: 0px; padding: 7px 10px; vertical-align: middle;">Kích thước mặt bếp</td>\r\n			<td style="border-width: 0px 0px 1px; border-bottom-style: solid; border-bottom-color: rgb(187, 187, 187); margin: 0px; padding: 7px 10px; vertical-align: middle;"><span style="border: 0px; margin: 0px; padding: 0px;">381 x 295 x 4 mm</span></td>\r\n		</tr>\r\n		<tr style="border: 0px; margin: 0px; padding: 0px; background: rgb(248, 248, 248);">\r\n			<td style="border-width: 0px 0px 1px; border-bottom-style: solid; border-bottom-color: rgb(187, 187, 187); margin: 0px; padding: 7px 10px; vertical-align: middle;">Khối lượng sản phẩm</td>\r\n			<td style="border-width: 0px 0px 1px; border-bottom-style: solid; border-bottom-color: rgb(187, 187, 187); margin: 0px; padding: 7px 10px; vertical-align: middle;"><span style="border: 0px; margin: 0px; padding: 0px;">4.0 kg</span></td>\r\n		</tr>\r\n		<tr style="border: 0px; margin: 0px; padding: 0px;">\r\n			<td style="border-width: 0px 0px 1px; border-bottom-style: solid; border-bottom-color: rgb(187, 187, 187); margin: 0px; padding: 7px 10px; vertical-align: middle;">Số lượng sản phẩm/thùng</td>\r\n			<td style="border-width: 0px 0px 1px; border-bottom-style: solid; border-bottom-color: rgb(187, 187, 187); margin: 0px; padding: 7px 10px; vertical-align: middle;"><span style="border: 0px; margin: 0px; padding: 0px;">03</span></td>\r\n		</tr>\r\n		<tr style="border: 0px; margin: 0px; padding: 0px; background: rgb(248, 248, 248);">\r\n			<td style="border-width: 0px 0px 1px; border-bottom-style: solid; border-bottom-color: rgb(187, 187, 187); margin: 0px; padding: 7px 10px; vertical-align: middle;">Khối lượng thùng</td>\r\n			<td style="border-width: 0px 0px 1px; border-bottom-style: solid; border-bottom-color: rgb(187, 187, 187); margin: 0px; padding: 7px 10px; vertical-align: middle;"><span style="border: 0px; margin: 0px; padding: 0px;">12.9 kg</span></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>TÍNH NĂNG NỔI BẬT</p>\r\n\r\n<p>- <span style="color: rgb(64, 64, 64); font-family: Arial, sans-serif; line-height: normal;">Cảm biến nhiệt đáy nồi giúp bảo vệ quá nhiệt</span></p>\r\n\r\n<p><span style="color: rgb(64, 64, 64); font-family: Arial, sans-serif; line-height: normal;">- Công suất mạnh 2,100W; tự do lựa chọn 09 mức điều chỉnh công suất</span></p>\r\n\r\n<p><span style="color: rgb(64, 64, 64); font-family: Arial, sans-serif; line-height: normal;">- Mặt kính thủy tinh thể cao cấp dày, trong suốt chịu nhiệt cao</span></p>\r\n\r\n<p> HƯỚNG DẪN SỬ DỤNG</p>\r\n\r\n<p style="border: 0px; margin: 0px 0px 0.8em; padding: 0px; color: rgb(64, 64, 64); font-family: Arial, sans-serif; line-height: normal;"><strong style="border: 0px; margin: 0px; padding: 0px;">1. Chú ý trước khi sử dụng</strong></p>\r\n\r\n<p style="border: 0px; margin: 0px 0px 0.8em; padding: 0px; color: rgb(64, 64, 64); font-family: Arial, sans-serif; line-height: normal;"> </p>\r\n\r\n<ul style="border: 0px; margin: 0px 1.5em 1.5em 0px; padding-right: 0px; padding-left: 1.5em; color: rgb(64, 64, 64); font-family: Arial, sans-serif; line-height: normal;">\r\n	<li style="border: 0px; margin: 0px; padding: 0px;">Đặt nồi với thức ăn ngay giữa mặt kính bếp.</li>\r\n	<li style="border: 0px; margin: 0px; padding: 0px;">Cắm dây điện vào ổ cắm phù hợp để dây điện tiếp xúc tốt với ổ cắm.</li>\r\n	<li style="border: 0px; margin: 0px; padding: 0px;">Lau sạch thành và đáy nồi trước khi đặt lên bếp.</li>\r\n	<li style="border: 0px; margin: 0px; padding: 0px;">Không đặt nồi rỗng lên bếp để tránh hư hỏng nồi hoặc gây cháy.</li>\r\n</ul>\r\n\r\n<p style="border: 0px; margin: 0px 0px 0.8em; padding: 0px; color: rgb(64, 64, 64); font-family: Arial, sans-serif; line-height: normal;"><strong style="border: 0px; margin: 0px; padding: 0px;">2. Hướng dẫn Tắt/ Mở thiết bị</strong></p>\r\n\r\n<p style="border: 0px; margin: 0px 0px 0.8em; padding: 0px; color: rgb(64, 64, 64); font-family: Arial, sans-serif; line-height: normal;"> </p>\r\n\r\n<ul style="border: 0px; margin: 0px 1.5em 1.5em 0px; padding-right: 0px; padding-left: 1.5em; color: rgb(64, 64, 64); font-family: Arial, sans-serif; line-height: normal;">\r\n	<li style="border: 0px; margin: 0px; padding: 0px;">Đặt nồi lên giữa mặt bếp.</li>\r\n	<li style="border: 0px; margin: 0px; padding: 0px;">Cắm điện, máy sẽ phát ra tiếng “bíp”, máy ở trạng thái sẵn sàng.</li>\r\n	<li style="border: 0px; margin: 0px; padding: 0px;">Nhấn nút On/Off, chọn chức năng nấu.</li>\r\n	<li style="border: 0px; margin: 0px; padding: 0px;">Sau khi nấu, nhấn nút On/Off để tắt bếp, quạt giải nhiệt trong bếp vẫn tiếp tục hoạt động trong 1 phút.</li>\r\n	<li style="border: 0px; margin: 0px; padding: 0px;">Sau khi quạt ngừng, rút phích cắm ra khỏi ổ điện. </li>\r\n</ul>\r\n', '', '', '', '', '', '', 1, 1, 1459124447, 1464410448, 0);
