/span></td>\r\n		</tr>\r\n		<tr style="border: 0px; margin: 0px; padding: 0px; background: rgb(248, 248, 248);">\r\n			<td style="border-width: 0px 0px 1px; border-bottom-style: solid; border-bottom-color: rgb(187, 187, 187); margin: 0px; padding: 7px 10px; vertical-align: middle;"><span style="font-size:16px;">Chống văng thực phẩm khi xay</span></td>\r\n			<td style="border-width: 0px 0px 1px; border-bottom-style: solid; border-bottom-color: rgb(187, 187, 187); margin: 0px; padding: 7px 10px; vertical-align: middle;"><span style="font-size:16px;"><span style="border: 0px; margin: 0px; padding: 0px;">Có</span></span></td>\r\n		</tr>\r\n		<tr style="border: 0px; margin: 0px; padding: 0px;">\r\n			<td style="border-width: 0px 0px 1px; border-bottom-style: solid; border-bottom-color: rgb(187, 187, 187); margin: 0px; padding: 7px 10px; vertical-align: middle;"><span style="font-size:16px;">Khối lượng sản phẩm</span></td>\r\n			<td style="border-width: 0px 0px 1px; border-bottom-style: solid; border-bottom-color: rgb(187, 187, 187); margin: 0px; padding: 7px 10px; vertical-align: middle;"><span style="font-size:16px;"><span style="border: 0px; margin: 0px; padding: 0px;">1.45 kg</span></span></td>\r\n		</tr>\r\n		<tr style="border: 0px; margin: 0px; padding: 0px; background: rgb(248, 248, 248);">\r\n			<td style="border-width: 0px 0px 1px; border-bottom-style: solid; border-bottom-color: rgb(187, 187, 187); margin: 0px; padding: 7px 10px; vertical-align: middle;"><span style="font-size:16px;">Số lượng sản phẩm/thùng</span></td>\r\n			<td style="border-width: 0px 0px 1px; border-bottom-style: solid; border-bottom-color: rgb(187, 187, 187); margin: 0px; padding: 7px 10px; vertical-align: middle;"><span style="font-size:16px;"><span style="border: 0px; margin: 0px; padding: 0px;">8</span></span></td>\r\n		</tr>\r\n		<tr style="border: 0px; margin: 0px; padding: 0px;">\r\n			<td style="border-width: 0px 0px 1px; border-bottom-style: solid; border-bottom-color: rgb(187, 187, 187); margin: 0px; padding: 7px 10px; vertical-align: middle;"><span style="font-size:16px;">Khối lượng thùng</span></td>\r\n			<td style="border-width: 0px 0px 1px; border-bottom-style: solid; border-bottom-color: rgb(187, 187, 187); margin: 0px; padding: 7px 10px; vertical-align: middle;"><span style="font-size:16px;"><span style="border: 0px; margin: 0px; padding: 0px;">11.6 kg</span></span></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p> </p>\r\n', '<p style="line-height: 20.8px;"><span style="color:#8B4513;"><strong>TÍNH NĂNG NỔI BẬT :</strong></span></p>\r\n\r\n<p style="line-height: 20.8px;"><span style="font-size:16px;"><span style="color: rgb(64, 64, 64); font-family: Arial, sans-serif; line-height: normal;">Thiết kế cán và lưỡi dao bằng thép không gỉ, bền và an toàn cho sức khỏe</span></span></p>\r\n\r\n<p style="line-height: 20.8px;"><span style="font-size:16px;"> <span style="color: rgb(64, 64, 64); font-family: Arial, sans-serif; line-height: normal;">Công suất mạnh đến 600W giúp xay nhuyễn thực phẩm chỉ trong vài giây</span></span></p>\r\n\r\n<p style="line-height: 20.8px;"><span style="font-size:16px;"><span style="color: rgb(64, 64, 64); font-family: Arial, sans-serif; line-height: normal;">Nhiều tốc độ lựa chọn, phù hợp với nhiều loại thực phẩm khác nhau</span></span></p>\r\n\r\n<p style="line-height: 20.8px;"><strong><span style="color:#8B4513;">HƯỚNG DẪN SỬ DỤNG :</span></strong></p>\r\n\r\n<p style="border: 0px; margin: 0px 0px 0.8em; padding: 0px; font-size: 16.0016px; color: rgb(0, 0, 0); font-family: \'Times New Roman\'; line-height: normal;"><span style="font-size:18px;">Thời gian máy hoạt động không có tải không được vượt quá 15 giây.<br />\r\nThời gian vận hành tối đa không được vượt quá 1 phút mỗi lẫn, và máy phải được nghỉ 3 phút giữa 2 lần xay.<br />\r\n<strong style="border: 0px; margin: 0px; padding: 0px; font-size: 16.0016px;">Lưu ý:</strong> Các lưỡi dao rất sắc, phải rất cẩn thận khi thao tác. Cần chắc chắn máy xay sinh tố cầm tay đã được ngắt khỏi nguồn điện trước khi lắp ráp hoặc tháo các phụ kiện.</span></p>\r\n\r\n<p style="border: 0px; margin: 0px 0px 0.8em; padding: 0px; font-size: 16.0016px; color: rgb(0, 0, 0); font-family: \'Times New Roman\'; line-height: normal;"><span style="color:#8B4513;"><strong style="border: 0px; margin: 0px; padding: 0px; font-size: 16.0016px;">HƯỚNG DẪN XAY SINH TỐ :</strong></span></p>\r\n\r\n<ol style="padding-right: 0px; padding-left: 1.5em; border: 0px; margin: 0px 1.5em 1.5em 0px; font-size: 16.0016px; color: rgb(0, 0, 0); font-family: \'Times New Roman\'; line-height: normal;">\r\n	<li style="border: 0px; margin: 0px; padding: 0px; font-size: 16.0016px;"><span style="color:#000000;"><span style="font-size:18px;">Để lắp ráp lưỡi dao tháo rời vào thân máy, xoay thân máy theo hướng chiều kim đồng hồ cho tới khi gắn chặt. Để tháo ra, chỉ cần xoay theo hướng ngược lại.</span></span></li>\r\n	<li style="border: 0px; margin: 0px; padding: 0px; font-size: 16.0016px;"><span style="color:#000000;"><span style="font-size:18px;">Cắm phích cắm vào nguồn điện.</span></span></li>\r\n	<li style="border: 0px; margin: 0px; padding: 0px; font-size: 16.0016px;"><span style="color:#000000;"><span style="font-size:18px;">Để cán dao vào trong thực phẩm. Sau đó nhấn và giữ nút tốc độ thấp để bắt đầu xay. Cùng lúc đó, bạn có thể chọn các mức tốc độ mong muốn bằng cách xoay nút điều khiển tốc độ. Có 5 mức tốc độ: 1, 2, 3, 4 và 5 (theo thứ tự từ tốc độ chậm cho tới tốc độ cao).</span></span></li>\r\n	<li style="border: 0px; margin: 0px; padding: 0px; font-size: 16.0016px;"><span style="color:#000000;"><span style="font-size:18px;">Bạn cũng có thể bắt đầu xay bằng cách nhấn và giữ nút tốc độ cao “Turbo”,máy sẽ luôn hoạt động ở tốc độ cao nhất. Tốc độ sẽ không thay đổi cho dù bạn xoay nút điều khiển tốc độ.</span></span></li>\r\n	<li style="border: 0px; margin: 0px; padding: 0px; font-size: 16.0016px;"><span style="color:#000000;"><span style="font-size:18px;">Để máy ngừng hoạt động, thả nút tốc độ thấp hoặc cao ra.</span></span></li>\r\n	<li style="border: 0px; margin: 0px; padding: 0px; font-size: 16.0016px;"><span style="color:#000000;"><span style="font-size:18px;">Khi xay cà rốt, phải cắt thành từng miếng nhỏ, cho vào cối xay nhỏ, thêm nước tới mức tối đa. Số lượng tối đa của cà rốt cho mỗi lần xay là 280g, nước là 420g.</span></span></li>\r\n</ol>\r\n', '', '', '', '', '', 1, 1, 1459128219, 1464579035, 0);
