r style="border: 0px; margin: 0px; padding: 0px;">\r\n			<td style="border-width: 0px 0px 1px; border-bottom-style: solid; border-bottom-color: rgb(187, 187, 187); margin: 0px; padding: 7px 10px; vertical-align: middle;"><span style="font-size:16px;">Số lượng sản phẩm/thùng</span></td>\r\n			<td style="border-width: 0px 0px 1px; border-bottom-style: solid; border-bottom-color: rgb(187, 187, 187); margin: 0px; padding: 7px 10px; vertical-align: middle;"><span style="font-size:16px;"><span style="border: 0px; margin: 0px; padding: 0px;">4</span></span></td>\r\n		</tr>\r\n		<tr style="border: 0px; margin: 0px; padding: 0px; background: rgb(248, 248, 248);">\r\n			<td style="border-width: 0px 0px 1px; border-bottom-style: solid; border-bottom-color: rgb(187, 187, 187); margin: 0px; padding: 7px 10px; vertical-align: middle;"><span style="font-size:16px;">Khối lượng thùng</span></td>\r\n			<td style="border-width: 0px 0px 1px; border-bottom-style: solid; border-bottom-color: rgb(187, 187, 187); margin: 0px; padding: 7px 10px; vertical-align: middle;"><span style="font-size:16px;"><span style="border: 0px; margin: 0px; padding: 0px;">7.88kg</span></span></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p> </p>\r\n', '<p style="line-height: 20.8px;"><span style="color:#8B4513;"><strong>TÍNH NĂNG NỔI BẬT :</strong></span></p>\r\n\r\n<p style="line-height: 20.8px;"><span style="font-size:16px;"><span style="color: rgb(64, 64, 64); font-family: Arial, sans-serif; line-height: normal;">Công suất mạnh đến 800W với motor DC, giúp xay nhuyễn thực phẩm chỉ trong vài giây.</span></span></p>\r\n\r\n<p style="line-height: 20.8px;"><span style="font-size:16px;"><span style="color: rgb(64, 64, 64); font-family: Arial, sans-serif; line-height: normal;">Thiết kế lưỡi dao và cán dao bằng thép không gỉ 304, bền và an toàn cho sức khỏe</span></span></p>\r\n\r\n<p style="line-height: 20.8px;"><span style="font-size:16px;"><span style="color: rgb(64, 64, 64); font-family: Arial, sans-serif; line-height: normal;">Tiện dụng với nhiều tốc độ lựa chọn, chức năng xay thịt và đánh trứng. </span></span></p>\r\n\r\n<p style="line-height: 20.8px;"><span style="color:#8B4513;"><strong>HƯỚNG DẪN SỬ DỤNG</strong></span></p>\r\n\r\n<p style="border: 0px; margin: 0px 0px 0.8em; padding: 0px; font-size: 16.0016px; line-height: normal; color: rgb(0, 0, 0); font-family: \'Times New Roman\';"><span style="font-size:16px;">Máy xay sinh tố cầm tay phù hợp để làm các món sốt, súp, các loại sốt mayonnaise và thức ăn cho em bé cũng như các món sinh tố và hỗn hợp sữa.</span></p>\r\n\r\n<ol style="padding-right: 0px; padding-left: 1.5em; border: 0px; margin: 0px 1.5em 1.5em 0px; font-size: 16.0016px; line-height: normal; color: rgb(0, 0, 0); font-family: \'Times New Roman\';">\r\n	<li style="border: 0px; margin: 0px; padding: 0px; font-size: 16.0016px;"><span style="font-size:16px;">Xoay cán dao vào thân máy theo chiều kim đồng hồ cho tới khi khóa lại.</span></li>\r\n	<li style="border: 0px; margin: 0px; padding: 0px; font-size: 16.0016px;"><span style="font-size:16px;">Đặt máy xay sinh tố vào trong tô chứa thực phẩm. Ấn nút tốc độ I hoặc II để xay thực phẩm.</span></li>\r\n	<li style="border: 0px; margin: 0px; padding: 0px; font-size: 16.0016px;"><span style="font-size:16px;">Lấy cán dao ra khỏi thân máy sau khi sử dụng.<br />\r\n	<em style="border: 0px; margin: 0px; padding: 0px; font-size: 16.0016px;">Lưu ý: Bạn có thể xay thực phẩm trong cốc nhựa cũng như trong bất kỳ vật chứa thực phẩm khác.</em></span></li>\r\n	<li style="border: 0px; margin: 0px; padding: 0px; font-size: 16.0016px;"><span style="font-size:16px;">Không sử dụng máy xay sinh tố cầm tay để xay thực phẩm liên tục trong thời gian hơn 1 phút.</span></li>\r\n</ol>\r\n', '', '', '', '', '', 1, 1, 1459129496, 1464578002, 0),
