g</span></td>\r\n			<td style="border-width: 0px 0px 1px; border-bottom-style: solid; border-bottom-color: rgb(187, 187, 187); margin: 0px; padding: 7px 10px; vertical-align: middle;"><span style="font-size:16px;"><span style="border: 0px; margin: 0px; padding: 0px;">6</span></span></td>\r\n		</tr>\r\n		<tr style="border: 0px; margin: 0px; padding: 0px; background: rgb(248, 248, 248);">\r\n			<td style="border-width: 0px 0px 1px; border-bottom-style: solid; border-bottom-color: rgb(187, 187, 187); margin: 0px; padding: 7px 10px; vertical-align: middle;"><span style="font-size:16px;">Khối lượng thùng</span></td>\r\n			<td style="border-width: 0px 0px 1px; border-bottom-style: solid; border-bottom-color: rgb(187, 187, 187); margin: 0px; padding: 7px 10px; vertical-align: middle;"><span style="font-size:16px;"><span style="border: 0px; margin: 0px; padding: 0px;">15kg</span></span></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p><span style="color:#8B4513;"><strong><span style="font-size:16px;">TÍNH NĂNG NỔI BẬT</span></strong></span></p>\r\n\r\n<p><span style="font-size:16px;"><span style="color: rgb(64, 64, 64); font-family: Arial, sans-serif; line-height: normal;">Đa chức năng: sinh tố, ngũ cốc, xay thịt</span></span></p>\r\n\r\n<p><span style="font-size:16px;"><span style="color: rgb(64, 64, 64); font-family: Arial, sans-serif; line-height: normal;">Chức năng khoá an toàn</span></span></p>\r\n\r\n<p><span style="font-size:16px;"><span style="color: rgb(64, 64, 64); font-family: Arial, sans-serif; line-height: normal;">Tặng kèm cối xay thịt</span></span></p>\r\n\r\n<p><strong><span style="color:#8B4513;"><span style="font-size:16px;">HƯỚNG DẪN SỬ DỤNG</span></span></strong></p>\r\n\r\n<ol style="border: 0px; margin: 0px 1.5em 1.5em 0px; padding-right: 0px; padding-left: 1.5em; color: rgb(64, 64, 64); font-family: Arial, sans-serif; line-height: normal;">\r\n	<li style="border: 0px; margin: 0px; padding: 0px;"><span style="font-size:16px;">Mở bao bì đóng gói và đặt các bộ phận trên một bề mặt phẳng.</span></li>\r\n	<li style="border: 0px; margin: 0px; padding: 0px;"><span style="font-size:16px;">Nhúng cối xay, nắp đậy, nắp tiếp nhận thực phẩm vào nước ấm có pha xà bông, rửa sạch và lau khô. Không bao giờ nhúng thân máy vào nước để tránh các rủi ro về giật điện.<br />\r\n	Cảnh báo: lưỡi dao rất sắc, phải rất cẩn thận khi thao tác.</span></li>\r\n	<li style="border: 0px; margin: 0px; padding: 0px;"><span style="font-size:16px;">Cách lắp ráp đúng sẽ được miêu tả chi tiết như bên dưới<br />\r\n	Trước khi lắp đặt, cần chắc chắn là dây nguồn đã được rút khỏi nguồn điện và nút điều khiển tốc độ ở vị trí “0”.<br />\r\n	Để lắp cối xay vào thân máy, đầu tiên đặt cối xay lên thân máy một cách ngay ngắn và xoay theo chiều kim đồng hồ đến khi được khóa lại.</span><br />\r\n	<em style="border: 0px; margin: 0px; padding: 0px;"><span style="font-size:16px;"><strong style="border: 0px; margin: 0px; padding: 0px;">Lưu ý:</strong> Phải chắc rằng cối xay được lắp chắc chắn vào thân máy. Vì có một</span><br />\r\n	<span style="font-size:16px;">khóa an toàn tại vị trí này, nếu cối xay không được lắp hoàn toàn, máy xay sinh tố sẽ không hoạt động được.</span></em></li>\r\n</ol>\r\n', '', '', '', '', '', '', 1, 1, 1459130001, 1464577846, 0),
(238, 44, 20, 34, 0, '', 0, 0, '', '', 'product', 0, 0, 'bluestone-jeb6519-3447.jpg', 'bluestone-jeb6519-3447_195x195.jpg', 'Máy ép trái cây BlueStone JEB6519', 'JEB6519', 'may-ep-trai-cay-bluestone-jeb6519', '', '', '250', 'USA', 0, 2330, '24 tháng', '', 'Máy ép trái cây BlueStone JEB6519', 'máy ép trái cây, máy ép trái cây bluestone jeb6519, máy ép trái cây giá rẻ, máy ép trái cây cao cấp', '• Bộ lọc siêu nhuyễn bằng inox 304 (thép không gỉ) bền và an toàn cho\r\nngười sử dụng\r\n• Thưởng thức nước ép tinh khiết nhờ bộ phân tách bọt trong ca chứa nước\r\nép\r\n• Vòi dẫn nước ép chống nhỏ giọt sau khi xay xong', 0, 0, 949000, 0, '• Bộ lọc siêu nhuyễn bằng inox 304 (thép không gỉ) bền và an toàn cho\r\nngười sử dụng\r\n• Thưởng thức nước ép tinh khiết nhờ bộ phân tách bọt trong ca chứa nước\r\nép\r\n• Vòi dẫn nước ép chống nhỏ giọt sau khi xay xong', '<p><span style="font-size:20px;"><strong><a href="http://mych.vn/do-dien-gia-dung/may-ep-trai-cay-may-xay-sinh-to-may-xay-thit"><span style="color:#8B4513;">Máy ép trái cây</span></a></strong><span style="color:#0000CD;"> <strong>BlueStone JEB6519 :</strong></span></span></p>\r\n\r\n<p><span style="font-size:16px;"><span style="color:#000000;">- <span style="font-family: Arial, sans-serif; line-height: 18px; background-color: rgb(227, 227, 227);">Rất nhiều loại trái cây không chỉ ăn ngon mà còn ngon và bổ dưỡng hơn nếu được chế biến thành dạng thức uống. Với ống dẫn rộng ngoại hạng, máy ép trái cây BlueStone cho phép ép nhiều loại trái khác nhau mà không cần tách thành nhiều miếng nhỏ. Với công suất 900W cho số vòng quay cực đại 18.000 vòng/phút, hiệu suất ép đạt mức tối đa với độ nhuyễn vượt trội và thời gian hoàn tất tính bằng giây.</span></span></span></p>\r\n\r\n<p><span style="font-size:16px;"><span style="color:#000000;"><span style="font-family: Arial, sans-serif; line-height: 18px; background-color: rgb(227, 227, 227);">- Hương vị nước ép trái cây càng tinh khiết hơn nhờ chức năng tách bọt và bộ lọc siêu nhuyễn bằng thép không gỉ.</span><br style="color: rgb(76, 76, 76); font-family: Arial, sans-serif; font-size: 14px; line-height: 18px; background-color: rgb(227, 227, 227);" />\r\n<br style="color: rgb(76, 76, 76); font-family: Arial, sans-serif; font-size: 14px; line-height: 18px; background-color: rgb(227, 227, 227);" />\r\n<span style="font-family: Arial, sans-serif; line-height: 18px; background-color: rgb(227, 227, 227);">- Ngoài ra, cùng với vỏ máy làm bằng thép không gỉ, máy ép trái cây BlueStone cho phép tháo lắp từng bộ phận dễ dàng giúp việc vệ sinh sản phẩm thật dễ dàng cho các chị em.</span></span></span></p>\r\n\r\n<p><span style="color: rgb(76, 76, 76); font-family: Arial, sans-serif; font-size: 14px; line-height: 18px; background-color: rgb(227, 227, 227);"><img alt="mych.vn máy ép trái cây bluestone jeb6519" height="400" src="http://mych.vn/vubaohuy/upload/images/MAY%20XAY%20SINH%20TO%2C%20MAY%20EP%20TRAI%20CAY/BLUESTONE%20JEB6519.jpg" width="400" /></span></p>\r\n\r\n<p><font color="#4c4c4c" face="Arial, sans-serif"><span style="font-size: 14px; line-height: 18px; background-color: rgb(227, 227, 227);">THÔNG SỐ KỸ THUẬT</span></font></p>\r\n\r\n<table style="border: 0px; margin: 0px; padding: 0px; border-collapse: collapse; border-spacing: 0px; width: 1140px; color: rgb(64, 64, 64); font-family: Arial, sans-serif; line-height: normal;">\r\n	<tbody style="border: 0px; margin: 0px; padding: 0px;">\r\n		<tr style="border: 0px; margin: 0px; padding: 0px; background: rgb(248, 248, 248);">\r\n			<td style="border-width: 1px 0px; border-top-style: solid; border-bottom-style: solid; border-top-color: rgb(187, 187, 187); border-bottom-color: rgb(187, 187, 187); margin: 0px; padding: 7px 10px; vertical-align: middle;">Model</td>\r\n			<td style="border-width: 1px 0px; border-top-style: solid; border-bottom-style: solid; border-top-color: rgb(187, 187, 187); border-bottom-color: rgb(187, 187, 187); margin: 0px; padding: 7px 10px; vertical-align: middle;"><span styl