1.5em; font-size: 16.0016px; line-height: normal; color: rgb(0, 0, 0); font-family: \'Times New Roman\';">\r\n	<li style="border: 0px; margin: 0px; padding: 0px; font-size: 16.0016px;">Chắc chắn nguồn điện (hiệu điện thế) đúng theo những gì được ghi bên dưới máy ép.</li>\r\n	<li style="border: 0px; margin: 0px; padding: 0px; font-size: 16.0016px;">Máy ép này tuân theo chỉ thị Cộng Đồng Kinh Tế Châu Âu. </li>\r\n</ol>\r\n\r\n<p style="border: 0px; margin: 0px 0px 0.8em; padding: 0px; font-size: 16.0016px; line-height: normal; color: rgb(0, 0, 0); font-family: \'Times New Roman\';"><strong style="border: 0px; margin: 0px; padding: 0px; font-size: 16.0016px;">Trước khi sử dụng</strong></p>\r\n\r\n<ol style="border: 0px; margin: 0px 1.5em 1.5em 0px; padding-right: 0px; padding-left: 1.5em; font-size: 16.0016px; line-height: normal; color: rgb(0, 0, 0); font-family: \'Times New Roman\';">\r\n	<li style="border: 0px; margin: 0px; padding: 0px; font-size: 16.0016px;">Tháo tất cả phần đóng gói/ bao bì.</li>\r\n	<li style="border: 0px; margin: 0px; padding: 0px; font-size: 16.0016px;">Rửa các bộ phận : Vui lòng xem phần “vệ sinh máy”.</li>\r\n</ol>\r\n', '', '', '', '', '', '', 1, 1, 1459132188, 1464577549, 0);
