tyle: solid; border-bottom-color: rgb(187, 187, 187); margin: 0px; padding: 7px 10px; vertical-align: middle;"><span style="border: 0px; margin: 0px; padding: 0px;">Xửng hấp inox 304</span></td>\r\n		</tr>\r\n		<tr style="border: 0px; margin: 0px; padding: 0px; background: rgb(248, 248, 248);">\r\n			<td style="border-width: 0px 0px 1px; border-bottom-style: solid; border-bottom-color: rgb(187, 187, 187); margin: 0px; padding: 7px 10px; vertical-align: middle;">Khối lượng sản phẩm</td>\r\n			<td style="border-width: 0px 0px 1px; border-bottom-style: solid; border-bottom-color: rgb(187, 187, 187); margin: 0px; padding: 7px 10px; vertical-align: middle;"><span style="border: 0px; margin: 0px; padding: 0px;">4.7kg</span></td>\r\n		</tr>\r\n		<tr style="border: 0px; margin: 0px; padding: 0px;">\r\n			<td style="border-width: 0px 0px 1px; border-bottom-style: solid; border-bottom-color: rgb(187, 187, 187); margin: 0px; padding: 7px 10px; vertical-align: middle;">Số lượng sản phẩm/thùng</td>\r\n			<td style="border-width: 0px 0px 1px; border-bottom-style: solid; border-bottom-color: rgb(187, 187, 187); margin: 0px; padding: 7px 10px; vertical-align: middle;"><span style="border: 0px; margin: 0px; padding: 0px;">2 cái</span></td>\r\n		</tr>\r\n		<tr style="border: 0px; margin: 0px; padding: 0px; background: rgb(248, 248, 248);">\r\n			<td style="border-width: 0px 0px 1px; border-bottom-style: solid; border-bottom-color: rgb(187, 187, 187); margin: 0px; padding: 7px 10px; vertical-align: middle;">Khối lượng thùng</td>\r\n			<td style="border-width: 0px 0px 1px; border-bottom-style: solid; border-bottom-color: rgb(187, 187, 187); margin: 0px; padding: 7px 10px; vertical-align: middle;"><span style="border: 0px; margin: 0px; padding: 0px;">11.9kg</span></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>TÍNH NĂNG NỔI BẬT</p>\r\n\r\n<p><span style="color: rgb(64, 64, 64); font-family: Arial, sans-serif; line-height: normal;">Giữ nguyên chất dinh dưỡng & hương vị của thức ăn, tốt cho sức khỏe. </span></p>\r\n\r\n<p><span style="color: rgb(64, 64, 64); font-family: Arial, sans-serif; line-height: normal;">Xửng hấp bằng thép không gỉ 304 tiện lợi và an toàn cho sức khỏe.</span></p>\r\n\r\n<p><span style="color: rgb(64, 64, 64); font-family: Arial, sans-serif; line-height: normal;">Chức năng hẹn giờ giúp bạn tự do lựa chọn thời điểm hoàn tất. Nấu rất nhanh giúp tiết kiệm điện và thời gian </span></p>\r\n\r\n<p><span style="color: rgb(64, 64, 64); font-family: Arial, sans-serif; line-height: normal;">Tiện lợi với chức năng nấu tự động, các nút chức năng đã được lên chương trình sẵn, hẹn thời gian bắt đầu nấu và tự động chuyển sang chế độ giữ ấm.</span></p>\r\n\r\n<p><span style="color: rgb(64, 64, 64); font-family: Arial, sans-serif; line-height: normal;">Tiện lợi với khe dựng đứng nắp trên quai nồi.</span> </p>\r\n', '', '', '', '', '', '', 1, 1, 1459150775, 1461800194, 0);
