border-width: 0px 0px 1px; border-bottom-style: solid; border-bottom-color: rgb(187, 187, 187); margin: 0px; padding: 7px 10px; vertical-align: middle;"><span style="border: 0px; margin: 0px; padding: 0px;">LED</span></td>\r\n		</tr>\r\n		<tr style="border: 0px; margin: 0px; padding: 0px;">\r\n			<td style="border-width: 0px 0px 1px; border-bottom-style: solid; border-bottom-color: rgb(187, 187, 187); margin: 0px; padding: 7px 10px; vertical-align: middle;">Cài đặt hẹn giờ</td>\r\n			<td style="border-width: 0px 0px 1px; border-bottom-style: solid; border-bottom-color: rgb(187, 187, 187); margin: 0px; padding: 7px 10px; vertical-align: middle;"><span style="border: 0px; margin: 0px; padding: 0px;">Có</span></td>\r\n		</tr>\r\n		<tr style="border: 0px; margin: 0px; padding: 0px; background: rgb(248, 248, 248);">\r\n			<td style="border-width: 0px 0px 1px; border-bottom-style: solid; border-bottom-color: rgb(187, 187, 187); margin: 0px; padding: 7px 10px; vertical-align: middle;">Bảng điều khiển</td>\r\n			<td style="border-width: 0px 0px 1px; border-bottom-style: solid; border-bottom-color: rgb(187, 187, 187); margin: 0px; padding: 7px 10px; vertical-align: middle;"><span style="border: 0px; margin: 0px; padding: 0px;">Tiếng Việt</span></td>\r\n		</tr>\r\n		<tr style="border: 0px; margin: 0px; padding: 0px;">\r\n			<td style="border-width: 0px 0px 1px; border-bottom-style: solid; border-bottom-color: rgb(187, 187, 187); margin: 0px; padding: 7px 10px; vertical-align: middle;">Khối lượng sản phẩm</td>\r\n			<td style="border-width: 0px 0px 1px; border-bottom-style: solid; border-bottom-color: rgb(187, 187, 187); margin: 0px; padding: 7px 10px; vertical-align: middle;"><span style="border: 0px; margin: 0px; padding: 0px;">3.6kg</span></td>\r\n		</tr>\r\n		<tr style="border: 0px; margin: 0px; padding: 0px; background: rgb(248, 248, 248);">\r\n			<td style="border-width: 0px 0px 1px; border-bottom-style: solid; border-bottom-color: rgb(187, 187, 187); margin: 0px; padding: 7px 10px; vertical-align: middle;">Số lượng sản phẩm/thùng</td>\r\n			<td style="border-width: 0px 0px 1px; border-bottom-style: solid; border-bottom-color: rgb(187, 187, 187); margin: 0px; padding: 7px 10px; vertical-align: middle;"><span style="border: 0px; margin: 0px; padding: 0px;">4</span></td>\r\n		</tr>\r\n		<tr style="border: 0px; margin: 0px; padding: 0px;">\r\n			<td style="border-width: 0px 0px 1px; border-bottom-style: solid; border-bottom-color: rgb(187, 187, 187); margin: 0px; padding: 7px 10px; vertical-align: middle;">Khối lượng thùng</td>\r\n			<td style="border-width: 0px 0px 1px; border-bottom-style: solid; border-bottom-color: rgb(187, 187, 187); margin: 0px; padding: 7px 10px; vertical-align: middle;"><span style="border: 0px; margin: 0px; padding: 0px;">18kg</span></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>TÍNH NĂNG NỔI BẬT</p>\r\n\r\n<p><span style="color: rgb(64, 64, 64); font-family: Arial, sans-serif; line-height: normal;">Đa chức năng: nấu cơm, nấu cơm nhanh, nấu cháo, nấu súp, hấp, làm bánh...</span></p>\r\n\r\n<p><span style="color: rgb(64, 64, 64); font-family: Arial, sans-serif; line-height: normal;">Tiện lợi với chức năng hẹn giờ và màn hình Led hiển thị thời gian. </span></p>\r\n\r\n<p><span style="color: rgb(64, 64, 64); font-family: Arial, sans-serif; line-height: normal;">Lòng nồi dày 1.7mm phủ chất chống dính siêu bền giúp nồi cơm nóng lâu và dễ vệ sinh.</span></p>\r\n\r\n<p><span style="color: rgb(64, 64, 64); font-family: Arial, sans-serif; line-height: normal;">Công nghệ Fuzzy trong hệ thống đốt nóng làm hạt cơm thơm ngon.</span> </p>\r\n', '', '', '', '', '', '', 1, 1, 1459155397, 1461752846, 0),
(252, 46, 20, 36, 0, '', 0, 0, '', '', 'product', 0, 0, 'bluestone-rcb5968s-3601.jpg', 'bluestone-rcb5968s-3601_195x195.jpg', 'Nồi cơm điện BlueStone RCB5968S', 'RCB5968S', 'noi-com-dien-bluestone-rcb5968s', '', '', '860', 'USA', 1800, 5000, '24 tháng', '', 'Nồi cơm điện BlueStone RCB5968S', 'nồi cơm điện, nồi cơm điện bluestone rcb5968s, nồi cơm điện giá rẻ, nồi cơm điện cao cấp, nồi cơm điện nắp bật, nồi cơm điện nắp rời', 'nồi cơm điện, nồi cơm điện bluestone rcb5968s, nồi cơm điện giá rẻ, nồi cơm điện cao cấp, nồi cơm điện nắp bật, nồi cơm điện nắp rời', 0, 0, 2279000, 0, '• Đa chức năng: nấu cơm, nấu cháo, súp, làm bánh pizza, sữa chua, mì ống,\r\ncơm cháy...\r\n• Với chức năng giữ ấm 3 chiều, giúp bạn có bữa cơm ngon và giữ ấm lâu\r\nhơn.\r\n• Lòng nồi dày 2mm phủ Ceramic giúp cơm chín đều ngon hơn và an toàn\r\ncho sức khỏe.\r\n• Tiện lợi với tay cầm trên lòng nồi\r\n• Bộ điều khiển cảm ứng', '<div class="product-content-detail" style="box-sizing: border-box; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;">\r\n<div class="content js-content expand" id="gioi-thieu" itemprop="description" style="box-sizing: border-box; overflow: hidden; margin-bottom: 15px; max-height: none;">\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px;"><span style="box-sizing: border-box; font-size: medium;"><span style="box-sizing: border-box; font-weight: 700;"><a href="http://mych.vn/do-dien-gia-dung/noi-com-dien-noi-ap-suat-noi-da-nang" style="box-sizing: border-box; color: rgb(51, 122, 183); text-decoration: none; background-color: transparent;"><span style="color:#000080;">Nồi Cơm Điện Tử</span></a></span></span><span style="box-sizing: border-box; font-size: medium; color: rgb(0, 138, 183);"><span style="box-sizing: border-box; font-weight: 700;"> </span></span><span style="color:#8B4513;"><span style="box-sizing: border-box; font-size: medium;"><span style="box-sizing: border-box; font-weight: 700;">Bluestone RCB-5968S</span></span></span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px;"><span style="box-sizing: border-box; font-weight: 700;"><a href="http://giadungmychau.com/index.php?com=tim-kiem&amp;keywords=noi+com+dien" style="box-sizing: border-box; color: rgb(51, 122, 183); text-decoration: none; background-color: transparent;">Nồi cơm điện</a> tử Bluestone RCB-5968S</span> có công suất hoạt động 860W, dung tích 1.8L nấu đủ thức ăn cho cả gia đình, đa chức năng: nấu cơm, nấu cháo, súp, làm bánh pizza, sữa chua, mì ống, cơm cháy, làm bánh, chiên...Lòng nồi dày 2mm phủ ceramic khả năng hấp thụ nhiệt tốt để cơm chín đều và nhanh trong thời gian ngắn, chức năng giữ ấm 3 chiều giúp bạn có bữa cơm ngon và giữ ấm lâu hơn. Đặc biệt nồi Bluestone RCB-5968S có hệ thống điều khiển điện tử, đèn LED hiển thị thời gian nấu, công việc nội trợ sẽ dễ dàng hơn.</p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px;"><img alt="mych.vn nồi cơm điện tử bluestone RCB-5968S" height="400" src="http://mych.vn/vubaohuy/upload/images/NOI%20COM%2C%20NOI%20AP%20SUAT%2C%20NOI%20DA%20NANG/BLUESTONE%20RCB5968S%20b.jpg" style="box-sizing: border-box; vertical-align: middle; border: 0px; display: block; max-width: 100%; height: auto; margin-left: auto; margin-right: auto;" title="Nồi Cơm Điện Tử Bluestone RCB-5968S" width="400" /></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px;"><span style="box-sizing: border-box; font-weight: 700;">Tính năng sản phẩm</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px;"><span style="box-sizing: border-box; font-weight: 700;">Đa chức năng nấu nướng</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px;">Nồi Cơm Điện Tử Bluestone RCB-5968S có công suất 860W với đa chức năng nấu: nấu cơm, nấu cháo, súp, làm bánh pizza, sữa chua, mì ống, cơm cháy, làm bánh, chiên sẽ mang đến cho gia đình bạn sự tiện dụng và những bữa ăn thật phong phú.</p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px;"><span style="box-sizing: border-box; font-weight: 700;">Lòng nồi phủ Ceramic</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px;">Lòng nồi dày 2mm phủ ceramic khả năng hấp thụ nhiệt tốt để cơm chín đều và nhanh trong thời gian ngắn.</p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px;"> </p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px;"><span style="box-sizing: border-box; font-weight: 700;">Bảng điều khiển thông minh</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px;">Phần nắp nồi tích hợp bảng điều khiển điện tử rộng, đèn LED hiển thị thời gian cùng các nút nhấn êm và nhạy cho thao tác điều chỉnh dễ dàng.</p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px;"><span style="box-sizing: border-box; font-weight: 700;">Nắp trong có đĩa nhiệt</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px;">Nắp trong có đĩa nhiệt giữ ấm cho cơm, ngăn không cho các giọt sương đọng lại rơi xuống làm nhão cơm, thiết kế tháo rời dễ lau chùi, bảo quản.</p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px;"> </p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px;"><span style="box-sizing: border-box; font-weight: 700;">Tích hợp nhiều chức năng hiện đại</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px;"><span style="box-sizing: border-box;">Khả năng giữ ấm cơm lâu đến 12 giờ, bất kỳ thời điểm nào trong ngày cũng có cơm nóng dùng ngay. <span style="box-sizing: border-box;">Chức năng hẹn giờ nấu tự động, tiện lợi khi bận rộn, tiết kiệm thời gian cho người nội trợ. Tiện lợi khi sử dụng với tay cầm trên lòng nồi.</span></span></p>\r\n</div>\r\n</div>\r\n\r\n<div class="product-table-box" style="box-sizing: border-box; margin-top: 30px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;">\r\n<h3 class="product-table-title" style="box-sizing: border-box; font-family: inherit; line-height: 1.1; color: rgb(68, 