(257, 40, 20, 56, 0, '', 0, 0, '', '', 'product', 0, 0, 'ast-tiross-ts486-1856.jpg', 'ast-tiross-ts486-1856_195x195.jpg', 'Ấm siêu tốc Tiross TS486', 'TS486', 'am-sieu-toc-tiross-ts486', '', '', '2000', 'RPC', 1700, 0, '12 Tháng', '', 'Ấm siêu tốc Tiross TS486', 'ấm siêu tốc tiross ts486, ấm siêu tốc tiross, ấm siêu tốc, bình siêu tốc, ấm siêu tốc nhựa, ấm siêu tốc inox, bình đun nước, ấm đun nước điện, ấm đun nước', 'Ấm có vỏ ngoài được làm bằng chất liệu inox ,được làm bằng nhựa cao cấp cách nhiệt và cách điện tốt .Ấm sử dụng mâm nhiệt rời làm bằng thép không gỉ,  tự ngắt điện khi nước sôi đủ 100 độ', 0, 0, 590000, 0, 'Ấm có vỏ ngoài được làm bằng chất liệu inox ,được làm bằng nhựa cao cấp cách nhiệt và cách điện tốt .Ấm sử dụng mâm nhiệt rời làm bằng thép không gỉ,  tự ngắt điện khi nước sôi đủ 100 độ', '<p style="margin: 0px; color: rgb(119, 119, 119); font-family: Arial; font-size: 14.4px; line-height: normal;"><span style="font-size:20px;"><strong><a href="http://mych.vn/do-dien-gia-dung/am-sieu-toc-may-pha-ca-phe"><span style="color:#0000CD;">Ấm siêu tốc</span></a></strong> <strong><span style="color:#8B4513;">Tiross TS486</span></strong></span></p>\r\n\r\n<p style="margin: 0px; color: rgb(119, 119, 119); font-family: Arial; font-size: 14.4px; line-height: normal;"> </p>\r\n\r\n<p style="margin: 0px; color: rgb(119, 119, 119); font-family: Arial; font-size: 14.4px; line-height: normal;"><b style="color: rgb(64, 64, 64); font-family: Helvetica, Arial, sans-serif; line-height: 19px; text-align: justify;">ĐẶC ĐIỂM NỔI BẬT</b></p>\r\n\r\n<p style="margin: 0px 0px 15px; font-size: 14.4px; color: rgb(64, 64, 64); font-family: Helvetica, Arial, sans-serif; line-height: 19px; text-align: justify;"><span style="color:#8B4513;"><b>Chất liệu cao cấp</b></span><br />\r\nẤm có vỏ ngoài được làm bằng chất liệu inox siêu bền, đảm bảo an toàn khi sử dụng lâu dài; bề mặt của đế nguồn và tay cầm được làm bằng nhựa cao cấp cách nhiệt và cách điện tốt, mang lại sự an tâm khi sử dụng.</p>\r\n\r\n<p style="margin: 0px 0px 15px; font-size: 14.4px; color: rgb(64, 64, 64); font-family: Helvetica, Arial, sans-serif; line-height: 19px; text-align: justify;"><span style="color:#8B4513;"><b>Mâm nhiệt rời</b></span><br />\r\nẤm sử dụng mâm nhiệt rời, bộ phận cảm biến nhiệt được làm bằng thép không gỉ dạng trục xoay có thể xoay 360 độ tiện lợi cho người sử dụng, đồng thời cũng rất an toàn và giảm tình trạng hỏng hóc hoặc ăn mòn theo thời gian.</p>\r\n\r\n<p style="margin: 0px 0px 15px; font-size: 14.4px; color: rgb(64, 64, 64); font-family: Helvetica, Arial, sans-serif; line-height: 19px; text-align: justify;"><span style="color:#8B4513;"><b>Tự ngắt điện khi sôi</b></span><br />\r\nẤm có chế độ tự ngắt điện an toàn khi có sự cố về điện hoặc nhiệt, và tự ngắt điện khi nước sôi đủ 100 độ, giúp hạn chế tối đa tình trạng hư hại ấm.</p>\r\n\r\n<p style="margin: 0px 0px 15px; font-size: 14.4px; color: rgb(64, 64, 64); font-family: Helvetica, Arial, sans-serif; line-height: 19px; text-align: justify;"><img alt="mych.vn ấm siêu tốc tiross ts486" height="400" src="http://mych.vn/vubaohuy/upload/images/AM%20SIEU%20TOC/AST%20TIROSS%20TS486%20b.jpg" width="400" /></p>\r\n', '', '', '', '', '', '', 1, 1, 1459390671, 1464251878, 0),
(258, 40, 20, 56, 0, '', 0, 0, '', '', 'product', 0, 0, 'ast-tiross-ts496-7297.jpg', 'ast-tiross-ts496-7297_195x195.jpg', 'Ấm siêu tốc Tiross TS496', 'TS496', 'am-sieu-toc-tiross-ts496', '', '', '1850 - 2200', 'RPC', 1700, 0, '12 Tháng', '', 'Ấm siêu tốc Tiross TS496', 'ấm siêu tốc tiross ts496, ấm siêu tốc tiross, ấm siêu tốc, bình siêu tốc, ấm siêu tốc nhựa, ấm siêu tốc inox, bình đun nước, ấm đun nước điện, ấm đun nước', 'Vỏ ấm được làm bằng chất liệu thủy tinh trong suốt. Ấm sử dụng mâm nhiệt rời, hiển thị rõ ràng giúp người sử dụng chủ động điều chỉnh lượng nước.Ngắt điện khi sôi', 0, 0, 855000, 0, 'Vỏ ấm được làm bằng chất liệu thủy tinh trong suốt. Ấm sử dụng mâm nhiệt rời, hiển thị rõ ràng giúp người sử dụng chủ động điều chỉnh lượng nước.Ngắt điện khi sôi', '<p><span style="font-size:20px;"><strong><a href="http://mych.vn/do-dien-gia-dung/am-sieu-toc-may-pha-ca-phe"><span style="color:#0000CD;">Ấm siêu tốc</span></a></strong> <strong><span style="color:#8B4513;">Tiross TS496</span></strong></span></p>\r\n\r\n<p><span style="color:#0000CD;"><b style="font-size: 14.4px; color: rgb(64, 64, 64); font-family: Helvetica, Arial, sans-serif; line-height: 22.8px; text-align: justify; margin: 0px; padding: 0px;">TÍNH NĂNG NỔI BẬT</b></span><br style="color: rgb(119, 119, 119); font-family: Arial; font-size: 14.4px; line-height: normal;" />\r\n<span style="color:#8B4513;"><b style="font-size: 14.4px; margin: 0px; padding: 0px; color: rgb(64, 64, 64); font-family: Helvetica, Arial, sans-serif; line-height: 22.8px; text-align: justify;">Thiết kế sang trọng</b></span><br style="font-size: 14.4px; margin: 0px; padding: 0px; color: rgb(64, 64, 64); font-family: Helvetica, Arial, sans-serif; line-height: 22.8px; text-align: justify;" />\r\n<span style="font-size: 14.4px; color: rgb(64, 64, 64); font-family: Helvetica, Arial, sans-serif; line-height: 22.8px; text-align: justify;">Vỏ ấm được làm bằng chất liệu thủy tinh trong suốt kết hợp với gam màu đen bạc ở thân và tay cầm