2.8px; text-align: justify;" />\r\n<b style="font-size: 14.4px; margin: 0px; padding: 0px; color: rgb(64, 64, 64); font-family: Helvetica, Arial, sans-serif; line-height: 22.8px; text-align: justify;">Ngắt điện khi sôi</b><br style="font-size: 14.4px; margin: 0px; padding: 0px; color: rgb(64, 64, 64); font-family: Helvetica, Arial, sans-serif; line-height: 22.8px; text-align: justify;" />\r\n<span style="font-size: 14.4px; color: rgb(64, 64, 64); font-family: Helvetica, Arial, sans-serif; line-height: 22.8px; text-align: justify;">Hạn chế tình trạng cạn nước gây ra hư hại ấm.</span></p>\r\n\r\n<p><span style="font-size: 14.4px; color: rgb(64, 64, 64); font-family: Helvetica, Arial, sans-serif; line-height: 22.8px; text-align: justify;"><img alt="mych.vn ấm siêu tốc tiross ts496" height="400" src="http://mych.vn/vubaohuy/upload/images/AM%20SIEU%20TOC/AST%20TIROSS%20TS496%20b.jpg" width="400" /></span></p>\r\n', '', '', '', '', '', '', 1, 1, 1459392833, 1464251538, 0),
