(260, 40, 20, 56, 0, '', 0, 0, '', '', 'product', 0, 0, 'pcp-tiross-ts620-b-1346.jpg', 'pcp-tiross-ts620-b-1346_195x195.jpg', 'Máy pha cà phê Tiross TS620', 'TS620', 'may-pha-ca-phe-tiross-ts620', '', '', '800', 'RPC', 0, 0, '12 Tháng', '', 'Máy pha cà phê Tiross TS620', 'máy pha cà phê, máy pha cà phê tiross ts620, máy pha cà phê giá rẻ, máy pha cà phê cappuccino, máy pha cà phê cao cấp', '- Máy chuyên pha cà phê dùng cho gia đính hay nơi công sở\r\n- Một lần pha có thể cho ra được 4 cốc cà phê thơm ngon đặc biệt\r\n- Sử dụng màn lọc lưới inox,Có van an toàn.\r\n- Hệ thống chống nhỏ giọt:,Chức năng chọn chuyển đổi chế độ.\r\n- Chức năng chống chảy nhỏ giọt.', 0, 0, 1090000, 0, '- Máy chuyên pha cà phê dùng cho gia đính hay nơi công sở\r\n- Một lần pha có thể cho ra được 4 cốc cà phê thơm ngon đặc biệt\r\n- Sử dụng màn lọc lưới inox,Có van an toàn.\r\n- Hệ thống chống nhỏ giọt:,Chức năng chọn chuyển đổi chế độ.\r\n- Chức năng chống chảy nhỏ giọt.\r\n', '<p style="margin: 5px 0px; color: rgb(119, 119, 119); font-family: Arial; line-height: 21px; padding: 5px; text-align: justify;"><span style="font-size:20px;"><strong><a href="http://mych.vn/do-dien-gia-dung/am-sieu-toc-may-pha-ca-phe"><span style="color:#0000CD;">Máy pha cà phê</span></a></strong> <span style="color:#8B4513;"><strong>Tiross TS620</strong></span></span></p>\r\n\r\n<p style="margin: 5px 0px; color: rgb(119, 119, 119); font-family: Arial; line-height: 21px; padding: 5px; text-align: justify;"><span style="font-size:16px;">- Pha chế thức uống mang phong cách Italy Coffee: Bên cạnh chức năng pha espresso, cà phê thường; máy được tích hợp vòi phun để tạo bọt sữa cho cappuccino chuẩn. Bạn có thể đựng cà phê trực tiếp vào cốc hay bình chứa thủy tinh đi kèm.</span></p>\r\n\r\n<p style="margin: 5px 0px; color: rgb(119, 119, 119); font-family: Arial; line-height: 21px; padding: 5px; text-align: justify;"><span style="font-size:16px;">- Sử dụng màn lọc lưới inox: Màng lọc lưới inox dễ vệ sinh và không phải thay thế sau mỗi lần sử dụng như màng lọc giấy.</span></p>\r\n\r\n<p style="margin: 5px 0px; color: rgb(119, 119, 119); font-family: Arial; line-height: 21px; padding: 5px; text-align: justify;"><span style="font-size:16px;">- Hệ thống chống nhỏ giọt: Hệ thống chống nhỏ giọt giúp giữ vệ sinh máy mỗi khi bạn lấy bình đựng cà phê ra ngoài trong khi pha.</span></p>\r\n\r\n<p style="margin: 5px 0px; color: rgb(119, 119, 119); font-family: Arial; line-height: 21px; padding: 5px; text-align: justify;"><span style="font-size:16px;">- Thiết kế sang trọng: Máy có thiết kế hiện đại kết hợp hài hòa 2 gam màu đen và bạc, mang đến sự sang trọng cho phòng bếp gia đình hay văn phòng công ty.</span></p>\r\n\r\n<p style="margin: 5px 0px; color: rgb(119, 119, 119); font-family: Arial; line-height: 21px; padding: 5px; text-align: justify;"><span style="font-size:16px;">- Pha được 1 ~ 4 tách cà phê/1 lần.</span></p>\r\n\r\n<p style="margin: 5px 0px; color: rgb(119, 119, 119); font-family: Arial; line-height: 21px; padding: 5px; text-align: justify;"><img alt="mych.vn máy pha cà phê tiross ts620" height="400" src="http://mych.vn/vubaohuy/upload/images/AM%20SIEU%20TOC/PCP%20TIROSS%20TS620.jpg" width="400" /></p>\r\n\r\n<p style="margin: 5px 0px; color: rgb(119, 119, 119); font-family: Arial; line-height: 21px; padding: 5px; text-align: justify;"><span style="font-size:16px;">- Có bình chứa cà phê bằng thủy tinh hoặc có thể đựng trực tiếp vào bình chứa bất kỳ hay trực tiếp vào cốc.</span></p>\r\n\r\n<p style="margin: 5px 0px; color: rgb(119, 119, 119); font-family: Arial; line-height: 21px; padding: 5px; text-align: justify;"><span style="font-size:16px;">- Xoay vòi phun để tạo bọt sữa cho cappuccino chuẩn.</span></p>\r\n\r\n<p style="margin: 5px 0px; color: rgb(119, 119, 119); font-family: Arial; line-height: 21px; padding: 5px; text-align: justify;"><span style="font-size:16px;">- Phần đo lường dễ dàng cà phê.</span></p>\r\n\r\n<p style="margin: 5px 0px; color: rgb(119, 119, 119); font-family: Arial; line-height: 21px; padding: 5px; text-align: justify;"><span style="font-size:16px;">- Có van an toàn.</span></p>\r\n\r\n<p style="margin: 5px 0px; color: rgb(119, 119, 119); font-family: Arial; line-height: 21px; padding: 5px; text-align: justify;"><span style="font-size: 16px;">- Chức năng chống chảy nhỏ giọt.</span></p>\r\n\r\n<p style="margin: 5px 0px; color: rgb(119, 119, 119); font-family: Arial; line-height: 21px; padding: 5px; text-align: justify;"><span style="font-size:16px;">- Công tắc nguồn có đèn chỉ thị.</span></p>\r\n', '', '', '', '', '', '', 1, 1, 1459406886, 1464250647, 0),
