(262, 40, 20, 56, 0, '', 0, 0, '', '', 'product', 0, 0, 'xcp-tiross-ts530-5614.jpg', 'xcp-tiross-ts530-5614_195x195.jpg', 'Máy xay cà phê Tiross TS530', 'TS530', 'may-xay-ca-phe-tiross-ts530', '', '', '150', 'RPC', 0, 0, '12 Tháng', '', 'Máy xay cà phê Tiross TS530', 'máy xay cà phê, máy xay cà phê tiross ts530, máy xay cà phê gia đình, máy xay cà phê giá rẻ', ' Máy Xay được 50g/ lần xay, máy được thiết kế với vỏ bọc inox siêu bền .Lưỡi dao được làm bằng thép không gỉ cao cấp .Xay đa năng nhiều loại hạt: cà phê, đỗ xanh, đỗ tương, điều,hạt tiêu .........', 0, 0, 509000, 0, ' Máy Xay được 50g/ lần xay, máy được thiết kế với vỏ bọc inox siêu bền .Lưỡi dao được làm bằng thép không gỉ cao cấp .Xay đa năng nhiều loại hạt: cà phê, đỗ xanh, đỗ tương, điều,hạt tiêu .........', '<p style="margin: 0px; color: rgb(119, 119, 119); font-family: Arial; font-size: 14.4px; line-height: normal;"><span style="font-size:20px;"><a href="http://mych.vn/do-dien-gia-dung/am-sieu-toc-may-pha-ca-phe">Máy xay cà phê</a> <span style="color:#8B4513;"><strong>Tiross TS530</strong></span></span></p>\r\n\r\n<p style="margin: 0px; color: rgb(119, 119, 119); font-family: Arial; font-size: 14.4px; line-height: normal;"> </p>\r\n\r\n<p style="margin: 0px; color: rgb(119, 119, 119); font-family: Arial; font-size: 14.4px; line-height: normal;">- Máy xay cà phê Tiross TS530 được thiết kế nhỏ gọn cơ động, linh hoạt.</p>\r\n\r\n<p style="margin: 0px; color: rgb(119, 119, 119); font-family: Arial; font-size: 14.4px; line-height: normal;">- Lưỡi dao được làm bằng thép không gỉ cao cấp cùng động cơ mạnh mẽ giúp bạn xay mịn hạt cà phê một cách nhanh chóng.</p>\r\n\r\n<p style="margin: 0px; color: rgb(119, 119, 119); font-family: Arial; font-size: 14.4px; line-height: normal;">- Phần lắp được thiết kế bằng nhựa cao cấp trong suốt giúp người sử dụng có thể theo dõi độ mịn của hạt.</p>\r\n\r\n<p style="margin: 0px; color: rgb(119, 119, 119); font-family: Arial; font-size: 14.4px; line-height: normal;">- Xay đa năng nhiều loại hạt: cà phê, đỗ xanh, đỗ tương, điều,hạt tiêu .........</p>\r\n\r\n<p style="margin: 0px; color: rgb(119, 119, 119); font-family: Arial; font-size: 14.4px; line-height: normal;">- Máy Xay được 50g/ lần xay</p>\r\n\r\n<p style="margin: 0px; color: rgb(119, 119, 119); font-family: Arial; font-size: 14.4px; line-height: normal;">- Máy được thiết kế với vỏ bọc inox siêu bền sang trọng.</p>\r\n\r\n<p style="margin: 0px; color: rgb(119, 119, 119); font-family: Arial; font-size: 14.4px; line-height: normal;"> </p>\r\n\r\n<p style="margin: 0px; color: rgb(119, 119, 119); font-family: Arial; font-size: 14.4px; line-height: normal;"><img alt="mych.vn máy xay cà phê tiross ts530" height="400" src="http://mych.vn/vubaohuy/upload/images/AM%20SIEU%20TOC/XCP%20TIROSS%20TS530.jpg" width="400" /></p>\r\n', '', '', '', '', '', '', 1, 1, 1459407681, 1464249799, 0),
(263, 40, 20, 56, 0, '', 0, 0, '', '', 'product', 0, 0, 'xcp-tiross-ts532-2097.jpg', 'xcp-tiross-ts532-2097_195x195.jpg', 'Máy xay cà phê Tiross TS532', 'TS532', 'may-xay-ca-phe-tiross-ts532', '', '', '150', 'RPC', 0, 0, '', '', 'Máy xay cà phê Tiross TS532', 'máy xay cà phê, máy xay cà phê tiross ts532, máy xay cà phê gia đình, máy xay cà phê giá rẻ', 'Máy Xay được 50g/ lần xay.Lưỡi dao được làm bằng thép không gỉ cao cấp, Máy được thiết kế với vỏ bọc inox siêu bền .Xay đa năng nhiều loại hạt: cà phê, đỗ xanh, đỗ tương, điều,hạt tiêu .........', 0, 0, 509000, 0, ' Máy Xay được 50g/ lần xay.Lưỡi dao được làm bằng thép không gỉ cao cấp, Máy được thiết kế với vỏ bọc inox siêu bền .Xay đa năng nhiều loại hạt: cà phê, đỗ xanh, đỗ tương, điều,hạt tiêu .........', '<p style="margin: 0px; color: rgb(119, 119, 119); font-family: Arial; font-size: 14.4px; line-height: normal;"><span style="font-size:20px;"><a href="http://mych.vn/do-dien-gia-dung/am-sieu-toc-may-pha-ca-phe">Máy xay cà phê</a> <strong><span style="color:#8B4513;">Tiross TS532</span></strong></span></p>\r\n\r\n<p style="margin: 0px; color: rgb(119, 119, 119); font-family: Arial; font-size: 14.4px; line-height: normal;"> </p>\r\n\r\n<p style="margin: 0px; color: rgb(119, 119, 119); font-family: Arial; font-size: 14.4px; line-height: normal;">- Máy xay cà phê Tiross TS532 được thiết kế nhỏ gọn cơ động, linh hoạt.</p>\r\n\r\n<p style="margin: 0px; color: rgb(119, 119, 119); font-family: Arial; font-size: 14.4px; line-height: normal;">- Lưỡi dao được làm bằng thép không gỉ cao cấp cùng động cơ mạnh mẽ giúp bạn xay mịn hạt cà phê một cách nhanh chóng.</p>\r\n\r\n<p style="margin: 0px; color: rgb(119, 119, 119); font-family: Arial; font-size: 14.4px; line-height: normal;">- Phần lắp được thiết kế bằng nhựa cao cấp trong suốt giúp người sử dụng có thể theo dõi độ mịn của hạt.</p>\r\n\r\n<p style="margin: 0px; color: rgb(119, 119, 119); font-family: Arial; font-size: 14.4px; line-height: normal;">- Xay đa năng nhiều l