(266, 41, 20, 57, 0, '', 0, 0, '', '', 'product', 0, 0, 'mst-tiross-ts429-4592.jpg', 'mst-tiross-ts429-4592_195x195.jpg', 'Máy sấy tóc Tiross TS429', 'TS429', 'may-say-toc-tiross-ts429', '', '', '1200', 'RPC', 0, 0, '', '', 'Máy sấy tóc Tiross TS429', 'máy sấy tóc tiross ts429, máy sấy tóc tiross, máy sấy tóc, máy sấy tóc giá rẻ, máy sấy tóc đa năng', 'Máy sấy tóc Tiross TS429 có đầu sấy được thiết kế độc đáo, Hai mức điều chỉnh chế độ sấy, vận hành êm ái, độ ồn thấp ,nút điều khiển được đặt ở giữa, thuận tiện khi sử dụng bằng cả tay trái hoặc tay phải.', 0, 0, 279000, 0, 'Máy sấy tóc Tiross TS429 có đầu sấy được thiết kế độc đáo, Hai mức điều chỉnh chế độ sấy, vận hành êm ái, độ ồn thấp ,nút điều khiển được đặt ở giữa, thuận tiện khi sử dụng bằng cả tay trái hoặc tay phải.', '<p style="margin: 0px; color: rgb(119, 119, 119); font-family: Arial; font-size: 14.4px; line-height: normal;"><span style="font-size:20px;"><span style="color:#0000CD;"><strong>Máy sấy tóc </strong></span><span style="color:#8B4513;"><strong>Tiross TS429</strong></span><span style="color:#0000CD;"><strong> : </strong></span></span><span style="font-size:16px;"><span style="color:#000000;"><span style="font-family: Arial, Helvetica, sans-serif; line-height: normal;">Thiết kế đầu sấy hẹp cho luồng sấy tập trung giúp làm khô tóc nhanh chóng cũng như tạo nhiều kiểu dáng hơn. Máy có nhiều lựa chọn cho chế độ và tốc độ sấy giúp người dùng có thể lựa chọn chế độ phù hợp với loại tóc và nhu cầu của mình nhất. Mái tóc được làm đẹp mà vẫn đảm bảo mềm mại, hạn chế tình trạng tóc bị xơ, gãy.</span></span></span></p>\r\n\r\n<p style="margin: 0px; color: rgb(119, 119, 119); font-family: Arial; font-size: 14.4px; line-height: normal;"> </p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="color:#8B4513;"><span style="font-size:18px;"><span style="box-sizing: border-box;"><span style="box-sizing: border-box; font-weight: 700;">Thông tin sản phẩm</span></span></span></span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="font-size:16px;"><span style="box-sizing: border-box; font-weight: 700;">Thiết kế đầu sấy độc đáo:</span></span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="font-size:16px;">-  có đầu sấy được thiết kế độc đáo để tạo luồng khí mạnh và tập trung giúp làm khô tóc thật nhanh chóng nhưng vẫn đảm bảo cho mái tóc khỏe mạnh, bồng bềnh và cuốn hút.</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="font-size:16px;"><span style="box-sizing: border-box; font-weight: 700;">Hai mức điều chỉnh chế độ sấy:</span></span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="font-size:16px;">- Hai mức điều chỉnh chế độ sấy, cho phép bạn tùy ý lựa chọn chế độ sấy phù hợp nhất với loại tóc và nhu cầu của mình.</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="font-size:16px;"><span style="box-sizing: border-box; font-weight: 700;">Chế độ tự ngắt khi quá tải:</span></span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="font-size:16px;">- Máy sấy Tiross TS429 có chế độ tự ngắt khi quá tải nhằm đem lại sự an toàn cho người sử dụng và duy trì độ bền cho máy.</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="font-size:16px;"><span style="box-sizing: border-box; font-weight: 700;">Thiết kế trang nhã và tiện dụng:</span></span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="font-size:16px;">- Sản phẩm có thiết kế trang nhã, hiện đại, kích thước nhỏ gọn với móc treo tiện lợi và tay cầm có thể dễ dàng gấp lại được. Bên cạnh đó, nút điều khiển được đặt ở giữa, thuận tiện khi sử dụng bằng cả tay trái hoặc tay phải.</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="font-size:16px;"><span style="box-sizing: border-box; font-weight: 700;">Máy vận hành êm:</span></span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="font-size:16px;">- Tiross TS429 vận hành êm ái, độ ồn thấp, mang lại sự thoải mái cho bạn khi sử dụng.</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="font-size:16px;">- Nút điều khiển đặt ở giữa, tiện dùng cả hai tay trái và tay phải, và có móc treo tiện lợi.</span></p>\r\n\r\n<p style="margin: 0px 0px 15px; padding: 0px; color: rgb(64, 64, 64); font-family: Helvetica, Arial, sans-serif; font-size: 12px; line-height: 22.8px; text-align: justify;"><img alt="mych.vn máy sấy tốc tiross ts429" height="400" src="http://mych.vn/vubaohuy/upload/images/MAY%20SAY%20TOC%2C%20BAN%20UI/MST%20TIROSS%20TS429%20f.jpg" width="400" /></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="box-sizing: border-box; font-weight: 700;">Thông số kỹ thuật:</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;">- Điện áp: 220V.</p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;">- Công suất: 1200W.</p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;">- Bảo hành: 12 tháng.</p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;">- Xuất xứ: Tiross Ba Lan sản xuất tại Trung Quốc.</p>\r\n', '', '', '', '', '', '', 1, 1, 1459566261, 1464317112, 0),
(267, 41, 20, 57, 0, '', 0, 0, '', '', 'product', 0, 0, 'mst-tiross-ts432-8321.jpg', 'mst-tiross-ts432-8321_195x195.jpg', 'Máy sấy tóc Tiross TS432', 'TS432', 'may-say-toc-tiross-ts432', '', '', '1500', 'RPC', 0, 0, '12 Tháng', '', 'Máy sấy tóc Tiross TS432', 'máy sấy tóc tiross ts432, máy sấy tóc tiross, máy sấy tóc, máy sấy tóc giá rẻ, máy sấy tóc đa năng', 'công xuất 1500W ,khi xoáy 360độ , 2 chế độ sấy khác nhau. Tiross TS432 vận hành êm ái, độ ồn thấp,  tiện dùng cả hai tay trái và tay phải và có móc treo tiện lợi.', 0, 0, 359000, 0, 'công xuất 1500W ,khi xoáy 360độ , 2 chế độ sấy khác nhau. Tiross TS432 vận hành êm ái, độ ồn thấp,  tiện dùng cả hai tay trái và tay phải và có móc treo tiện lợi.', '<p style="margin: 0px; color: rgb(119, 119, 119); font-family: Arial; font-size: 14.4px; line-height: normal;"><span style="color:#8B4513;"><span style="font-size:20px;"><strong>Máy sấy tóc</strong></span></span><span style="color:#0000CD;"><span style="font-size:20px;"><strong> Tiross TS432 :</strong></span></span><span style="color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans-serif; font-size: 16px;"> là một sản phẩm không thể thiếu trong gia đình. Với thiết kế đầu sấy tạo luồng khí xoáy 360 độ giúp trải đều hơi nóng trên phạm vi rộng, mái tóc ướt nhanh chóng được làm khô mà khô và hiệu quả. Ngoài ra bạn có thể dùng máy để tạo những kiểu tóc đơn giản với lô cuốn hay lược tròn, giúp làm phồng chân tóc, uốn giả... Với kích thước nhỏ gọn và thiết kế hiện đại, tiện dụng. Nút điều khiển được đặt ở giữa, thuận tiện khi sử dụng bằng cả tay trái hoặc tay phải.</span></p>\r\n\r\n<p style="margin: 0px 0px 15px; padding: 0px; color: rgb(64, 64, 64); font-family: Helvetica, Arial, sans-serif; font-size: 12px; line-height: 22.8px; text-align: justify;"><span style="color:#0000CD;"><span style="font-size:18px;"><span style="font-family: Arial, Helvetica, sans-serif; font-weight: 700; line-height: normal;">Thông tin sản phẩm</span></span></span></p>\r\n\r\n<p style="box-sizi