(278, 44, 20, 60, 0, '', 0, 0, '', '', 'product', 1, 0, 'etc-tiross-ts830-7378.jpg', 'etc-tiross-ts830-7378_195x195.jpg', 'Máy ép trái cây Tiross TS830', 'TS830', 'may-ep-trai-cay-tiross-ts830', '', '', '600', 'RPC', 1200, 0, '12 Tháng', '', 'Máy ép trái cây Tiross TS830', 'máy ép trái cây tiross ts830, máy ép trái cây tiross, máy ép trái cây, máy ép trái cây giá rẻ', 'Máy ép trái cây Tiross TS830 : công suất 600W, 2 tốc độ ,Chất liệu inox chống oxy hóa không gỉ, không bị ăn mòn .Có công tắc khóa an toàn, tiết kiệm thời gian, năng lượng.\r\n', 0, 0, 1890000, 0, 'Máy ép trái cây Tiross TS830 : công suất 600W, 2 tốc độ ,Chất liệu inox chống oxy hóa không gỉ, không bị ăn mòn .Có công tắc khóa an toàn, tiết kiệm thời gian, năng lượng.\r\n', '<p style="margin: 0px; color: rgb(119, 119, 119); font-family: Arial; font-size: 14.4px; line-height: normal;"><span style="font-size:20px;"><strong><a href="http://mych.vn/do-dien-gia-dung/may-ep-trai-cay-may-xay-sinh-to-may-xay-thit"><span style="color:#0000CD;">Máy ép trái cây</span></a></strong> <strong><span style="color:#8B4513;">Tiross TS830 :</span></strong></span></p>\r\n\r\n<p style="margin: 0px; color: rgb(119, 119, 119); font-family: Arial; font-size: 14.4px; line-height: normal;"> </p>\r\n\r\n<p style="margin: 0px; color: rgb(119, 119, 119); font-family: Arial; font-size: 14.4px; line-height: normal;"><span style="font-size:18px;"><strong><span style="color:#8B4513;"><span style="font-family: \'Times New Roman\';">Tính năng nổi bật :</span></span></strong></span></p>\r\n\r\n<p style="margin: 0px; color: rgb(119, 119, 119); font-family: Arial; font-size: 14.4px; line-height: normal;"><span style="font-size:18px;"><span style="color:#000000;"><span style="font-family: \'Times New Roman\';">- <span style="line-height: 21px; text-align: justify;">Với thiết kế nhỏ gọn, công suất 600W, 2 tốc độ, các bộ phận dễ dàng tháo lắp và cách vệ sinh đơn giản phù hợp cho gia đình sử dụng.</span></span></span></span></p>\r\n\r\n<p style="margin: 0px; color: rgb(119, 119, 119); font-family: Arial; font-size: 14.4px; line-height: normal;"><span style="font-size:18px;"><span style="color:#000000;"><span style="font-family: \'Times New Roman\';">- <span style="line-height: 21px; text-align: justify;">Cối xay được làm bằng chất liệu nhựa bền mang đến tính thẩm mỹ và bảo đảm độ bền cao. Chất liệu inox chống oxy hóa có độ bền cao, không gỉ, không bị ăn mòn và mang đến độ sắc bén cho lưỡi dao, giúp ép nhanh.</span></span></span></span></p>\r\n\r\n<p style="margin: 0px; color: rgb(119, 119, 119); font-family: Arial; font-size: 14.4px; line-height: normal;"><span style="font-size:18px;"><span style="color:#000000;"><span style="font-family: \'Times New Roman\';"><span style="line-height: 21px; text-align: justify;">- Máy có khả năng ép nguyên trái nhờ hệ thống ống đặt trái cây lớn kết hợp với mâm ép sắc bén cho bạn ép nguyên củ cà rốt, cà chua cỡ vừa mà không cần cắt nhỏ. Có công tắc khóa an toàn, Motor điện tốc độ cao với bộ phận bảo vệ quá nhiệt, hiệu quả cao, tiết kiệm thời gian, năng lượng.</span></span></span></span></p>\r\n\r\n<p style="margin: 0px; color: rgb(119, 119, 119); font-family: Arial; font-size: 14.4px; line-height: normal;"><span style="color:#000000;"><span style="font-size: larger;"><span style="font-family: \'Times New Roman\';"><span style="line-height: 21px; text-align: justify;"><img alt="mych.vn máy ép trái cây tiross ts830" height="400" src="http://mych.vn/vubaohuy/upload/images/MAY%20XAY%20SINH%20TO%2C%20MAY%20EP%20TRAI%20CAY/ETC%20TIROSS%20TS830%20c.jpg" width="400" /></span></span></span></span></p>\r\n\r\n<p style="margin: 0px; color: rgb(119, 119, 119); font-family: Arial; font-size: 14.4px; line-height: normal;"> </p>\r\n', '', '', '', '', '', '', 1, 1, 1459585840, 1464577029, 0),
(279, 44, 20, 60, 0, '', 0, 0, '', '', 'product', 0, 0, 'xst-tiross-ts5247-b-5266.jpg', 'xst-tiross-ts5247-b-5266_195x195.jpg', 'Máy xay sinh tố Tiross TS5247', 'TS5247', 'may-xay-sinh-to-tiross-ts5247', '', '', '500', 'RPC', 1500, 0, '12 Tháng', '', 'Máy xay sinh tố Tiross TS5247', 'máy xay sinh tố, máy xay sinh tố tiross ts5247, máy xay sinh tố tiross, máy xay sinh tố giá rẻ', 'dung tích 1,5L, công xuất 500,  chức năng điều chỉnh những mức độ xay , làm từ thủy tinh và nhựa cao cấp . Sp phẩm cao cấp, gồm 3 tốc độ xay khác nhau và 2 cối xay.', 0, 0, 1015000, 0, 'dung tích 1,5L, công xuất 500,  chức năng điều chỉnh những mức độ xay , làm từ thủy tinh và nhựa cao cấp . Sp phẩm cao cấp, gồm 3 tốc độ xay khác nhau và 2 cối xay.', '<p style="margin: 0px; color: rgb(119, 119, 119); font-family: Arial; font-size: 14.4px; line-height: normal;"><span style="font-size:20px;"><a href="http://mych.vn/do-dien-gia-dung/may-ep-trai-cay-may-xay-sinh-to-may-xay-thit"><span style="color:#0000CD;">Máy xay sinh tố</span></a> <strong><span style="color:#8B4513;">Tiross TS5247</span></strong></span></p>\r\n\r\n<p style="margin: 0px; color: rgb(119, 119, 119); font-family: Arial; font-size: 14.4px; line-height: normal;"> </p>\r\n\r\n<p style="margin: 0px; color: rgb(119, 119, 119); font-family: Arial; font-size: 14.4px; line-height: normal;"><span style="font-size:16px;"><span style="color:#000000;"><span style="font-weight: bold;">Hai cối xay tiện dụng</span></span></span></p>\r\n\r\n<p style="margin: 0px; color: rgb(119, 119, 119); font-family: Arial; line-height: normal; font-size: 12px;"><span style="font-size:16px;"><span style="color:#000000;">Máy được trang bị hai cối xay, giúp bạn xay được những nhóm thực phẩm khác nhau.</span></span></p>\r\n\r\n<p style="margin: 0px; color: rgb(119, 119, 119); font-family: Arial; line-height: normal; font-size: 12px;"><span style="font-size:16px;"><span style="color:#000000;">Gồm cối xay to bằng thủy tinh ,dung tích lên đến 1,5L và cối xay nhỏ để xay đồ khô rất tiện dụng.</span></span></p>\r\n\r\n<p style="margin: 0px; color: rgb(119, 119, 119); font-family: Arial; line-height: normal; font-size: 12px;"><span style="font-size:16px;"><span style="color:#000000;"><strong>Nút điều khiển dễ dàng</strong><br />\r\nVới nút vặn tiện dụng, bạn có thể dễ dàng điều chỉnh những mức độ xay khác nhau tùy thuộc vào từng loại sản phẩm.</span></span></p>\r\n\r\n<p style="margin: 0px; color: rgb(119, 119, 119); font-family: Arial; line-height: normal; font-size: 12px;"><span style="font-size:16px;"><span style="color:#000000;"><span style="font-weight: bold;">Động cơ bền bỉ mạnh mẽ</span></span></span></p>\r\n\r\n<p style="margin: 0px; color: rgb(119, 119, 119); font-family: Arial; line-height: normal; font-size: 12px;"><span style="font-size:16px;"><span style="color:#000000;">Máy được thiết kế với công suất lên đến 500w giúp bạn xay thực phẩm 1 cách dễ dàng.</span></span></p>\r\n\r\n<p style="margin: 0px; color: rgb(119, 119, 119); font-family: Arial; line-height: normal; font-size: 12px;"><span style="font-size:16px;"><span style="color:#000000;"><strong>Dễ dàng vệ sinh máy</strong><br />\r\nCối xay được làm từ thủy tinh và nhựa cao cấp, rất thuận tiện cho việc vệ sinh máy.</span></span></p>\r\n\r\n<p style="margin: 0px; color: rgb(119, 119, 119); font-family: Arial; line-height: normal; font-size: 12px;"><span style="font-size:16px;"><span style="color:#000000;"><strong>Thiết kế hiện đại</strong></span></span></p>\r\n\r\n<p style="margin: 0px; color: rgb(119, 119, 119); font-family: Arial; line-height: normal; font-size: 12px;"><span style="font-size:16px;"><span style="color:#000000;">Sản phẩm được thiết kê theo phong cách hiện đại trẻ trung với hai màu sắc đen và trắng.</span></span></p>\r\n\r\n<p style="margin: 0px; color: rgb(119, 119, 119); font-family: Arial; line-height: normal; font-size: 12px;"><span style="font-size: medium;"><img alt="mych.vn máy xay sinh tố tiross ts5247" height="400" src="http://mych.vn/vubaohuy/upload/images/MAY%20XAY%20SINH%20TO%2C%20MAY%20EP%20TRAI%20CAY/XST%20TIROSS%20TS5247.jpg" width="400" /></span></p>\r\n', '', '', '', '', '', '', 1, 1, 1459586191, 1464576809, 0),
(280, 44, 20, 60, 0, '', 0, 0, '', '', 'product', 0, 0, 'xt-tiross-ts5248-d-2588.jpg', 'xt-tiross-ts5248-d-2588_195x195.jpg', 'Máy xay thịt Tiross TS5248', 'TS5248', 'may-xay-thit-tiross-ts5248', '', '', '300', 'RPC', 1200, 0, '12 Tháng', '', 'Máy xay thịt Tiross TS5248', 'máy xay thịt, máy xay thịt tiross ts5248, máy xay thịt tiross, máy xay thịt giá rẻ', ' Cối xay dung tích 1,2L, công suất 300W ,sử dụng cho 400g thịt mỗi lần xay với lưỡi dao kép sản xuất từ thép không gỉ, sắc bén .Lưỡi dao xay và cối xay có thể tháo lắp dễ dàng', 0, 0, 690000, 0, ' Cối xay dung tích 1,2L, công suất 300W ,sử dụng cho 400g thịt mỗi lần xay với lưỡi dao kép sản xuất từ thép không gỉ, sắc bén .Lưỡi dao xay và cối xay có thể tháo lắp dễ dàng', '<p style="margin: 0px; color: rgb(119, 119, 119); font-family: Arial; font-size: 14.4px; line-height: normal;"><span style="font-size:20px;"><a href="http://mych.vn/do-dien-gia-dung/may-ep-trai-cay-may-xay-sinh-to-may-xay-thit"><span style="color:#0000CD;">Máy xay thịt</span></a> <strong><span style="color:#8B4513;">Tiross TS-5248</span></strong></span></p>\r\n\r\n<p style="margin: 0px; color: rgb(119, 119, 119); font-family: Arial; font-size: 14.4px; line-height: normal;"> </p>\r\n\r\n<p style="margin: 0px; color: rgb(119, 119, 119); font-family: Arial; font-size: 14.4px; line-height: normal;"><span style="color:#000000;"><span style="font-size:16px;"><span style="font-family: arial, helvetica, sans-serif;">-Máy xay thịt Tiross TS-5248 với thiết kế đẹp, sang trọng, dễ dàng sử dụng với một tốc độ xay. Máy hoạt động với công suất 300W, máy vận hành mạnh mẽ, không gây ồn. Ngoài chức năng xay thịt máy còn có khả năng xay được nhiều loại thực phẩm khác như: cá, gia vị, rau…. Sản phẩm thích hợp sử dụng cho 400g thịt mỗi lần xay, phù hợp với nhu cầu sử dụng trong gia đình.</span></span></span></p>\r\n\r\n<p style="margin: 0px; color: rgb(119, 119, 119); font-family: Arial; font-size: 14.4px; line-height: normal;"><span style="color:#000000;"><span style="font-size:16px;">-<span style="font-family: arial, helvetica, sans-serif;"> Được sản xuất từ những nguyên liệu cao cấp, có độ bền cao, an toàn cho sức khỏe người dùng. Cối xay dung tích 1,2L, được làm từ thuỷ tinh cao cấp, không độc hại, đảm bảo an toàn cho người dùng. Ngoài ra, chất liệu thuỷ tinh trong suất giúp bạn thuận tiện quan sát thực phẩm trong quá trình xay.</span></span></span></p>\r\n\r\n<p style="margin: 0px; color: rgb(119, 119, 119); font-family: Arial; font-size: 14.4px; line-height: normal;"><span style="color:#000000;"><span style="font-size:16px;"><span style="font-family: arial, helvetica, sans-serif;">-Máy được thiết kế với lưỡi dao kép sản xuất từ thép không gỉ, sắc bén, giúp nhanh chóng xay nhuyễn thực phẩm. Lưỡi dao xay và cối xay có thể tháo lắp dễ dàng, thuận lợi lau rửa sản phẩm sau khi sử dụng.</span></span></span></p>\r\n\r\n<p style="margin: 0px; color: rgb(119, 119, 119); font-family: Arial; font-size: 14.4px; line-height: normal;"> </p>\r\n\r\n<p style="margin: 0px; color: rgb(119, 119, 119); font-family: Arial; font-size: 14.4px; line-height: normal;"><span style="font-family: arial, helvetica, sans-serif; font-size: small;"><img alt="mych.vn máy xay thịt tiross ts-5248" height="400" src="http://mych.vn/vubaohuy/upload/images/MAY%20XAY%20SINH%20TO%2C%20MAY%20EP%20TRAI%20CAY/XT%20TIROSS%20TS5248.jpg" width="400" /></span></p>\r\n', '', '', '', '', '', '', 1, 1, 1459586440, 1464576149, 0),
(281, 45, 20, 61, 0, '', 0, 0, '', '', 'product', 0, 0, 'dt-tiross-ts5400-2039.jpg', 'dt-tiross-ts5400-2039_195x195.jpg', 'Máy đánh trứng Tiross TS5400', 'TS5400', 'may-danh-trung-tiross-ts5400', '', '', '300', 'RPC', 0, 0, '12 Tháng', '', 'Máy đánh trứng Tiross TS5400', 'máy đánh trứng, máy đánh trứng giá rẻ, máy đánh trứng tiross ts5400, máy đánh trứng tiross', ' -Công suất 300W,5 tốc độ hoạt động, trang bị 4 que, bao gồm 2 que trộn và 2 que mốc nhào (bột lỏng) làm bằng inox không gỉ .  Với chế độ Turbo máy hoạt động ở chế độ nhanh nhất ', 0, 0, 690000, 0, ' -Công suất 300W,5 tốc độ hoạt động, trang bị 4 que, bao gồm 2 que trộn và 2 que mốc nhào (bột lỏng) làm bằng inox không gỉ .  Với chế độ Turbo máy hoạt động ở chế độ nhanh nhất ', '<p style="margin: 0px; color: rgb(119, 119, 119); font-family: Arial; font-size: 14.4px; line-height: normal;"><span style="font-size:20px;"><strong><a href="http://mych.vn/do-dien-gia-dung/may-danh-trung-may-lam-sua-dau-nanh"><span style="color:#0000CD;">Máy đánh trứng</span></a></strong><span style="color:#0000CD;"> </span><span style="color:#8B4513;"><strong>Tiross TS5400 :</strong></span></span></p>\r\n\r\n<p style="margin: 0px; color: rgb(119, 119, 119); font-family: Arial; font-size: 14.4px; line-height: normal;"> </p>\r\n\r\n<p style="margin: 0px; color: rgb(119, 119, 119); font-family: Arial; font-size: 14.4px; line-height: normal;"><span style="color:#8B4513;"><span style="font-size:18px;"><u><strong>Tính năng nổi bật :</strong></u></span></span></p>\r\n\r\n<p style="margin: 0px; color: rgb(119, 119, 119); font-family: Arial; font-size: 14.4px; line-height: normal;"><span style="font-size:18px;"><span style="color: rgb(0, 0, 0);"><strong>- Que đánh làm bằng chất liệu inox cao cấp:</strong></span><br />\r\n<span style="color: rgb(64, 64, 64); font-family: helvetica, arial, sans-serif;">Máy đánh trứng </span><span style="color: rgb(64, 64, 64); font-family: helvetica, arial, sans-serif;">được trang bị 4 que, bao gồm 2 que trộn và 2 que mốc nhào (bột lỏng) làm bằng inox không gỉ cao cấp, đảm bảo chất lượng, vệ sinh cho hỗn hợp trứng và kem, bột. Bộ dụng cụ hữu hiệu dùng cho các chức năng đánh trứng, và các loại thực phẩm khác.</span></span></p>\r\n\r\n<p style="margin: 0px; color: rgb(119, 119, 119); font-family: Arial; font-size: 14.4px; line-height: normal;"><span style="font-size:18px;"><span style="color: rgb(0, 0, 0);"><span style="font-family: helvetica, arial, sans-serif;">-</span><strong>Máy được trang bị 5 tốc độ hoạt động:</strong></span><br />\r\n<span style="color: rgb(64, 64, 64); font-family: helvetica, arial, sans-serif;">Máy đánh trứng </span><strong>TIROSS TS5400 </strong><span style="color: rgb(64, 64, 64); font-family: helvetica, arial, sans-serif;">được trang 5 tốc độ hoạt động khác nhau với công suất 300W, giúp bạn dễ dàng tuỳ chỉnh mức độ đánh thích hợp tuỳ theo nhu cầu sử dụng</span><br />\r\n<span style="color: rgb(64, 64, 64); font-family: helvetica, arial, sans-serif;"> + Mức 1&2: Dùng cho thực phẩm dạng lỏng như cafe, sữa tươi..</span><br />\r\n<span style="color: rgb(64, 64, 64); font-family: helvetica, arial, sans-serif;"> + Mức 3&4: Dùng để trộn hỗn hợp lỏng như salad...</span><br />\r\n<span style="color: rgb(64, 64, 64); font-family: helvetica, arial, sans-serif;"> + Mức 5: Dùng trộn hỗn hợp để làm bánh, đồ ăn nhanh như bánh mỳ, bánh flan, trộn bơ với đường, thực phẩm còn sống, đường miến.. .</span></span></p>\r\n\r\n<p style="margin: 0px; color: rgb(119, 119, 119); font-family: Arial; font-size: 14.4px; line-height: normal;"><span style="font-size:18px;"><strong><span style="color: rgb(0, 0, 0);">- Động cơ siêu êm,bền bỉ mạnh mẽ</span> </strong>: Động cơ được thiết kế với công suất tới 300W và đặc biệt hoạt động rất êm ái, không rung lắc ở tốc độ cao.</span></p>\r\n\r\n<p style="margin: 0px; color: rgb(119, 119, 119); font-family: Arial; font-size: 14.4px; line-height: normal;"><span style="font-size:18px;"><span style="color: rgb(0, 0, 0);"><strong>- Chế độ TURBO : Với chế độ Turbo máy hoạt động ở chế độ nhanh nhất, khỏe nhất giúp việc nhào trộn trở lên nhanh chóng ,tiết kiệm thời gian .</strong></span></span></p>\r\n\r\n<p style="margin: 0px; color: rgb(119, 119, 119); font-family: Arial; font-size: 14.4px; line-height: normal;"><span style="color: rgb(0, 0, 0);"><strong><img alt="mych.vn máy đánh trứng tiross ts5400" height="400" src="http://mych.vn/vubaohuy/upload/images/MAY%20DANH%20TRUNG%2C%20MAY%20LAM%20SUA%20DAU%20NANH/DT%20TIROSS%20TS5400%20b.jpg" width="400" /></strong></span></p>\r\n', '', '', '', '', '', '', 1, 1, 1459586939, 1464580569, 0),
(282, 45, 20, 61, 0, '', 5, 44, '', '', 'product', 1, 0, 'lsdn-tiross-ts981-808.jpg', 'lsdn-tiross-ts981-808_195x195.jpg', 'Máy làm sữa đậu nành Tiross TS981', 'TS981', 'may-lam-sua-dau-nanh-tiross-ts981', '', '', '800', 'RPC', 800, 0, '12 Tháng', '', 'Máy làm sữa đậu nành Tiross TS981', 'máy làm sữa đậu nành, máy làm sữa đậu nành tiross ts981, máy làm sữa đậu nành giá rẻ', '- Dung tích: 0.8 Lít , Công suất đun: 800W ,Công suất xay: 200W , Nguồn điện: 220 - 240 V .Thân máy làm bằng nhựa cao cấp chịu nhiệt. Với các chức năng tự động: chống tràn, ngắt điện an toàn ,Sản phẩm đạt tiêu chuẩn EU.\r\n', 0, 0, 1995000, 0, '- Dung tích: 0.8 Lít , Công suất đun: 800W ,Công suất xay: 200W , Nguồn điện: 220 - 240 V .Thân máy làm bằng nhựa cao cấp chịu nhiệt. Với các chức năng tự động: chống tràn, ngắt điện an toàn ,Sản phẩm đạt tiêu chuẩn EU.\r\n', '<p style="margin: 0px; color: rgb(119, 119, 119); font-family: Arial; font-size: 14.4px; line-height: normal;"><span style="font-size:20px;"><strong><a href="http://mych.vn/do-dien-gia-dung/may-danh-trung-may-lam-sua-dau-nanh"><span style="color:#0000CD;">Máy làm sữa đậu nành</span></a> </strong><span style="color:#8B4513;"><strong>Tiross TS981 :</strong></span></span></p>\r\n\r\n<p style="margin: 0px; color: rgb(119, 119, 119); font-family: Arial; font-size: 14.4px; line-height: normal;"> </p>\r\n\r\n<p style="margin: 0px; color: rgb(119, 119, 119); font-family: Arial; font-size: 14.4px; line-height: normal;"><span style="font-size:18px;"><strong><em style="color: rgb(85, 85, 85);"><u> <span style="color:#8B4513;">Tính năng nổi bật:</span></u></em></strong></span></p>\r\n\r\n<p style="margin: 0px; color: rgb(119, 119, 119); font-family: Arial; font-size: 14.4px; line-height: normal;"><span style="color:#000000;"><span style="font-size:18px;">- Kiểu dáng sang trọng mang phong cách Châu Âu. Quá trình làm xay, đun đậu hoàn toàn tự động.</span></span></p>\r\n\r\n<p style="margin: 0px; color: rgb(119, 119, 119); font-family: Arial; font-size: 14.4px; line-height: normal;"><span style="color:#000000;"><span style="font-size:18px;">- Chức năng: làm sữa đậu lành, ngoài ra có thể dùng để xay nhiều loại đậu xanh, đậu đen, đậu đỏ, bắp, ngũ cốc...</span></span></p>\r\n\r\n<p style="margin: 0px; color: rgb(119, 119, 119); font-family: Arial; font-size: 14.4px; line-height: normal;"><span style="color:#000000;"><span style="font-size:18px;">- Thân máy làm bằng nhựa cao cấp chịu nhiệt.</span></span></p>\r\n\r\n<p style="margin: 0px; color: rgb(119, 119, 119); font-family: Arial; font-size: 14.4px; line-height: normal;"><span style="color:#000000;"><span style="font-size:18px;">- Vi mạch điều tiết năng lượng giúp tiết kiệm điện và tăng tuổi thọ máy.</span></span></p>\r\n\r\n<p style="margin: 0px; color: rgb(119, 119, 119); font-family: Arial; font-size: 14.4px; line-height: normal;"><span style="color:#000000;"><span style="font-size:18px;">- Các bộ phận chính của máy làm bằng thép không gỉ, an toàn cho sức khỏe.</span></span></p>\r\n\r\n<p style="margin: 0px; color: rgb(119, 119, 119); font-family: Arial; font-size: 14.4px; line-height: normal;"><span style="color:#000000;"><span style="font-size:18px;">- Với các chức năng tự động: chống tràn, ngắt điện an toàn, ngưng vận hành khi máy không có nước, giảm áp lực, ngưng vận hành khi nhiệt độ quá cao, ngăn nước vào động cơ.</span></span></p>\r\n\r\n<p style="margin: 0px; color: rgb(119, 119, 119); font-family: Arial; font-size: 14.4px; line-height: normal;"><span style="color:#000000;"><span style="font-size:18px;">- Sản phẩm đạt tiêu chuẩn EU.</span></span></p>\r\n\r\n<p style="margin: 0px; color: rgb(119, 119, 119); font-family: Arial; font-size: 14.4px; line-height: normal;"> </p>\r\n\r\n<p style="margin: 0px; color: rgb(119, 119, 119); font-family: Arial; font-size: 14.4px; line-height: normal;"><img alt="mych.vn máy làm sữa đậu nành tiross ts981" height="400" src="http://mych.vn/vubaohuy/upload/images/MAY%20DANH%20TRUNG%2C%20MAY%20LAM%20SUA%20DAU%20NANH/LSDN%20TIROSS%20TS981%20c.jpg" width="400" /></p>\r\n', '', '', '', '', '', '', 1, 1, 1459588603, 1464580128, 0),
(283, 46, 20, 62, 0, '', 0, 0, '', '', 'product', 0, 0, 'nas-tiross-ts993-3942.jpg', 'nas-tiross-ts993-3942_195x195.jpg', 'Nồi áp suất điện Tiross TS993', 'TS993', 'noi-ap-suat-dien-tiross-ts993', '', '', '900', 'RPC', 5000, 0, '12 Tháng', '', 'Nồi áp suất điện Tiross TS993', 'nồi áp suất điện, nồi áp suất điện tiross ts993, nồi áp suất giá rẻ, nồi áp suất cao cấp', 'nồi áp suất điện, nồi áp suất điện tiross ts993, nồi áp suất giá rẻ, nồi áp suất cao cấp', 0, 0, 1560000, 0, '', '<p><span style="font-size:20px;"><a href="http://mych.vn/do-dien-gia-dung/noi-com-dien-noi-ap-suat-noi-da-nang">Nồi áp suất</a> <span style="color:#8B4513;"><strong>Tiross TS993</strong></span> </span></p>\r\n\r\n<ul style="margin: 0px 0px 0px 25px; padding-right: 0px; padding-left: 0px; font-family: Arial, Tahoma, Verdana, \'Times New Roman\', sans-serif; font-size: 14.4px; line-height: 18px;">\r\n	<li><span style="font-family: arial, helvetica, sans-serif;">Nhiều chức năng: nấu cơm, hầm thịt, hầm xương, đun nước...</span></li>\r\n	<li><span style="font-family: arial, helvetica, sans-serif;">Nồi chống dính cao cấp dày 1,8mm, bền, dễ chùi rửa.</span></li>\r\n	<li><span style="font-family: arial, helvetica, sans-serif;">Thiết bị an toàn trên nắp, van điều tiết áp suất và nhiệt  độ.</span></li>\r\n	<li><span style="font-family: arial, helvetica, sans-serif;">Nhiệt độ và áp suất cao giúp quy trình nấu nhanh chóng, tiết kiệm điện và thời gian.</span></li>\r\n	<li><span style="font-family: arial, helvetica, sans-serif;">Nắp rời an toàn</span></li>\r\n</ul>\r\n\r\n<p> <img alt="mych.vn nồi áp suất tiross ts993" height="400" src="http://mych.vn/vubaohuy/upload/images/NOI%20COM%2C%20NOI%20AP%20SUAT%2C%20NOI%20DA%20NANG/NAS%20TIROSS%20TS993%20b.jpg" width="400" /></p>\r\n', '', '', '', '', '', '', 1, 1, 1459590508, 1461465768, 0),
(284, 46, 20, 62, 0, '', 0, 0, '', '', 'product', 1, 0, 'ndn-tiross-ts902-c-558.jpg', 'ndn-tiross-ts902-c-558_195x195.jpg', 'Nồi đa năng Tiross TS902', 'TS902', 'noi-da-nang-tiross-ts902', '', '', '1500', 'RPC', 5000, 0, '12 Tháng', '', 'Nồi đa năng Tiross TS902', 'nồi đa năng tiross ts902, nồi đa năng, nồi đa năng giá rẻ, nồi điện đa năng', 'nồi đa năng tiross ts902, nồi đa năng, nồi đa năng giá rẻ, nồi điện đa năng', 0, 0, 1450000, 0, 'Điện Áp 220V-50Hz\r\nCông suất: 1500 W\r\nDung tích: 5.0 L\r\nKích thước: 33 x 31 x 23 cm (Dài x rộng x cao)', '<p style="margin: 0px; color: rgb(119, 119, 119); font-family: Arial; font-size: 14.4px; line-height: normal;"><span style="font-size:22px;"><a href="http://mych.vn/do-dien-gia-dung/noi-com-dien-noi-ap-suat-noi-da-nang">Nồi đa năng</a> <span style="color:#8B4513;"><strong>Tiross TS902</strong></span></span></p>\r\n\r\n<p style="margin: 0px; color: rgb(119, 119, 119); font-family: Arial; font-size: 14.4px; line-height: normal;"> </p>\r\n\r\n<p style="margin: 0px; color: rgb(119, 119, 119); font-family: Arial; font-size: 14.4px; line-height: normal;"><b style="color: rgb(64, 64, 64); font-family: Helvetica, Arial, sans-serif; line-height: 22.8px; text-align: justify; margin: 0px; padding: 0px;">TÍNH NĂNG NỔI BẬT</b></p>\r\n\r\n<p style="margin: 0px 0px 15px; font-size: 14.4px; padding: 0px; color: rgb(64, 64, 64); font-family: Helvetica, Arial, sans-serif; line-height: 22.8px; text-align: justify;"><b style="margin: 0px; padding: 0px;">Đa chức năng</b><br style="margin: 0px; padding: 0px;" />\r\nVới núm xoay nhiệt độ từ 80 – 240 độC, bạn dễ dàng lựa chọn mức nhiệt độ phù hợp để chế biến các món ăn khác nhau như: lẩu, rán, chiên, luộc, hầm, hấp, xào và giữ ấm.</p>\r\n\r\n<p style="margin: 0px 0px 15px; font-size: 14.4px; padding: 0px; color: rgb(64, 64, 64); font-family: Helvetica, Arial, sans-serif; line-height: 22.8px; text-align: justify;"><b style="margin: 0px; padding: 0px;">Lòng nồi phủ chất chống dính cao cấp</b><br style="margin: 0px; padding: 0px;" />\r\nĐảm bảo sức nóng được trải đều và nồi lẩu luôn thơm ngon, đồng thời dễ chùi rửa, vệ sinh sau sử dụng.</p>\r\n\r\n<p style="margin: 0px 0px 15px; font-size: 14.4px; padding: 0px; color: rgb(64, 64, 64); font-family: Helvetica, Arial, sans-serif; line-height: 22.8px; text-align: justify;"><b style="margin: 0px; padding: 0px;">Thiết kế nắp thủy tinh</b><br style="margin: 0px; padding: 0px;" />\r\nGiúp bạn quan sát quá trình nấu dễ dàng mà không cần mở nắp quá nhiều lần, ảnh hưởng đến hương vị của món ăn.</p>\r\n\r\n<p style="margin: 0px 0px 15px; font-size: 14.4px; padding: 0px; color: rgb(64, 64, 64); font-family: Helvetica, Arial, sans-serif; line-height: 22.8px; text-align: justify;"><b style="margin: 0px; padding: 0px;">Thiết kế hiện đại</b><br style="margin: 0px; padding: 0px;" />\r\nĐược thiết kế theo phong cách châu Âu, <b style="margin: 0px; padding: 0px;">Tiross TS902</b> có kiểu dáng đơn giản nhưng trang nhã và hiện đại. Bên cạnh đó, sản phẩm có màu sắc nổi bật góp phần làm đẹp cho không gian phòng bếp.</p>\r\n\r\n<p style="margin: 0px 0px 15px; font-size: 14.4px; padding: 0px; color: rgb(64, 64, 64); font-family: Helvetica, Arial, sans-serif; line-height: 22.8px; text-align: justify;"><img alt="mych.vn nồi đa năng tiross ts902" height="400" src="http://mych.vn/vubaohuy/upload/images/NOI%20COM%2C%20NOI%20AP%20SUAT%2C%20NOI%20DA%20NANG/NDN%20TIROSS%20TS902%20b.jpeg" width="400" /></p>\r\n', '', '', '', '', '', '', 1, 1, 1459590962, 1461465246, 0),
(285, 26, 15, 73, 0, '', 0, 0, '75000|90000', '4 tầng|5 tầng', 'product', 1, 0, 'tu-dung-my-pham-nhi-duy-tan-e-4580.jpg', 'tu-dung-my-pham-nhi-duy-tan-e-4580_195x195.jpg', 'Tủ đựng mỹ phẩm nhí Duy Tân', 'TMPDTN', 'tu-dung-my-pham-nhi-duy-tan', '', '', '', 'Việt Nam', 0, 0, '', '', 'Tủ đựng mỹ phẩm nhí Duy Tân', 'tủ đựng mỹ phẩm, tủ nhựa đựng mỹ phẩm, tủ mỹ phẩm', '- Sử dụng trong đựng Mỹ phẩm, Trang sức hay giấy tờ tùy thâ\r\n- Thiết kế từng ngăn trong suốt đẹp mắt, dễ quan sát bên trong.\r\n- Kích thước 1 ngăn: 15 x 18 x 5', 0, 0, 0, 0, '- Sản phẩm thuộc nhóm vật dụng trong gia đình, thương hiệu Duy Tân\r\n- Thích hợp sử dụng trong đựng Mỹ phẩm, Trang sức hay giấy tờ tùy thân\r\n- Thiết kế từng ngăn trong suốt đẹp mắt, dễ dàng quan sát vật dụng bên trong\r\n- Kích thước 1 ngăn: 15 x 18 x 5', '<p><span style="font-size:20px;"><a href="http://giadungmychau.com/index.php?com=tim-kiem&amp;keywords=t%E1%BB%A7+%C4%91%E1%BB%B1ng+m%E1%BB%B9+ph%E1%BA%A9m">Tủ đựng mỹ phẩm</a> nhí <strong><span style="color:#8B4513;">Duy Tân</span></strong></span></p>\r\n\r\n<p>- Sản phẩm thuộc nhóm vật dụng trong gia đình, thương hiệu Duy Tân<br />\r\n- Thích hợp sử dụng trong đựng Mỹ phẩm, Trang sức hay giấy tờ tùy thân<br />\r\n- Thiết kế từng ngăn trong suốt đẹp mắt, dễ dàng quan sát vật dụng bên trong<br />\r\n- Kích thước 1 ngăn: 15 x 18 x 5</p>\r\n\r\n<p> </p>\r\n', '', '', '', '', '', '', 1, 1, 1459644953, 1462262196, 0),
