(289, 42, 20, 63, 0, '', 0, 0, '', '', 'product', 0, 0, 'bhn-homemax-hm20h1-7700.jpg', 'bhn-homemax-hm20h1-7700_195x195.jpg', 'Bếp hồng ngoại HomeMax HM-20H1', 'HM-20H1', 'bep-hong-ngoai-homemax-hm20h1', '', '', '2000', 'RPC', 0, 2100, '12 Tháng', '', 'Bếp hồng ngoại HomeMax HM-20H1', 'bếp hồng ngoại homemax hm-20h1, bếp hồng ngoại giá rẻ, bếp hồng ngoại tốt', 'Loại sản phẩm nằm trong phân khúc giá rẻ của HomeMax, phù hợp cho mọi đối tượng lao động, đặc biệt là sinh viên. Kích thước nhỏ gọn nhưng chắc chắn phù hợp mọi thiết bị.', 0, 0, 690000, 0, 'Bề mặt chống trơn trượt bằng Aluminium chịu nhiệt cao.\r\nNút chỉnh cơ, màn hình điện tử hiển thị 4 chữ số, chế độ hẹn giờ nấu.\r\nKích thước bếp: 260x260', '<p><span style="font-size:20px;"><a href="http://mych.vn/do-dien-gia-dung/bep-tu-bep-hong-ngoaibep+hong+ngoai"><span style="color:#0000CD;">Bếp hồng ngoại</span></a> <strong><span style="color:#8B4513;">HomeMax HM-20H1 :</span></strong></span></p>\r\n\r\n<table border="0" cellpadding="0" cellspacing="1" style="border-collapse: collapse; border-spacing: 0px; max-width: 100%; color: rgb(100, 100, 100); font-family: \'Open Sans\', Arial, Helvetica, sans-serif; line-height: 24px; width: 600px; background-color: rgba(255, 255, 255, 0.980392);" width="93">\r\n	<tbody>\r\n		<tr height="60" style="height: 80px;">\r\n			<td height="60" style="height: 80px; border-top-style: none; width: 124px;"><span style="font-size:16px;">Thiết kế</span></td>\r\n			<td height="60" style="height: 80px; border-top-style: none; width: 124px;">\r\n			<p class="p1" style="margin: 0px 0px 12px;"><span style="font-size:16px;"><b>Vòng nấu đơn, nút cơ, bề mặt chống trượt</b></span></p>\r\n			</td>\r\n		</tr>\r\n		<tr height="187" style="height: 250px;">\r\n			<td height="187" style="height: 250px; border-top-style: none; width: 124px;"><span style="font-size:16px;">Chức Năng</span></td>\r\n			<td height="187" style="height: 250px; border-top-style: none; width: 124px;">\r\n			<p class="p1" style="margin: 0px 0px 12px;"><span style="font-size:16px;">• Bề mặt chịu nhiệt cao</span></p>\r\n\r\n			<p class="p1" style="margin: 0px 0px 12px;"><span style="font-size:16px;">• 4 mức độ điều chỉnh nhiệt</span></p>\r\n\r\n			<p class="p1" style="margin: 0px 0px 12px;"><span style="font-size:16px;">• Nồi nấu tốt cho sức khoẻ, không carbon dioxide, không bức xạ nhiệt, không khói và ít tiếng ồn khi hoạt động</span></p>\r\n\r\n			<p class="p1" style="margin: 0px 0px 12px;"><span style="font-size:16px;">• Phù hợp tất cả loại nồi</span></p>\r\n\r\n			<p class="p1" style="margin: 0px 0px 12px;"><span style="font-size:16px;">• Chế độ báo động khi nhiệt độ quá cao đảm bảo an toàn khi sử dụng</span></p>\r\n\r\n			<p class="p1" style="margin: 0px 0px 12px;"><span style="font-size:16px;">• Đa năng có thể nấu, nướng, chiên, xào...</span></p>\r\n\r\n			<p class="p1" style="margin: 0px 0px 12px;"><span style="font-size:16px;">• 220-240V</span></p>\r\n\r\n			<p class="p1" style="margin: 0px 0px 12px;"><span style="font-size:16px;">• Dễ dàng chùi rửa, bề mặt không thấm nước</span></p>\r\n\r\n			<p class="p1" style="margin: 0px 0px 12px;"><span style="font-size:16px;">• Tiết kiệm điện: dễ dàng điều chỉnh nhiệt độ  </span></p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p> </p>\r\n\r\n<p><img alt="mych.vn bếp hồng ngoại homemax hm-20h1" height="400" src="http://mych.vn/vubaohuy/upload/images/BEP%20TU%2C%20BEP%20HONG%20NGOAI/BHN%20HOMEMAX%20HM-20H1.jpg" width="400" /></p>\r\n', '', '', '', '', '', '', 1, 1, 1459809261, 1464409260, 0),
(290, 42, 20, 63, 0, '', 0, 0, '', '', 'product', 0, 0, 'bhn-homemax-hm20t6-1794.jpg', 'bhn-homemax-hm20t6-1794_195x195.jpg', 'Bếp hồng ngoại HomeMax HM-20T6', 'HM-20T6', 'bep-hong-ngoai-homemax-hm20t6', '', '', '2000', 'RPC', 0, 2300, '12 Tháng', '', 'Bếp hồng ngoại HomeMax HM-20T6', 'bếp hồng ngoại homemax hm-20t6, bếp hồng ngoại giá rẻ, bếp hồng ngoại tốt', 'Dòng sản phẩm có kích thước lớn của Homemax, nhưng giá lại rất cạnh tranh so với các thương hiệu khác, phù hợp sử dụng trong gia đình, ăn uống ngoài trời, lẩu, nướng...', 0, 0, 719000, 0, 'Bề mặt sáng bóng bằng sợi thủy tinh chịu nhiệt cao.\r\nNút cảm ứng, màn hình điện tử hiển thị 4 chứ số, chế độ hẹn giờ nấu, khóa an toàn cho trẻ em.\r\nKích thước: 290x360', '<p><span style="font-size:20px;"><a href="http://mych.vn/do-dien-gia-dung/bep-tu-bep-hong-ngoai+hong+ngoai"><span style="color:#000080;">Bếp hồng ngoại</span></a> <strong><span style="color:#8B4513;">HomeMax HN-20T6</span></strong></span></p>\r\n\r\n<p><strong><span style="font-size:16px;">Thiết kế</span></strong></p>\r\n\r\n<p class="p1" style="margin: 0px 0px 8px; padding: 0px 0px 15px; line-height: 1.3;">Vòng nấu đơn, bề mặt bóng, nút cảm ứng</p>\r\n\r\n<p><strong><span style="font-size:16px;">Chức Năng</span></strong></p>\r\n\r\n<p class="p1" style="margin: 0px 0px 8px; padding: 0px 0px 15px; line-height: 1.3;">• Bề mặt chịu nhiệt cao</p>\r\n\r\n<p class="p1" style="margin: 0px 0px 8px; padding: 0px 0px 15px; line-height: 1.3;">• 4 mức độ điều chỉnh nhiệt</p>\r\n\r\n<p class="p1" style="margin: 0px 0px 8px; padding: 0px 0px 15px; line-height: 1.3;">• Nồi nấu tốt cho sức khoẻ, không carbon dioxide, không bức xạ nhiệt, không khói và ít tiếng ồn khi hoạt động</p>\r\n\r\n<p class="p1" style="margin: 0px 0px 8px; padding: 0px 0px 15px; line-height: 1.3;">• Phù hợp tất cả loại nồi</p>\r\n\r\n<p class="p1" style="margin: 0px 0px 8px; padding: 0px 0px 15px; line-height: 1.3;">• Chế độ báo động khi nhiệt độ quá cao đảm bảo an toàn khi sử dụng</p>\r\n\r\n<p class="p1" style="margin: 0px 0px 8px; padding: 0px 0px 15px; line-height: 1.3;">• Đa năng có thể nấu, nướng, chiên, xào...</p>\r\n\r\n<p class="p1" style="margin: 0px 0px 8px; padding: 0px 0px 15px; line-height: 1.3;">• 220-240V</p>\r\n\r\n<p class="p1" style="margin: 0px 0px 8px; padding: 0px 0px 15px; line-height: 1.3;">• Dễ dàng chùi rửa, bề mặt không thấm nước</p>\r\n\r\n<p class="p1" style="margin: 0px 0px 8px; padding: 0px 0px 15px; line-height: 1.3;">• Tiết kiệm điện: dễ dàng điều chỉnh nhiệt độ  </p>\r\n\r\n<p class="p1" style="margin: 0px 0px 8px; padding: 0px 0px 15px; line-height: 1.3;"><img alt="mych.vn bếp hồng ngoại homemax hn-20t6" height="400" src="http://mych.vn/vubaohuy/upload/images/BEP%20TU%2C%20BEP%20HONG%20NGOAI/BHN%20HOMEMAX%20HM-20T6.jpg" width="400" /></p>\r\n', '', '', '', '', '', '', 1, 1, 1459810281, 1461461884, 0),
