(294, 55, 25, 68, 0, '', 0, 0, '', '', 'product', 0, 0, 'hdc-homemax-hmcmtlb2-616.jpg', 'hdc-homemax-hmcmtlb2-616_195x195.jpg', 'Hộp cơm giữ nhiệt HomeMax TLB-2', 'TLB-2', 'hop-com-giu-nhiet-homemax-tlb2', '', '', '', 'RPC', 1700, 0, '12 Tháng', '', 'Hộp cơm giữ nhiệt HomeMax TLB-2', 'hộp cơm giữ nhiệt homemax tlb-2, camen, hộp cơm, hộp đựng cơm, hộp cơm giữ nhiệt, hộp cơm hâm nóng', '2 ngăn, ngăn A 1.2L, ngăn B 0.5L, Vỏ ngoài bằng nhựa, lòng trong thép không rỉ, nhỏ gọn, dẽ tháo lắp, giữ nhiệt 1000c còn lại 500c trong 4h. Đáy kèm ngăn đựng muỗng nĩa.', 0, 0, 320000, 0, 'Hộp cơm 2 ngăn, dung tích ngăn A 1.2L, ngăn B 0.5L\r\nVỏ ngoài bằng nhựa, lòng trong thép không rỉ.\r\nThiết kế nhỏ gọn, dẽ dàng tháo lắp, giữ nhiệt 1000c còn lại 500c trong vòng 4h\r\nĐáy kèm ngăn đựng muỗng nĩa.', '<p><span style="font-size:20px;"><a href="http://mych.vn/do-dung-phong-an-thuc-uong/hop-com-giu-nhiet-camen"><span style="color:#000080;">Hộp cơm giữ nhiệt</span></a> <strong><span style="color:#8B4513;">HomeMax TLB-2</span></strong></span></p>\r\n\r\n<p>Hộp cơm giữ nhiệt 2 ngăn, Dung tích 0.5L + 1.2L<br />\r\nVỏ ngoài bằng nhựa, lòng trong thép không rỉ.<br />\r\nThiết kế nhỏ gọn, dẽ dàng tháo lắp, giữ nhiệt 1000c còn lại 500c trong vòng 4h<br />\r\nĐáy kèm ngăn đựng muỗng nĩa.</p>\r\n\r\n<p><img alt="mych.vn hộp cơm giữ nhiệt homemax tlb-2" height="400" src="http://mych.vn/vubaohuy/upload/images/HOP%20COM%20GIU%20NHIET%2C%20CAMEN/HDC%20HOMEMAX%20HMCM-TLB-2.jpg" width="400" /></p>\r\n', '', '', '', '', '', '', 1, 1, 1459816915, 1461461420, 0),
