(301, 46, 20, 65, 0, '', 1, 10, '', '', 'product', 0, 0, 'ndn-homemax-hmnljqh10040-6764.jpg', 'ndn-homemax-hmnljqh10040-6764_195x195.jpg', 'Nồi đa năng HomeMax JQH-100-40', 'JQH-100-40', 'noi-da-nang-homemax-jqh10040', '', '', '400 - 1000', 'RPC', 3000, 0, '12 Tháng', '', 'Nồi đa năng Homemax JQH-100-40', 'nồi đa năng homemax jqh-100-40, nồi lẩu điện homemax, nồi điện', 'Chức năng: nướng kết hợp lẩu. Công suất lẩu 1000w, nướng 400w. Dung tích lẩu 3L, lòng lẩu bằng inox. Mâm nướng tráng men chống dính. Công tắc nướng và lẩu riêng biệt', 0, 0, 860000, 0, 'Chức năng: nướng kết hợp lẩu\r\nCông suất lẩu 1000w, nướng 400w\r\nDung tích lẩu 3L, lòng lẩu bằng inox\r\nMâm nướng tráng men chống dính\r\nCông tắc nướng và lẩu riêng biệt', '<p><span style="font-size:20px;"><a href="http://mych.vn/do-dien-gia-dung/noi-com-dien-noi-ap-suat-noi-da-nang"><span style="color:#000080;">Nồi đa năng</span></a> <strong><span style="color:#8B4513;">JQH-100-40</span></strong></span></p>\r\n\r\n<p>Chức năng: nướng kết hợp lẩu<br />\r\nCông suất lẩu 1000w, nướng 400w<br />\r\nDung tích lẩu 3L, lòng lẩu bằng inox<br />\r\nMâm nướng tráng men chống dính<br />\r\nCông tắc nướng và lẩu riêng biệt</p>\r\n\r\n<p><img alt="mych.vn nồi đa năng jqh-100-40" height="400" src="http://mych.vn/vubaohuy/upload/images/NOI%20COM%2C%20NOI%20AP%20SUAT%2C%20NOI%20DA%20NANG/NDN%20HOMEMAX%20HMNL-JQH-100-40.jpg" width="400" /></p>\r\n\r\n<p> </p>\r\n', '', '', '', '', '', '', 1, 1, 1459834726, 1461282383, 0),
(302, 46, 20, 65, 0, '', 0, 0, '', '', 'product', 0, 0, 'nt-homemax-hmntjqd16a-b-850.jpg', 'nt-homemax-hmntjqd16a-b-850_195x195.jpg', 'Nồi tiềm HomeMax JQD-16A', 'JQD-16A', 'noi-tiem-homemax-jqd16a', '', '', '', 'RPC', 2800, 0, '12 Tháng', '', 'Nôi tiềm HomeMax JQD-16A', 'nồi tiềm homemax jqd-16a, nồi chưng homemax jqd-16a, nồi hấp cách thủy, nồi tiềm giá rẻ, nồi hấp giá rẻ', 'Nồi tiềm + Chưng cách thủy. Gồm 3 thố sứ dung tích: 1.6L, 0.6Lx2. Chức năng hấp, hầm. Có chức năng hẹn giờ nấu, chức năng nấu nhanh, nấu chậm. Màn hình hiển thị điện tử', 0, 0, 720000, 0, 'Nồi tiềm + Chưng cách thủy\r\nGồm 3 thố sứ dung tích: 1.6L, 0.6L, 0.6L\r\nChức năng hấp, hầm\r\nCó chức năng hẹn giờ nấu, chức năng nấu nhanh, nấu chậm.\r\nMàn hình hiển thị điện tử', '<p><span style="font-size:20px;"><a href="http://mych.vn/do-dien-gia-dung/noi-com-dien-noi-ap-suat-noi-da-nang"><font color="#000080">Nồi tiềm</font></a> <strong><span style="color:#8B4513;">HomeMax JQD-16A</span></strong></span></p>\r\n\r\n<p>Nồi tiềm + Chưng cách thủy<br />\r\nGồm 3 thố sứ dung tích: 1.6L, 0.6L, 0.6L<br />\r\nChức năng hấp, hầm<br />\r\nCó chức năng hẹn giờ nấu, chức năng nấu nhanh, nấu chậm.<br />\r\nMàn hình hiển thị điện tử</p>\r\n\r\n<p><img alt="mych.vn nồi tiềm homemax jqd-16a" height="400" src="http://mych.vn/vubaohuy/upload/images/NOI%20COM%2C%20NOI%20AP%20SUAT%2C%20NOI%20DA%20NANG/NT%20HOMEMAX%20HMNT-JQD-16A%20b.jpg" width="400" /></p>\r\n', '', '', '', '', '', '', 1, 1, 1459835090, 1461282343, 0),
(303, 54, 25, 80, 0, '', 0, 0, '', '', 'product', 0, 0, 'bgn-zojirushi-shha10-2594.jpg', 'bgn-zojirushi-shha10-2594_195x195.jpg', 'Bình giữ nhiệt nóng lạnh Zojirushi SH-HA10', 'SH-HA10', 'binh-giu-nhiet-nong-lanh-zojirushi-shha10', '', '', '', 'RPC', 1000, 900, '12 Tháng', '', 'Bình giữ nhiệt Zojirushi SH-HA10', 'bình giữ nhiệt zojirushi sh-ha10, bình giữ nhiệt, bình giữ nhiệt inox, bình inox, bình nhựa, bình giứ lạnh, bình giứ nóng, bình đựng nước, bình đá, thùng đựng đá, bình giữ đá, ca đá, ca đựng đá', 'Sản phẩm giữ nhiệt cao cấp của thương hiệu đến từ Japan, cho khả năng giữ nhiệt cao. Sử dụng nguyên liệu tốt nhất để chế tạo đảm bảo cho sức khỏe người tiêu dùng.', 0, 0, 790000, 0, 'Bình giữ nhiệt ( nóng, lạnh ) bằng chân không, kiểu dáng sang trọng.\r\nChất liệu thép không rỉ, khoang miệng rộng dễ dàng vệ sinh.\r\nRót nước thuận tiện với 1 nút nhấn, nắp bình có thể tháo rời để vệ sinh.', '<p style="padding: 0px 0px 15px; margin: 0px 0px 8px; line-height: 1.3; font-family: Verdana, Arial, Geneva, sans-serif; font-size: 11px;"><span class="TxtSize20" style="padding: 0px; margin: 0px; font-size: 20px;"><strong><a href="http://mych.vn/do-dung-phong-an-thuc-uong/binh-giu-nhiet"><span style="color:#000080;">Bình giữ nhiệt</span></a></strong><font color="#000000"> </font><strong style="color: rgb(0, 0, 0);"><span style="color:#8B4513;">Zojirushi SH-HA10</span></strong></span></p>\r\n\r\n<p style="padding: 0px 0px 15px; margin: 0px 0px 8px; line-height: 1.3; color: rgb(0, 0, 0); font-family: Verdana, Arial, Geneva, sans-serif; font-size: 11px;"><span style="font-size:16px;">Bình thuỷ bấm rót thép không gỉ cách nhiệt chân không giữ nhiệt hoàn hảo, dễ dàng sử dụng với nút bấm rót, có thể tháo mở để dẽ dàng vệ sinh.</span></p>\r\n\r\n<div class="specList" style="padding: 0px; margin: 0px 0px 0px -25px; color: rgb(0, 0, 0); font-family: Verdana, Arial, Geneva, sans-serif; font-size: 11px; line-height: normal;">\r\n<ul style="padding-right: 0px; padding-left: 0px; margin: 0p