(323, 54, 25, 66, 0, '', 0, 0, '189000', '500ml', 'product', 0, 0, 'phich-giu-nhiet-elmich-inox-304-500ml-189k-m5-8319.jpg', 'phich-giu-nhiet-elmich-inox-304-500ml-189k-m5-8319_195x195.jpg', 'Bình giữ nhiệt Elmich 500ml M5', 'ELM5', 'binh-giu-nhiet-elmich-500ml-m5', '', '', '', 'VietNam', 500, 0, '12 tháng', '', 'Bình giữ nhiệt Elmich M5', 'bình giữ nhiệt, bình nóng lạnh, bình đựng đá, bình nước inox, bình giữ nóng, bình giữ lạnh', 'Dung tích: 500 ml.Kết cấu 3 lớp, lớp trong cùng là inox 304 tráng bạc.Gồm 2 chức năng: giữ nóng, giữ lạnh.chứng nhận an toàn,theo tiêu chuẩn Châu Âu', 0, 0, 189000, 0, 'Dung tích: 500 ml.Kết cấu 3 lớp, lớp trong cùng là inox 304 tráng bạc.Gồm 2 chức năng: giữ nóng, giữ lạnh.chứng nhận an toàn,theo tiêu chuẩn Châu Âu', '<p><span style="color:#800000;"><span style="font-size:20px;"><strong>Bình giữ nhiệt</strong></span></span><span style="color:#0000CD;"><span style="font-size:20px;"><strong> Elmich 500ml M5 :</strong></span></span></p>\r\n\r\n<p style="color: rgb(0, 0, 0); font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 10px; line-height: normal;"><span data-mce-style="color: #111111; font-family: Arial, Helvetica, sans-serif; font-size: 13px; line-height: 18px;" style="color: rgb(17, 17, 17); font-family: Arial, Helvetica, sans-serif; font-size: 13px; line-height: 18px;"><span data-mce-style="font-size: medium;" style="font-size: medium;">Thiết kế độc đáo với vỏ bình được bao bọc bởi một lớp chân không, nắp đậy chặt chẽ giúp phích giữ nhiệt rất tốt. Kiểu dáng đẹp, gọn gàng, có thể mang đi du lịch.</span></span></p>\r\n\r\n<div data-mce-style="outline: none; color: #111111; font-family: Arial, Helvetica, sans-serif; font-size: 12px; line-height: 18px;" style="outline: none; color: rgb(17, 17, 17); font-family: Arial, Helvetica, sans-serif; font-size: 12px; line-height: 18px;"><span data-mce-style="outline: none; font-family: arial, helvetica, sans-serif; font-size: medium;" style="outline: none; font-family: arial, helvetica, sans-serif; font-size: medium;">- Thân bình được mạ lớp ánh kim sang trọng</span></div>\r\n\r\n<div data-mce-style="outline: none; color: #111111; font-family: Arial, Helvetica, sans-serif; font-size: 12px; line-height: 18px;" style="outline: none; color: rgb(17, 17, 17); font-family: Arial, Helvetica, sans-serif; font-size: 12px; line-height: 18px;"><span data-mce-style="outline: none; font-family: arial, helvetica, sans-serif; font-size: medium;" style="outline: none; font-family: arial, helvetica, sans-serif; font-size: medium;">- Nắp có thể dùng làm cốc uống nước</span></div>\r\n\r\n<div data-mce-style="outline: none; color: #111111; font-family: Arial, Helvetica, sans-serif; font-size: 12px; line-height: 18px;" style="outline: none; color: rgb(17, 17, 17); font-family: Arial, Helvetica, sans-serif; font-size: 12px; line-height: 18px;"><span data-mce-style="outline: none; font-family: arial, helvetica, sans-serif; font-size: medium;" style="outline: none; font-family: arial, helvetica, sans-serif; font-size: medium;">- Nút bật tiện lợi cho việc đổ nước ra ngoài. </span></div>\r\n\r\n<div data-mce-style="outline: none; color: #111111; font-family: Arial, Helvetica, sans-serif; font-size: 12px; line-height: 18px;" style="outline: none; color: rgb(17, 17, 17); font-family: Arial, Helvetica, sans-serif; font-size: 12px; line-height: 18px;"><span data-mce-style="outline: none; font-family: arial, helvetica, sans-serif; font-size: medium;" style="outline: none; font-family: arial, helvetica, sans-serif; font-size: medium;">- Sử dụng môi trường chân không, giữ nhiệt tốt</span></div>\r\n\r\n<div data-mce-style="outline: none; color: #111111; font-family: Arial, Helvetica, sans-serif; font-size: 12px; line-height: 18px;" style="outline: none; color: rgb(17, 17, 17); font-family: Arial, Helvetica, sans-serif; font-size: 12px; line-height: 18px;"><span data-mce-style="outline: none; font-family: arial, helvetica, sans-serif; font-size: medium;" style="outline: none; font-family: arial, helvetica, sans-serif; font-size: medium;">- Sản phẩm đa năng, mang đến nhiều tiện ích</span></div>\r\n\r\n<div data-mce-style="outline: none; color: #111111; font-family: Arial, Helvetica, sans-serif; font-size: 12px; line-height: 18px;" style="outline: none; color: rgb(17, 17, 17); font-family: Arial, Helvetica, sans-serif; font-size: 12px; line-height: 18px;"><span data-mce-style="outline: none; font-family: arial, helvetica, sans-serif; font-size: medium;" style="outline: none; font-family: arial, helvetica, sans-serif; font-size: medium;"><img alt="" height="400" src="http://mych.vn/vubaohuy/upload/images/BINH%20GIU%20NHIET/Ph%C3%ADch%20gi%E1%BB%AF%20nhi%E1%BB%87t%20Elmich%20inox%20304%20500ml%20189k%20M5%20b.jpg" width="400" /></span>\r\n\r\n<div data-mce-style="outline: none; color: #111111; font-family: Arial, Helvetica, sans-serif; font-size: 12px; line-height: 18px;" style="outline: none; color: rgb(17, 17, 17); font-family: Arial, Helvetica, sans-serif; font-size: 12px; line-height: 18px;"><span style="color:#0000CD;"><span data-mce-style="outline: none; text-decoration: underline; font-family: arial, helvetica, sans-serif; font-size: medium;" style="outline: none; text-decoration: underline; font-family: arial, helvetica, sans-serif; font-size: medium;"><span data-mce-style="outline: none; font-weight: bold;" style="outline: none; font-weight: 700;">Hướng dẫn sử dụng:</span></span></span></div>\r\n\r\n<div data-mce-style="outline: none; color: #111111; font-family: Arial, Helvetica, sans-serif; font-size: 12px; line-height: 18px;" style="outline: none; color: rgb(17, 17, 17); font-family: Arial, Helvetica, sans-serif; font-size: 12px; line-height: 18px;"><span data-mce-style="outline: none; font-family: arial, helvetica, sans-serif; font-size: medium;" style="outline: none; font-family: arial, helvetica, sans-serif; font-size: medium;">- Rửa sạch bằng nước ấm trong lần sử dụng đầu tiên để tăng hiệu quả giữ nhiệt</span></div>\r\n\r\n<div 