-decoration: underline; font-family: arial, helvetica, sans-serif; font-size: medium;" style="outline: none; text-decoration: underline; font-family: arial, helvetica, sans-serif; font-size: medium;"><span data-mce-style="outline: none; font-weight: bold;" style="outline: none; font-weight: 700;">Lưu ý khi sử dụng:</span></span></span></div>\r\n\r\n<div data-mce-style="outline: none;" style="outline: none;"><span data-mce-style="outline: none; font-family: arial, helvetica, sans-serif; font-size: medium;" style="outline: none; font-family: arial, helvetica, sans-serif; font-size: medium;">- Tránh làm rơi sản phẩm</span></div>\r\n\r\n<div data-mce-style="outline: none;" style="outline: none;"><span data-mce-style="outline: none; font-family: arial, helvetica, sans-serif; font-size: medium;" style="outline: none; font-family: arial, helvetica, sans-serif; font-size: medium;">- Không được sử dụng trong lò vi sóng, máy rửa chén</span></div>\r\n\r\n<div data-mce-style="outline: none;" style="outline: none;"><span data-mce-style="outline: none; font-family: arial, helvetica, sans-serif; font-size: medium;" style="outline: none; font-family: arial, helvetica, sans-serif; font-size: medium;">- Không nên dùng bình để chứa đồ uống có gas, đá khô, sữa (cho trẻ em)</span></div>\r\n\r\n<div data-mce-style="outline: none;" style="outline: none;"><span data-mce-style="outline: none; font-family: arial, helvetica, sans-serif; font-size: medium;" style="outline: none; font-family: arial, helvetica, sans-serif; font-size: medium;">- Không nên dùng vật cứng để chùi rửa bình</span></div>\r\n\r\n<div data-mce-style="outline: none;" style="outline: none;"><span data-mce-style="outline: none; font-family: arial, helvetica, sans-serif; font-size: medium;" style="outline: none; font-family: arial, helvetica, sans-serif; font-size: medium;">- Không khử trùng nắp bằng cách luộc nắp bình</span></div>\r\n\r\n<div data-mce-style="outline: none;" style="outline: none;"><span data-mce-style="outline: none; font-family: arial, helvetica, sans-serif; font-size: medium;" style="outline: none; font-family: arial, helvetica, sans-serif; font-size: medium;">- Nếu đang dùng bình để giữ nóng, không nên đặt trực tiếp miệng lên miệng bình để uống</span></div>\r\n</div>\r\n<img alt="" height="400" src="http://mych.vn/vubaohuy/upload/images/BINH%20GIU%20NHIET/Ph%C3%ADch%20gi%E1%BB%AF%20nhi%E1%BB%87t%20Elmich%20inox%20304%20500ml%20189k%20M5%20c.jpg" width="400" /></div>\r\n\r\n<div data-mce-style="outline: none; color: #111111; font-family: Arial, Helvetica, sans-serif; font-size: 12px; line-height: 18px;" style="outline: none; color: rgb(17, 17, 17); font-family: Arial, Helvetica, sans-serif; font-size: 12px; line-height: 18px;"><img alt="" height="400" src="http://mych.vn/vubaohuy/upload/images/BINH%20GIU%20NHIET/Ph%C3%ADch%20gi%E1%BB%AF%20nhi%E1%BB%87t%20Elmich%20inox%20304%20500ml%20189k%20M5%20d.jpg" width="400" /></div>\r\n\r\n<div data-mce-style="outline: none; color: #111111; font-family: Arial, Helvetica, sans-serif; font-size: 12px; line-height: 18px;" style="outline: none; color: rgb(17, 17, 17); font-family: Arial, Helvetica, sans-serif; font-size: 12px; line-height: 18px;"><img alt="" height="400" src="http://mych.vn/vubaohuy/upload/images/BINH%20GIU%20NHIET/Ph%C3%ADch%20gi%E1%BB%AF%20nhi%E1%BB%87t%20Elmich%20inox%20304%20500ml%20189k%20M5.jpg" width="400" /></div>\r\n', '', '', '', '', '', '', 1, 1, 1462441025, 1464165654, 0),
(304, 54, 25, 80, 0, '', 0, 0, '', '', 'product', 0, 0, 'bgn-zojirushi-shha15-b-3915.jpg', 'bgn-zojirushi-shha15-b-3915_195x195.jpg', 'Bình giữ nhiệt nóng lạnh Zojirushi SH-HA15', 'SH-HA15', 'binh-giu-nhiet-nong-lanh-zojirushi-shha15', '', '', '', 'RPC', 1500, 1000, '12 Tháng', '', 'Bình giữ nhiệt Zojirushi SH-HA15', 'bình giữ nhiệt zojirushi sh-ha15, bình giữ nhiệt, bình giữ nhiệt inox, bình inox, bình nhựa, bình giứ lạnh, bình giứ nóng, bình đựng nước, bình đá, thùng đựng đá, bình giữ đá, ca đá, ca đựng đá', 'Sản phẩm giữ nhiệt cao cấp của thương hiệu đến từ Japan, cho khả năng giữ nhiệt cao. Sử dụng nguyên liệu tốt nhất để chế tạo đảm bảo cho sức khỏe người tiêu dùng.', 0, 0, 895000, 0, 'Bình giữ nhiệt ( nóng, lạnh ) bằng chân không, kiểu dáng sang trọng.\r\nChất liệu thép không rỉ, khoang miệng rộng dễ dàng vệ sinh.\r\nRót nước thuận tiện với 1 nút nhấn, nắp bình có thể tháo rời để vệ sinh.', '<p style="padding: 0px 0px 15px; margin: 0px 0px 8px; line-height: 1.3; font-family: Verdana, Arial, Geneva, sans-serif; font-size: 11px;"><span class="TxtSize20" style="padding: 0px; margin: 0px; font-size: 20px;"><a href="http://mych.vn/do-dung-phong-an-thuc-uong/binh-giu-nhiet"><span style="color:#000080;">Bình giữ nhiệt</span></a><font color="#000000"> </font><strong style="color: rgb(0, 0, 0);"><span style="color:#8B4513;">Zojirushi SH-HA15</span></strong></span></p>\r\n\r\n<p style="padding: 0px 0px 15px; margin: 0px 0px 8px; line-height: 1.3; color: rgb(0, 0, 0); font-family: Verdana, Arial, Geneva, sans-serif; font-size: 11px;">Bình thuỷ bấm rót thép không gỉ cách nhiệt chân không giữ nhiệt hoàn hảo, dễ dàng sử dụng với nút bấm rót, có thể tháo mở để dẽ dàng vệ sinh.</p>\r\n\r\n<div class="specList" style="padding: 0px; margin: 0px 0px 0px -25px; color: rgb(0, 0, 0); font-family: Verdana, Arial, Geneva, sans-serif; font-size: 11px; line-height: normal;">\r\n<ul style="padding-right: 0px; padding-left: 0px; margin: 0px 0px 10px 30px;">\r\n	<li style="padding: 0px; m