(305, 54, 25, 80, 0, '', 0, 0, '', '', 'product', 0, 0, 'bgn-zojirushi-shha15-c-967.jpg', 'bgn-zojirushi-shha15-c-967_195x195.jpg', 'Bình giữ nhiệt nóng lạnh Zojirushi SH-HA19', 'SH-HA19', 'binh-giu-nhiet-nong-lanh-zojirushi-shha19', '', '', '', 'RPC', 1850, 1200, '12 Tháng', '', 'Bình giữ nhiệt Zojirushi SH-HA19', 'bình giữ nhiệt zojirushi sh-ha19, bình giữ nhiệt, bình giữ nhiệt inox, bình inox, bình nhựa, bình giứ lạnh, bình giứ nóng, bình đựng nước, bình đá, thùng đựng đá, bình giữ đá, ca đá, ca đựng đá', 'Sản phẩm giữ nhiệt cao cấp của thương hiệu đến từ Japan, cho khả năng giữ nhiệt cao. Sử dụng nguyên liệu tốt nhất để chế tạo đảm bảo cho sức khỏe người tiêu dùng.', 0, 0, 980000, 0, 'Bình giữ nhiệt ( nóng, lạnh ) bằng chân không, kiểu dáng sang trọng.\r\nChất liệu thép không rỉ, khoang miệng rộng dễ dàng vệ sinh.\r\nRót nước thuận tiện với 1 nút nhấn, nắp bình có thể tháo rời để vệ sinh.', '<p style="padding: 0px 0px 15px; margin: 0px 0px 8px; line-height: 1.3; color: rgb(0, 0, 0); font-family: Verdana, Arial, Geneva, sans-serif; font-size: 11px;"><span class="TxtSize20" style="padding: 0px; margin: 0px; font-size: 20px;"><strong><a href="http://mych.vn/do-dung-phong-an-thuc-uong/binh-giu-nhiet"><span style="color:#000080;">Bình giữ nhiệt</span></a></strong> <strong><span style="color:#8B4513;">Zojirushi SH-HA19</span></strong></span></p>\r\n\r\n<p style="padding: 0px 0px 15px; margin: 0px 0px 8px; line-height: 1.3; color: rgb(0, 0, 0); font-family: Verdana, Arial, Geneva, sans-serif; font-size: 11px;"><span style="font-size:16px;">Bình thuỷ bấm rót thép không gỉ cách nhiệt chân không giữ nhiệt hoàn hảo, dễ dàng sử dụng với nút bấm rót, có thể tháo mở để dẽ dàng vệ sinh.</span></p>\r\n\r\n<div class="specList" style="padding: 0px; margin: 0px 0px 0px -25px; color: rgb(0, 0, 0); font-family: Verdana, Arial, Geneva, sans-serif; font-size: 11px; line-height: normal;">\r\n<ul style="padding-right: 0px; padding-left: 0px; margin: 0px 0px 10px 30px;">\r\n	<li style="