(306, 55, 25, 68, 0, '', 0, 0, '', '', 'product', 0, 0, 'cm-zojirushi-sljaf14-2352.jpg', 'cm-zojirushi-sljaf14-2352_195x195.jpg', 'Hộp cơm giữ nhiệt Zojirushi SL-JAF14', 'SL-JAF14', 'hop-com-giu-nhiet-zojirushi-sljaf14', '', '', '', 'Thái Lan', 1230, 1100, '12 Tháng', '', 'Hộp cơm giữ nhiệt Zojirushi SL-JAF14', 'hộp cơm giữ nhiệt zojirushi sl-jaf14, camen, hộp cơm, hộp đựng cơm, hộp cơm giữ nhiệt, hộp cơm hâm nóng', 'Sản phẩm hộp cơm giữ nhiệt thương hiệu Nhật Bản, được sản xuất tại Thái Lan với công nghệ hiện đại. Sử dụng vật liệu cao cấp an toàn cho sức khỏe và cho độ bền cao.', 0, 0, 1050000, 0, 'Bình chứa bằng thép không rỉ\r\n4 hộp đựng với dung tích 200, 280, 300, 450ml\r\nCó thể hâm nóng trong lò vi sóng\r\nKèm đũa, hộp đựng đũa, túi đựng xách tiện dụng\r\n( Xuất sứ Thái Lan )', '<p style="padding: 0px 0px 15px; margin: 0px 0px 8px; line-height: 1.3; color: rgb(0, 0, 0); font-family: Verdana, Arial, Geneva, sans-serif; font-size: 11px;"><span class="TxtSize20" style="padding: 0px; margin: 0px; font-size: 20px;"><font style="padding: 0px; margin: 0px;"><font style="padding: 0px; margin: 0px;"><a href="http://mych.vn/do-dung-phong-an-thuc-uong/hop-com-giu-nhiet-camen"><span style="color:#000080;">Hộp cơm giữ nhiệt</span></a> <strong><span style="color:#8B4513;">Zojirushi SL-JAF14</span></strong></font></font></span></p>\r\n\r\n<p style="padding: 0px 0px 15px; margin: 0px 0px 8px; line-height: 1.3; color: rgb(0, 0, 0); font-family: Verdana, Arial, Geneva, sans-serif; font-size: 11px;"><font style="padding: 0px; margin: 0px;">Hộp đựng thức ăn kèm 4 hộp chứa có thể hâm trong lò viba và muỗng nĩa ăn tiện lợi. Bề mặt thép không gỉ bền, cách nhiệt chân không giữ nhiệt hoàn hảo. Kèm úi mang theo.</font></p>\r\n\r\n<div class="specList" style="padding: 0px; margin: 0px 0px 0px -25px; color: rgb(0, 0, 0); font-family: Verdana, Arial, Geneva, sans-serif; font-size: 11px; line-height: normal; text-align: -webkit-center;">\r\n<ul style="padding-right: 0px; padding-left: 0p