ica, sans-serif; font-size: 14px; line-height: normal;"><span style="box-sizing: border-box;">- Dung tích: 600 ml</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="box-sizing: border-box;">- Kích thước: </span><span style="box-sizing: border-box;">6.5 x 6.5 x 25.5 cm</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="box-sizing: border-box;">- Nhiệt độ nóng: 70 độ C/6 giờ</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="box-sizing: border-box;">- Nhiệt độ lạnh: 9 độ C/6 giờ</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="box-sizing: border-box;">- Màu sắc: Xanh</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="box-sizing: border-box;"><img alt="mych.vn Bình giữ nhiệt Zojirushi SM-XB60" height="244" src="http://mych.vn/vubaohuy/upload/images/BINH%20GIU%20NHIET/XB60-AM%20d.jpg" style="box-sizing: border-box; vertical-align: middle; border: 0px; display: block; max-width: 100%; height: auto; margin-left: auto; margin-right: auto;" title="Bình Nóng Lạnh Zojirushi ZOBL-SM-XB60-AM – 600 ML" width="400" /></span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="box-sizing: border-box; font-weight: 700;">Mô tả tính năng</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><spa