g: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;">- Chức năng lọc bọt hiện đại.</p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;">- Có vạch báo nước tiện lợi.</p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;">- Bình chứa có thể tháo rời, dễ dàng vệ sinh.</p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><img alt="mych.vn Máy Pha Cà Phê Zojirushi ZOPC-EC-DAQ50-SA" height="300" src="http://mych.vn/vubaohuy/upload/images/AM%20SIEU%20TOC/zojirushi-zopc-ec-daq50-sa-c.jpg" style="box-sizing: border-box; vertical-align: middle; border: 0px; display: block; max-width: 100%; height: auto; margin-left: auto; margin-right: auto;" title="Máy Pha Cà Phê Zojirushi ZOPC-EC-DAQ50-SA" width="400" /></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="color:#8B4513;"><span style="box-sizing: border-box; font-weight: 700;">Thông số kỹ thuật</span></span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;">- Công suất: 650W</p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;">- Dung tích: 680ml</p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;">- Điện áp: 220-240V/50-60Hz</p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;">- Có chức năng giữ ấm</p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><img alt="mych.vn Máy Pha Cà Phê Zojirushi ZOPC-EC-DAQ50-SA" height="300" src="http://mych.vn/vubaohuy/upload/images/AM%20SIEU%20TOC/zojirushi-zopc-ec-daq50-sa-d.jpg" style="box-sizing: border-box; vertical-align: middle; border: 0px; display: block; max-width: 100%; height: auto; margin-left: auto; margin-right: auto;" title="Máy Pha Cà Phê Zojirushi ZOPC-EC-DAQ50-SA" width="400" /></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="color:#0000CD;"><span style="box-sizing: border-box; font-weight: 700;">Mô tả tính năng</span></span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="box-sizing: border-box; font-weight: 700;"><span style="color:#8B4513;">Dung tích 680ml</span> </span>Máy được trang bị phễu chứa lớn nên cho phép bạn pha chế đến 5 cốc cà phê một lúc tương đương với 680ml, cùng bộ phận lọc than hoạt tính và lọc bọt, giúp cà phê luôn đậm hương vị và tinh khiết. Ngoài ra, máy còn có chế độ giữ ấm tự động, giúp bạn luôn có thể thưởng thức được những tách cà phê nóng.</p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="color:#8B4513;"><span style="box-sizing: border-box; font-weight: 700;">Thiết kế thông minh </span></span>Với các chức năng chống nhỏ giọt, hâm nóng nhanh, lọc bọt, sản phẩm là một sự lựa chọn tuyệt vời cho những ai có thói quen dùng café hằng ngày.</p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="box-sizing: border-box;">Vạch báo mực nước giúp bạn nhận biết lượng nước bên trong cốc chính xác, từ đó pha chế những ly café thơm ngon hợp khẩu vị nhất.</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="box-sizing: border-box;">Các bộ phận của máy được cấu tạo tháo rời tiện dung, cho phép bạn vệ sinh sản phẩm dễ dàng sau khi sử dụng.</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"> </p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="color:#8B4513;"><span style="box-sizing: border-box; font-weight: 700;">Đơn g</span></span><span style="box-sizing: border-box; font-weight: 700;"><span style="color:#8B4513;">iản, dễ sử dụng</span> </span>Cách thức sử dụng máy pha cà phê hoàn toàn đơn giản và dễ dàng chỉ với 1 thao tác bấm nút khởi động, bạn chỉ chờ trong giây lát để có được ly café như ý.</p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;">Tay cầm cách nhiệt giúp bạn lấy cốc pha ra khỏi máy đơn giản và dễ dàng mà không sợ bỏng tay gây rơi rớt hay đổ vỡ.</p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="box-sizing: border-box; font-weight: 700;"><span style="color:#8B4513;">Phụ kiện đầy đủ</span> </span>Cốc pha café dung tích 0.6L bằng chất liệu thủy tinh cao cấp, chống trầy xước, giữ cho sản phẩm có được tuổi thọ lâu dài hơn.</p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="box-sizing: border-box;">Sản phẩm được tặng kèm muỗng múc café chuẩn giúp bạn định lượng chính xác hơn.</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"><span style="color:#8B4513;"><span style="box-sizing: border-box; font-weight: 700;">Kiểu dáng hiện đại </span></span><span style="box-sizing: border-box;">Với thiết kế hiện đại, trang nhã, máy pha cà phê<span style="color:#0000CD;"> </span></span><span style="color:#0000CD;"><span style="box-sizing: border-box; font-weight: 700;">Zojirushi ZOPC-EC-DAQ50-SA</span></span><span style="box-sizing: border-box;"> thích hợp cho mọi không gian từ gia đình cho đến văn phòng.</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"> </p>\r\n\r\n<div> </div>\r\n', '', '', '', '', '', '', 1, 1, 1462405099, 1464249481, 0),
