(329, 58, 15, 79, 0, '', 0, 0, '', '', 'product', 0, 0, '', '', 'Cân Sức Khoẻ Điện Tử Tiross TS819 ', 'TS819 ', 'can-suc-khoe-dien-tu-tiross-ts819', '', '', '', 'Trung Quốc', 0, 800, '12 tháng', '', 'Cân Sức Khoẻ Điện Tử Tiross TS819 ', 'Cân sức khỏe,cân đo sức khỏe,cân điện tử,cân y tế,can suc khoe', 'Khoảng đo lường: Từ 5kg - 150kg.Đơn vị chia nhỏ nhất: 100g,Mặt kính chịu lực an toàn 8mm,Màn hình LCD,Sử dụng nguồn pin, Nhiệt độ: +10oC ÷ +40oC. Độ ẩm: 85%', 0, 0, 579000, 0, 'Khoảng đo lường: Từ 5kg - 150kg.Đơn vị chia nhỏ nhất: 100g,Mặt kính chịu lực an toàn 8mm,Màn hình LCD,Sử dụng nguồn pin, Nhiệt độ: +10oC ÷ +40oC. Độ ẩm: 85%', '<p style="color: rgb(0, 0, 0); font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 10px; line-height: normal;"><span data-mce-style="box-sizing: border-box; font-weight: bold; color: #0000ff; font-family: Arial, Helvetica, sans-serif; font-size: large;" style="box-sizing: border-box; font-weight: 700; color: rgb(0, 0, 255); font-family: Arial, Helvetica, sans-serif; font-size: large;">Cân Sức Khoẻ Điện Tử Tiross TS819</span><span data-mce-style="box-sizing: border-box; font-family: Arial, Helvetica, sans-serif; font-size: medium; color: #000000;" style="box-sizing: border-box; font-family: Arial, Helvetica, sans-serif; font-size: medium;"><span data-mce-style="box-sizing: border-box; font-family: Arial, Helvetica, sans-serif;" style="box-sizing: border-box;"> </span><span data-mce-style="box-sizing: border-box; font-family: Arial, Helvetica, sans-serif;" style="box-sizing: border-box;">là sản phẩm không thể thiếu trong các gia đình hiện đại. Sản phẩm giúp bạn theo dõi tình trạng cân nặng các thành viên trong gia đình để có chế độ ăn uống thích hợp. Thiết kể thanh lịch, sang trọng thuận tiện cho việc cất giữ và lau chùi. Màn hình LCD trên cân lớn, các con số hiển thị rõ ràng. Sản phẩm có màu đen sang trọng góp phần tô điểm cho không gian sống của bạn hiện đại và năng động hơn.</span></span></p>\r\n\r\n<p data-mce-style="box-siz