0; position: relative; vertical-align: baseline; top: -0.5em;" style="box-sizing: border-box; font-size: 10.5px; line-height: 0; position: relative; vertical-align: baseline; top: -0.5em;">o</span>và 85<span data-mce-style="box-sizing: border-box; font-size: 10.5px; line-height: 0; position: relative; vertical-align: baseline; top: -0.5em;" style="box-sizing: border-box; font-size: 10.5px; line-height: 0; position: relative; vertical-align: baseline; top: -0.5em;">o</span>.</p>\r\n\r\n<p data-mce-style="box-sizing: border-box; margin: 0px 0px 10px; color: #333333; font-family: Arial, Helvetica, sans-serif; font-size: 14px;" style="line-height: normal; box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px;">- Lồng quạt bằng thép được sơn tĩnh điện đảm bảo sự an toàn trong quá trình sử dụng</p>\r\n\r\n<p data-mce-style="box-sizing: border-box; margin: 0px 0px 10px; color: #333333; font-family: Arial, Helvetica, sans-serif; font-size: 14px;" style="line-height: normal; box-sizing: border-box; margin: 0px 0px 10px; font-family: Arial, Helvetica, sans-serif; font-size: 14px;">- Thân quạt bằng thép, bọc bằng nhựa cao cấp</p>\r\n', '', '', '', '', '', 1, 1, 1462512088, 0, 0);
